(20, '2024 - Delhi - India Islamic Cultural Centre', '<p>On 2024, Rahat Group held its Annual General Meeting (AGM) at the \nprestigious India Islamic Cultural Centre in Delhi. The event, attended \nby key stakeholders and members, provided an excellent platform for \ndiscussing the group’s achievements and future goals.</p><p><br></p><p>The meeting featured insightful presentations, engaging discussions, and\n an opportunity to connect with fellow professionals. We are pleased to \nshare some highlights from the event through the photos below.</p><p><br></p><p>Thank you to all who participated and contributed to the success of this\n important occasion. Stay tuned for more updates from Rahat Group!</p>', NULL, 1, '2024-07-16 10:55:08', '2024-08-16 11:37:52', NULL),
(21, '2024 - Mumbai - West End Hotel', '<p>The <b>Rahat Group</b>&nbsp;Annual General Meeting at the West End Hotel in \nMumbai was a significant event marked by insightful discussions, \nstrategic planning, and a strong emphasis on future growth. The day \nbegan with a formal inaugural session, where senior executives and key \nstakeholders set the tone for the event by outlining the group\'s vision \nand goals. A highlight was the leadership panel discussion, where top \nexecutives shared their insights on market expansion, digital \ntransformation, and sustainability, while engaging with shareholders\' \nquestions. Throughout the day, attendees took part in networking \nsessions, building valuable connections in the luxurious setting of the \nWest End Hotel. The CEO’s presentation of the annual report provided a \ncomprehensive overview of the company’s achievements, challenges, and \nstrategic initiatives for the upcoming year. The event also featured an \naward ceremony recognizing the exceptional contributions of employees \nand partners, reinforcing the company’s commitment to excellence. The \nAGM concluded with closing remarks from the leadership, who articulated a\n clear and optimistic vision for the future, leaving attendees with a \nrenewed sense of purpose and commitment.</p>', NULL, 1, '2024-08-22 14:12:56', '2024-08-22 14:12:56', NULL),
(22, '2018 - Mumbai - Islam Gymkhana.', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\">Fourth Annual General Meeting&nbsp; of Rahat Group was Held at Prestigious Islam Gymkhana in MUMBAI on 28th July 2018.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\">Around 200 Agents from Maharashtra and South India attended the Event.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\">Rahat Travels Of India in Association with All India Hajj and Umrah Tours Pvt. Ltd. conducts Annual General Meeting every year to discuss ways to improve Guests Experiences.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\">Travel Partners and Hajj Umrah Operators from all over India are invited to give their Feedback and Suggestion on the year gone by and to plan for new coming year.&nbsp;</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\"><br style=\"font-family: Poppins, sans-serif;\"></p>', NULL, 1, '2024-08-22 18:38:32', '2024-08-22 18:38:32', NULL),
(23, '2022 - New Delhi - Sentinel Hotel', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Alhamdulillah&nbsp;</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Post Covid Our First AGM &amp; Actually our Sixth AGM was conducted in New Delhi on&nbsp;12th JUNE 2022.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">With a lot of Enthusiasm more than 100 agents attended the Annual General Meeting.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\"><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">Rahat Travels Of India in Association with All India Hajj and Umrah Tours Pvt. Ltd. conducts Annual General Meeting every year to discuss ways to improve Our Services and Guest Umrah Experience.</span></p>', NULL, 1, '2024-08-22 18:41:54', '2024-08-22 18:41:54', NULL),
(24, '2019 - New Delhi - Indian Islamic Culture Center', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\"><font face=\"Arial, Helvetica, sans-serif\"><span style=\"font-size: 12px;\">After Islam Gymkhana in 2018, Rahat Group conducted its 5th Annual General Meeting on 30th September 2019 in India Islamic Cultural Centre,&nbsp;</span></font><span style=\"font-size: 12px; font-family: Arial, Helvetica, sans-serif;\">New Delhi.</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\"><span style=\"font-size: 12px; font-family: Arial, Helvetica, sans-serif;\">This was to discuss New Umrah Policy which was introduced by Saudi Government.</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\"><span style=\"font-size: 12px; font-family: Arial, Helvetica, sans-serif;\">Rahat Travels Of India in Association with All India Hajj and Umrah Tours Pvt. Ltd. conducts Annual General Meeting every year to discuss ways to improve Guests Experiences. Travel Partners and Hajj Umrah Operators from all over India are invited to give their Feedback and Suggestion on the year gone by and to plan for new coming year. Please find below pictures of some of our Annual General Meetings.</span></p>', NULL, 1, '2024-08-22 18:49:18', '2024-08-22 18:49:18', NULL),
(25, '2017 - New Delhi - The Lalit', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Third Annual General Meeting of Rahat Group was held in a Five Star Hotel, The Lalit on&nbsp;<span style=\"font-weight: 700;\">29th July 2017&nbsp;</span>and was attened by over 500 Agents from all over India.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Rahat Travels Of India in Association with All India Hajj and Umrah Tours Pvt. Ltd. conducts Annual General Meeting every year between Ramzaan and Hajj to discuss ways to improve Guests Experiences. Travel Partners and Hajj Umrah Operators from all over India are invited to give their Feedback and Suggestion on the year gone by and to plan for new coming year. Please find below pictures of some of our Annual General Meetings.</p>', NULL, 1, '2024-08-22 18:56:29', '2024-08-22 18:56:29', NULL),
(26, '2015 - Jaipur - Maharani Palace', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\"><span style=\"font-size: 12px; font-family: Arial, Helvetica, sans-serif;\">Second Annual General Meeting of Rahat Group was held in Maharani Palace in Jaipur on&nbsp;</span><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">22nd August 2015&nbsp;</span><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">and was attended by over 200 agents from All Over India....</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\"><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234);\">&nbsp; &nbsp;Click on links below for Pics of the event....</span><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234);\"></p><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 14px; padding: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234);\"><li style=\"list-style-type: disc; margin: 0px; padding: 5px 0px; line-height: 18px; text-align: left;\"><span style=\"font-weight: bold;\"><a href=\"https://www.facebook.com/media/set/?set=a.944163598962596.1073741914.187074714671492&amp;type=3\" target=\"_blank\" style=\"color: rgb(204, 0, 0);\">AGM Preparation.</a></span></li><li style=\"list-style-type: disc; margin: 0px; padding: 5px 0px; line-height: 18px; text-align: left; font-weight: bold;\"><a href=\"https://www.facebook.com/media/set/?set=a.944228362289453.1073741916.187074714671492&amp;type=3\" target=\"_blank\" style=\"color: rgb(204, 0, 0);\">Maharani Palace Banquet Hall &amp; Powerpoint Presentation.</a></li><li style=\"list-style-type: disc; margin: 0px; padding: 5px 0px; line-height: 18px; text-align: left; font-weight: bold;\"><a href=\"https://www.facebook.com/media/set/?set=a.944786028900353.1073741920.187074714671492&amp;type=3\" target=\"_blank\" style=\"color: rgb(204, 0, 0);\">Lunch &amp; Buffet Pics</a>.</li><li style=\"list-style-type: disc; margin: 0px; padding: 5px 0px; line-height: 18px; text-align: left; font-weight: bold;\"><a href=\"https://www.facebook.com/media/set/?set=a.945022812210008.1073741921.187074714671492&amp;type=3&amp;uploaded=49\" target=\"_blank\" style=\"color: rgb(204, 0, 0);\">Souvenior Distribution</a></li><li style=\"list-style-type: disc; margin: 0px; padding: 5px 0px; line-height: 18px; text-align: left; font-weight: bold;\"><a href=\"https://www.facebook.com/media/set/?set=a.944210008957955.1073741915.187074714671492&amp;type=3\" style=\"color: rgb(204, 0, 0);\">Awards Trophies &amp; Certificates.</a></li><li style=\"list-style-type: disc; margin: 0px; padding: 5px 0px; line-height: 18px; text-align: left; font-weight: bold;\"><a href=\"https://www.facebook.com/media/set/?set=a.944739412238348.1073741919.187074714671492&amp;type=3\" target=\"_blank\" style=\"color: rgb(204, 0, 0);\">Closing Ceremony with Duaa.</a><br><br></li><li style=\"list-style-type: disc; margin: 0px; padding: 5px 0px; line-height: 18px; text-align: left;\"><a href=\"https://www.youtube.com/playlist?list=PL2d-OLJrD0XBUGvw6lYsqXnIt0prf-F6x\" target=\"_blank\" style=\"color: rgb(204, 0, 0);\">Videos of 2nd AGM</a>&nbsp;-&nbsp;<a href=\"https://www.youtube.com/playlist?list=PL2d-OLJrD0XBUGvw6lYsqXnIt0prf-F6x\" target=\"_blank\" style=\"color: rgb(204, 0, 0);\">Jaipur (Quraan Qiraat at Opening, Duaa at Closing)</a></li></ul>', NULL, 1, '2024-08-22 19:05:49', '2024-08-22 19:05:49', NULL),
(27, '2014 - New Delhi - Jasmine Boutique.', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\"><font face=\"Arial, Helvetica, sans-serif\"><span style=\"font-size: 12px;\">Alhamdulillah&nbsp;<br></span></font><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">First Annual General Meeting of Rahat Group was conducted on 06th September 2014, at JASMINE BOUTIQUE Resort, Jasola, New Delhi.<br></span><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">Rahat Travels Of India in Association with All India Hajj and Umrah Tours Pvt. Ltd. conducts Annual General Meeting every year to discuss ways to improve Our Services and Guest Umrah Experience.</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\"><span style=\"font-size: 12px; font-family: Arial, Helvetica, sans-serif;\">More than 150 Travel Partners and Hajj Umrah Operators from all over India are invited to give their Feedback and Suggestion on the year gone by and to plan for new coming year.<br><br></span><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234);\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Click on links below for Pics of the event....</span><br style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234);\"></p><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 14px; padding: 0px; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234);\"><li style=\"list-style-type: disc; margin: 0px; padding: 5px 0px; line-height: 18px; text-align: left;\"><span class=\"style10 style17\" style=\"color: rgb(255, 0, 0);\"><a href=\"https://www.facebook.com/media/set/?set=a.763071423738482.1073741899.187074714671492&amp;type=3\" target=\"_blank\" style=\"color: rgb(204, 0, 0); font-weight: bold;\">Banquet &amp; Presentation</a></span></li><li style=\"list-style-type: disc; margin: 0px; padding: 5px 0px; line-height: 18px; text-align: left;\"><span class=\"style10 style17\" style=\"color: rgb(255, 0, 0);\"><a href=\"https://www.facebook.com/media/set/?set=a.763001710412120.1073741896.187074714671492&amp;type=3\" target=\"_blank\" style=\"color: rgb(204, 0, 0); font-weight: bold;\">Souvenir Distribution</a></span></li><li style=\"list-style-type: disc; margin: 0px; padding: 5px 0px; line-height: 18px; text-align: left;\"><span class=\"style10 style17\" style=\"color: rgb(255, 0, 0);\"><a href=\"https://www.facebook.com/media/set/?set=a.763050277073930.1073741898.187074714671492&amp;type=3\" target=\"_blank\" style=\"color: rgb(204, 0, 0); font-weight: bold;\">Lunch &amp; Buffet</a></span></li><li style=\"list-style-type: disc; margin: 0px; padding: 5px 0px; line-height: 18px; text-align: left;\"><span class=\"style10 style17\" style=\"color: rgb(255, 0, 0);\"><a href=\"https://www.facebook.com/media/set/?set=a.763018473743777.1073741897.187074714671492&amp;type=3\" target=\"_blank\" style=\"color: rgb(204, 0, 0); font-weight: bold;\">Awards &amp; Felicitation</a></span></li></ul><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\"><br style=\"font-family: Poppins, sans-serif;\"></p>', NULL, 1, '2024-08-22 19:23:38', '2024-08-22 19:23:38', NULL),
(28, '2023 - Sentinel - New Delhi - 27th August', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">On 1th August 2023, Rahat Group in Association with All India Hajj and Umrah Tours Pvt. Ltd. conducted an AGM for all Agents of Uttar Pradesh in Delhi at Sentinel Hotel.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">With the Growing Number of Members Rahat Group in 2023 conducted Six AGMs in Six State Capitals of India.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Starting from Hyderabad,</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Hyderabad..Taj Deccan<br>Mumbai .. The Sahil<br>Ahmedabad..Lemon Tree<br>Jaipur....Radisson Blu<br>Delhi.. The Sentinel<br>Srinagar.. Asian Plaza</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Rahat Group Members from All Over India Attended the Event which was a Great Success.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Rahat Travels Of India in Association with All India Hajj and Umrah Tours Pvt. Ltd. conducts Annual General Meeting every year to discuss ways to improve Guests Experiences. Travel Partners and Hajj Umrah Operators from all over India are invited to give their Feedback and Suggestion on the year gone by and to plan for new coming year. Please find below pictures of some of our Annual General Meetings.</p>', NULL, 1, '2024-08-22 19:24:50', '2024-08-22 19:24:50', NULL),
(29, '2023 - Asian Park - Srinagar - 30th August', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">On 30th August 2023, Rahat Group in Association with All India Hajj and Umrah Tours Pvt. Ltd. conducted an AGM for all Agents of Jammu and Kashmir in Srinagar at the Asian Park Hotel.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">With the Growing Number of Members Rahat Group in 2023 conducted Six AGMs in Six State Capitals of India.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Starting from Hyderabad,</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Hyderabad..<span style=\"font-weight: 700;\">Taj Deccan</span><br>Mumbai ..&nbsp;<span style=\"font-weight: 700;\">The Sahil</span><br>Ahmedabad..<span style=\"font-weight: 700;\">Lemon Tree</span><br>Jaipur....<span style=\"font-weight: 700;\">Radisson Blu</span><br>Delhi..&nbsp;<span style=\"font-weight: 700;\">The Sentinel</span><br>Srinagar..&nbsp;<span style=\"font-weight: 700;\">Asian Plaza</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Rahat Group Members from All Over India Attended the Event which was a Great Success.</p>', NULL, 1, '2024-08-22 19:26:36', '2024-08-22 19:26:36', NULL),
(30, '2023 - Radisson Blu - Jaipur - 24th August', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Rahat Group Members from Rajasthan attended the meeting in Radisson Blu Hotel, Jaipur on 24nd August 2023.<br><br>With the Growing Number of Members Rahat Group in 2023 conducted Six AGMs in Six State Capitals of India.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Hyderabad..<span style=\"font-weight: 700;\">Taj Deccan<br></span>Mumbai ..&nbsp;<span style=\"font-weight: 700;\">The Sahil<br></span>Ahmedabad..<span style=\"font-weight: 700;\">Lemon Tree<br></span>Jaipur....<span style=\"font-weight: 700;\">Radisson Blu<br></span>Delhi..&nbsp;<span style=\"font-weight: 700;\">The Lalit<br></span>Srinagar..&nbsp;<span style=\"font-weight: 700;\">Asian Plaza</span></p>', NULL, 1, '2024-08-22 19:29:36', '2024-08-22 19:29:36', NULL),
(31, '2023 - Sahil Hotel - Mumbai - 19th August', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">On 19th August 2023, Rahat Group in Association with All India Hajj and Umrah Tours Pvt. Ltd. conducted an AGM for all Agents of Maharashtra in Mumbai at the SAHIL HOTEL.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">With the Growing Number of Members Rahat Group in 2023 conducted Six AGMs in Six State Capitals of India.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Starting from Hyderabad,</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Hyderabad..<span style=\"font-weight: 700;\">Taj Deccan</span><br>Mumbai ..&nbsp;<span style=\"font-weight: 700;\">The Sahil</span><br>Ahmedabad..<span style=\"font-weight: 700;\">Lemon Tree</span><br>Jaipur....<span style=\"font-weight: 700;\">Radisson Blu</span><br>Delhi..&nbsp;<span style=\"font-weight: 700;\">The Lalit</span><br>Srinagar..&nbsp;<span style=\"font-weight: 700;\">Asian Plaza</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Rahat Group Members from All Over India Attended the Event which was a Great Success.</p>', NULL, 1, '2024-08-22 19:30:45', '2024-08-22 19:30:45', NULL),
(32, '2023 - TaJ Deccan - Hyderabad - 18th August', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">On 18th August 2023, Rahat Group in Association with All India Hajj and Umrah Tours Pvt. Ltd. conducted an AGM for all Agents of Telangana, Tamil Nadu, Karnataka in Hyderabad at The Taj Deccan Hotel.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">With the Growing Number of Members Rahat Group in 2023 conducted Six AGMs in Six State Capitals of India.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Starting from Hyderabad,</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Hyderabad..Taj Deccan<br>Mumbai .. The Sahil<br>Ahmedabad..Lemon Tree<br>Jaipur....Radisson Blu<br>Delhi.. The Sentinel<br>Srinagar.. Asian Plaza</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Rahat Group Members from All Over India Attended the Event which was a Great Success.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Rahat Travels Of India in Association with All India Hajj and Umrah Tours Pvt. Ltd. conducts Annual General Meeting every year to discuss ways to improve Guests Experiences. Travel Partners and Hajj Umrah Operators from all over India are invited to give their Feedback and Suggestion on the year gone by and to plan for new coming year. Please find below pictures of some of our Annual General Meetings.</p>', NULL, 1, '2024-08-22 19:31:51', '2024-08-22 19:31:51', NULL),
(33, '2023 - Lemon Tree - Ahmedabad - 22nd August', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">On 22nd August 2023, Rahat Group in Association with All India Hajj and Umrah Tours Pvt. Ltd. conducted an AGM for all Agents of Gujarat in Ahmedabad at the Lemon Tree Hotel Ex Mariott.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">With the Growing Number of Members Rahat Group in 2023 conducted Six AGMs in Six State Capitals of India.<br><br>Hyderabad..Taj Deccan<br>Mumbai .. The Sahil<br>Ahmedabad..Lemon Tree<br>Jaipur....Radisson Blu<br>Delhi.. The Sentinel<br>Srinagar.. Asian Plaza</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\"><br>Rahat Group Members from All Over India Attended the Event which was a Great Success.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Rahat Travels Of India in Association with All India Hajj and Umrah Tours Pvt. Ltd. conducts Annual General Meeting every year to discuss ways to improve Guests Experiences. Travel Partners and Hajj Umrah Operators from all over India are invited to give their Feedback and Suggestion on the year gone by and to plan for new coming year. Please find below pictures of some of our Annual General Meetings.</p>', NULL, 1, '2024-08-22 19:33:15', '2024-08-22 19:33:15', NULL),
