INSERT INTO `aihut_awards` (`id`, `title`, `sub_title`, `description`, `is_active`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Biswajita', 'hii', '<p>hii</p>', 1, '2024-07-10 06:04:57', '2024-08-22 14:19:27', '2024-08-22 14:19:27'),
(2, 'CEO Hajj Committee of India appreciation award', 'CEO Hajj Committee ', '<p><span style=\"font-size: 12px; font-family: Verdana;\">The minister held a\n number of meetings with leaders, businessmen and investors in the Hajj \nand Umrah services. Both sides discussed coordination and cooperation in\n facilitating the arrival of pilgrims to the two holy cities of Makkah \nand Madinah. <br></span></p>', 1, '2024-07-16 07:45:51', '2024-08-06 12:16:53', NULL),
(3, 'Celebrating Excellence: Rahat Travel of India Wins', 'Celebrating Excellence: Rahat Travel of India Wins', '<div class=\"infotxt\">\n                                    <p>We are thrilled to announce that \nRahat Travel of India has been honored with the prestigious Al Deafa \nAward. This accolade recognizes our commitment to delivering exceptional\n travel experiences and our unwavering dedication to customer \nsatisfaction.</p><p><br></p><p>The Al Deafa Award is a testament to our \nteam’s hard work, innovative approach, and passion for providing \ntop-notch travel services. This achievement reflects our continuous \nefforts to set new standards in the travel industry and to exceed the \nexpectations of our valued clients.</p><p><br></p><p>We extend our \nheartfelt gratitude to our clients, partners, and dedicated staff, whose\n support and trust have been instrumental in earning this recognition.</p><p><br></p><p>Join\n us in celebrating this remarkable milestone as we continue to strive \nfor excellence and deliver unforgettable travel experiences.</p>\n                                </div>', 1, '2024-08-06 12:13:49', '2024-08-20 16:03:18', NULL),
(4, 'Most Umra Visa in a Calendar Year', 'Most Umra Visa in a Calendar Year', '<p><font face=\"Verdana\" style=\"font-size: 14px;\"><span style=\"font-size: 12px;\">MUMBAI\n — His Highness Mr. Mohammad Fida Managing Director of Lean Umrah \nservices awards Mr. Imran Rahat Shaikh for Maximum Number of Umrah Visa \nin One Calendar Year from INDIA. The Function was attended by Saudi \nMinister of Hajj &amp; Umrah at the Launch of NUSUK Platform in India.&nbsp;</span></font><span style=\"font-family: Verdana; font-size: 12px;\">The\n Saudi minister also held a number of meetings with Indian leaders, \nbusinessmen and investors in the Hajj and Umrah services. Both sides \ndiscussed coordination and cooperation in facilitating the arrival of \npilgrims from India to the two holy cities of Makkah and Madinah. <br></span></p>', 1, '2024-08-22 13:40:24', '2024-08-22 15:48:09', NULL),
(5, 'His Highness Minister of Hajj and Umrah Mr. Tawfiq', 'His Highness meets the Owner of Rahat Group in ', '<div style=\"font-family: Poppins, sans-serif;\"><font face=\"Verdana\"><span style=\"font-size: 12px;\">MAKKAH — His Highness Minister of Hajj and Umrah Mr. Tawfiq Al-Rabiah meets Mr. Imran Rahat Shaikh, Managing Director of Rahat Group personally to discuss issues related to Hajj and Umrah in India and to take suggestion on ways to improve it.<br>Top 10 Umrah Companies of Umrah World were also Invited.</span></font></div><div style=\"font-family: Poppins, sans-serif;\"><font face=\"Verdana\"><span style=\"font-size: 12px;\"><br></span></font></div><div style=\"font-family: Poppins, sans-serif;\"><span style=\"font-size: 12px; font-family: Verdana;\">The minister held a number of meetings with leaders, businessmen and investors in the Hajj and Umrah services. Both sides discussed coordination and cooperation in facilitating the arrival of pilgrims to the two holy cities of Makkah and Madinah.&nbsp;</span></div><div style=\"font-family: Poppins, sans-serif;\"><div><font face=\"Verdana\"><span style=\"font-size: 12px;\"><br></span></font></div><div><font face=\"Verdana\"><span style=\"font-size: 12px;\">The Minister was accompanied by a high-level delegation, including senior officials of the ministry, as well as partners of the Hajj and Umrah system, and representatives of the private sector, in addition to parties and agencies related to serving the pilgrims.&nbsp;</span></font><span style=\"font-size: 12px; font-family: Verdana;\">The visit is part of the continuous efforts of the Ministry of Hajj and Umrah to build bridges of communication and cooperation with the countries of the world and to introduce the exceptional services provided by the Kingdom to the Hajj and Umrah pilgrims and visitors to enrich their experiences and help them perform their rituals in ease and comfort.</span></div></div>', 1, '2024-08-23 15:56:26', '2024-08-23 15:56:26', NULL),
(6, 'NUSUK and STA Rewards Top 10 Umrah Co.,', 'Top 10 Umrah Company of India Receive Awards and Appreciation at NUSUK Launch Platform ', '<p><span style=\"color: rgb(67, 67, 67); font-family: Verdana; font-size: 12px;\">MUMBAI: NUSUK &amp;&nbsp;</span><font color=\"#434343\" face=\"RobotoSlab\"><span style=\"font-size: 12px; font-family: Verdana;\">Saudi Tourism Authority rewards and appreciates Top Ten Umrah Companies of India and Signs MOU with Rahat Group to promote Saudi Tourism via Umrah Groups.&nbsp;</span></font><span style=\"color: rgb(67, 67, 67); font-family: Verdana; font-size: 12px;\">Saudi Arabia’s Minister for Hajj and Umrah Tawfiq bin Fawzan Al-Rabiah has embarked on a visit to India with an aim of streamlining and outlining comprehensive plans for hosting Indian pilgrims and Umrah performers. A readout released by the Saudi embassy in Delhi said Al-Rabiah will engage in high-level discussions with Indian leaders and prominent figures in the Hajj and Umrah services sector, with a focus on strengthening coordination and collaboration.</span><br></p>', 1, '2024-08-23 15:58:22', '2024-08-23 15:58:22', NULL),
(7, 'Team Saudi Airlines Rewards Rahat Group', 'Rahat Group with Team Saudi Airlines on Nusuk Launch event', '<p><span style=\"font-family: Poppins, sans-serif;\">Rahat Group with Team Saudi Airlines on Nusuk Launch event</span><br></p>', 1, '2024-08-23 15:59:53', '2024-08-23 15:59:53', NULL),
(8, 'Saudi Tourism Authority Signs MOU with Rahat Group', ' MOU with Rahat Group', '<p><span style=\"color: rgb(67, 67, 67); font-family: Verdana; font-size: 12px;\">MUMBAI:&nbsp;</span><font color=\"#434343\" face=\"RobotoSlab\"><span style=\"font-size: 12px; font-family: Verdana;\">Saudi Tourism Authority Signs MOU with Rahat Group to promote Saudi Tourism via Umrah Groups.&nbsp;</span></font><span style=\"color: rgb(67, 67, 67); font-family: Verdana; font-size: 12px;\">Saudi Arabia’s Minister for Hajj and Umrah Tawfiq bin Fawzan Al-Rabiah has embarked on a visit to India with an aim of streamlining and outlining comprehensive plans for hosting Indian pilgrims and Umrah performers. A readout released by the Saudi embassy in Delhi said Al-Rabiah will engage in high-level discussions with Indian leaders and prominent figures in the Hajj and Umrah services sector, with a focus on strengthening coordination and collaboration. It said the collective aim is to bring about a qualitative and unique transformation in the experience of the pilgrims, further underscoring Saudi Arabia’s enduring dedication to serving them and visitors with “unparalleled” hospitality.</span><br></p>', 1, '2024-08-23 16:01:34', '2024-08-23 16:01:34', NULL),
(9, 'Saudi Hajj Minister Awards Qiswa to Rahat Group', 'Qiswa to Rahat Group', '<div style=\"font-family: Poppins, sans-serif;\"><font face=\"Verdana\"><span style=\"font-size: 12px;\">MAKKAH — His Highness Minister of Hajj and Umrah Mr. Tawfiq Al-Rabiah Awards Mr. Imran Shaikh Managing Director of Rahat Group with a Piece of QISWAA (Gilaafe Kaaba) On official launch of Nusuk in INDIA. Top 10 Umrah Companies of India which control 35% of Umrah Business in India were awarded with Gilaafe Kaaba on the Launch of Nusuk in India.</span></font></div><div style=\"font-family: Poppins, sans-serif;\"><font face=\"Verdana\"><span style=\"font-size: 12px;\"><br></span></font></div><div style=\"font-family: Poppins, sans-serif;\"><span style=\"font-size: 12px; font-family: Verdana;\">The minister held a number of meetings with Indian leaders, businessmen and investors in the Hajj and Umrah services. Both sides discussed coordination and cooperation in facilitating the arrival of pilgrims from India to the two holy cities of Makkah and Madinah.&nbsp;</span></div><div style=\"font-family: Poppins, sans-serif;\"><div><font face=\"Verdana\"><span style=\"font-size: 12px;\"><br></span></font></div><div><font face=\"Verdana\"><span style=\"font-size: 12px;\">The Minister was accompanied by a high-level delegation, including senior officials of the ministry, as well as partners of the Hajj and Umrah system, and representatives of the private sector, in addition to parties and agencies related to serving the pilgrims.&nbsp;</span></font><span style=\"font-size: 12px; font-family: Verdana;\">The visit is part of the continuous efforts of the Ministry of Hajj and Umrah to build bridges of communication and cooperation with the countries of the world and to introduce the exceptional services provided by the Kingdom to the Hajj and Umrah pilgrims and visitors to enrich their experiences and help them perform their rituals in ease and comfort.<br></span></div></div>', 1, '2024-08-23 16:05:19', '2024-08-23 16:05:19', NULL),
(10, 'INDIGO Best seller Award given to RAHAT TRAVELS OF INDIA ', 'INDIGO Best seller', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Alhamdulillah</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">INDIGO Best seller Award given to RAHAT TRAVELS OF INDIA</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">for BEST SELLER for YEAR 2021-22.</p>', 1, '2024-08-23 16:06:53', '2024-08-23 16:06:53', NULL),
(11, 'Saudi Airlines - Best Performance Award 2019', 'Best Performance Award 2019', 'Alhamdulillah\n\nRAHAT groups wins two prestigious awards at Annual Sales Function of Saudi Airlines for Best Performance Sales in Delhi & Mumbai\n\nTwo Most prominent cities of India Delhi and Mumbai are bagged by Rahat Group...\nThis again proves Rahat  Group is India\'s Largest and most trusted Umrah group of India.\n\nSaudi Airlines Top Performer Awards\n\nMUMBAI STATION :: Rahat Travels of India wins Best Performance award \nDELHI STATION :: Travel Nest wins Best Performance award \n\nThanks to all our Travel Partners and We\'ll wishers for all your support and hardwork...\n', 1, '2024-08-23 16:27:17', '2024-08-23 16:27:17', NULL),
(12, 'Saudi Airlines - Best Performance Award 2015', 'Received Best Performance award from \"SAUDI AIRLINES\"', 'Place :: Trident Oberoi, Nariman Point, Mumbai. \n\nDate :: 19th Nov 2015.\n\nIn presence were...\n\nHis excellency Mr Essam A Almaomani (GM Asia Australia)\nMr. Zaka sir (GSA Mumbai, Lucknow, Hyderabad),\nMr. Singh, Mr. Ravi, Mr. Massie\nAnd all top management of Saudi Airlines..\n\n\n\nTop 10 Best Umrah Tour Operators Of India using Saudi Airlines as their carrier were invited..\n\nIn attendance were -\n\nAkbar travels of India\nRahat travels of India\nCosmic Tours\nRiya Travels\nAtlas travels\nArabian tours\nAl Khalid Tours\n\nAnd a few more selected...', 1, '2024-08-23 16:31:32', '2024-08-23 16:31:32', NULL),
(13, 'Best Performance for Hajj from Moullim No 65.', 'Award Received by Imran Rahat Shaikh ', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Received an Award for Best Performance for Hajj from Moullim No 65. Mutawwif South East Asia</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Poppins, sans-serif;\">Award Received by Imran Rahat Shaikh&nbsp;</p>', 1, '2024-08-23 16:32:53', '2024-08-23 16:32:53', NULL),
(14, 'Best Social Services Award from Gul Bootey', 'Best Social Services Award from Gul Bootey', 'Received an Award for Social Services from Gul Bootey Mumbai', 1, '2024-08-23 16:34:57', '2024-08-23 16:34:57', NULL),
(15, 'Excellence Award from Deafa Group Makka', 'Received an Award for Best Performance in year 2023', 'Received an Award for Best Performance in year 2023 from Deafa Group of Hotels & Umrah Services Est. Makka\n\nAward Received by Imran Rahat Shaikh from General Manager Ahmed Refaae', 1, '2024-08-23 16:38:40', '2024-08-23 16:38:40', NULL),
(16, 'Anjum Hotel Makka - Hajj 2023', 'Anjum hotel Makka for Hajj 2023', 'Received an Award for Best Performance from Anjum hotel Makka for Hajj 2023\n\nAward Received by Imran Rahat Shaikh from General Manager', 1, '2024-08-23 16:39:55', '2024-08-23 16:39:55', NULL),
(17, 'Best Performance by Mobily, Saudi Arabia', 'Certificate of Appreciation Received by Imran Rahat Shaikh', 'Received an Award for Best Performance and Distribution of Mobily Sims in Hajj 2012 from Second Largest Telecom Company in Saudi Arabia, Mobily.\n\nCertificate of Appreciation Received by Imran Rahat Shaikh', 1, '2024-08-23 16:41:15', '2024-08-23 16:41:15', NULL),
(18, 'Best Performance from Makarem AL Jubail for Umrah', 'Award Received by Imran Rahat Shaikh from General Manager', 'Received an Award for Best Performance from Makarem AL Jubail for Umrah Services Est. (Makka)\n\nAward Received by Imran Rahat Shaikh from General Manager Saad Al Ruqui.', 1, '2024-08-23 16:42:49', '2024-08-23 16:42:49', NULL),
(19, 'Fastest Growing Indian Company Excellence Award.', ' An Award for the Fastest Growing Indian Company Excellence Award.', 'RAHAT GROUP has been acknowledged as One of the Fastest Growing Indian Company and has been selected for Company Excellence Award by International Achievers Conference\nThe Award will be presented at the International Achievers Conference and Awards Ceremony on Individual Achievements and National Development to be held in\nNewDelhi on Saturday 9th May 2020 at Gulmohar Hall, Indian Habitat Center, New Delhi\n\n\nMr Imran Rahat Shaikh of Rahat Group was Awarded at International Achievers Conference in Delhi.\n\nwith an Award for the Fastest Growing Indian Company Excellence Award.', 1, '2024-08-23 16:45:12', '2024-08-23 16:45:12', NULL),
(20, 'PULLMAN Zamzam Makkah 5* - Best Partner', 'Pullman ZAMZAM in Abraj Tower Makka Facilitates - RAHAT TRAVELS OF INDIA', 'Mr. Rahat Shaikh receives BEST TRAVEL PARTNER SHIELD from Mr. Gouda of\nPULLMAN ZAMZAM for doing Maximum Business this UMRAH SEASON with Pullman.\nRahat Group Of India becomes First Travel Company in #History to Receives such an HONOR & AWARD For\nMaximum Sales, Professional and Committed Approach.\nThanx to all our Loyal  Travel Partners & Indian Staff & Saudi Staff\nfor all their Dedicated Support and Good Wishes...\n\nPEACE, HAPPINESS and GOOD LUCK to YOU and YOUR FAMILY\nBEST WISHES FROM RAHAT FAMILY', 1, '2024-08-23 16:48:01', '2024-08-23 16:48:01', NULL),
(21, 'Jawharat al Rasheed Hotel Madina - Best Partner.', 'Best Travel Partner from India. ', 'Received an Award from Jawharat al Rasheed Hotel (Madina) for being their Best Travel Partner from India. \nAward Received by the Owner Mr. Ibrahim in Madina Munawwara.', 1, '2024-08-23 16:49:04', '2024-08-23 16:49:04', NULL),
(22, 'Most Innovative Technology Award.', 'Received an Award of Most Innovative Technology and Best Stall', 'Received an Award of Most Innovative Technology and Best Stall Decoration at Islamic travel Mart, held at World Trade Center Mumbai\n13th 14th October 2018\nRahat Group Receives Best STALL AWARD & EXCELLENCE in INNVOATIVE TECHNOLOGY.', 1, '2024-08-23 16:50:23', '2024-08-23 16:50:23', NULL),
(23, 'DEAFA GROUP Makka - Best Travel Partner', 'Received an Award from Deafa Group ', 'Received an Award from Deafa Group (Makka) for being their Best Travel Partner in the whole World.\nAl Deafa International Group owns 28 Hotels in Makka and Works in more than 40 Countries around the world.\n\nRahat Group Receives their Best Travel Partner around the World Award.', 1, '2024-08-23 16:53:11', '2024-08-23 16:53:11', NULL),
(24, 'ANJUM Hotel Makka 5* - Best Travel Partner', 'Received an Award from ANJUM 5* Hotel', 'Received an Award from ANJUM 5* Hotel from Makka for being their Best Travel Partner from India. \nAward Received from Senior Sales Manager Mr. Yassir at Islamic Travel Mart in World Trade Center, Mumbai, India', 1, '2024-08-23 16:54:03', '2024-08-23 16:54:03', NULL),
(25, 'National Award for Best Hajj & Umrah Tour Of India', ' Rahat Group becomes the only company in India to win this honour two times', 'Rahat Travels of India wins NATIONAL AWARD for BEST HAJJ AND UMRAH TOUR OF INDIA\nDr. M A Khan - CEO of Hajj Committee of India Presented today  National Award for  Best HAJJ AND UMRAH COMPANY  - 2018 / 2019 to \n\nRAHAT GROUP OF COMPANIES & Most Innovative Technology Award For HAJJ AND UMRAH Industry 2018 / 2019 to HajjUmrahOnline.com\n\nAt a function organized by INDO GULF TIMES in HAJJ HOUSE Mumbai today 2nd July 2019..\n\nAlhamdulillah Rahat Group becomes the only company in India to win this honour two times\n\n2015-2016 and 2018-19', 1, '2024-08-23 16:57:32', '2024-08-23 16:57:32', NULL),
(26, 'National Award for Best Hajj & Umrah Tour Of India', 'At a function organized by INDO GULF TIMES in HAJJ HOUSE Mumbai on 2nd July 2019..', 'Rahat Travels of India wins #NATIONAL #AWARD for BEST HAJJ AND UMRAH TOUR OF INDIA\nDr. M A Khan - CEO of Hajj Committee of India Presented today  National Award for  Best HAJJ AND UMRAH COMPANY  - 2018 / 2019 to \n\nRAHAT GROUP OF COMPANIES & Most Innovative Technology Award For HAJJ AND UMRAH Industry 2018 / 2019 to HajjUmrahOnline.com\n\nAt a function organized by INDO GULF TIMES in HAJJ HOUSE Mumbai today 2nd July 2019..\n\nAlhamdulillah Rahat Group becomes the only company in India to win this honour two times\n\n2015-2016 and 2018-19', 1, '2024-08-23 16:59:32', '2024-08-23 17:00:54', '2024-08-23 17:00:54'),
(27, 'State Award (Delhi) For Best Umrah Tour', 'He Award was given by Minister of Minority Affairs Mr. Mukhtar Abbas Naqvi', 'STATE AWARD (DELHI) BEST UMRAH TOUR - WINNER for 2016 - 2017\nawarded to Mr. Rahatullah Shaikh of  \"Rahat Travels Of India\"\n\nRahat Travels Of India once again won \"STATE Award (DELHI) for Best Hajj & Umrah Tour. 2016 - 2017\",\nin the category of Hajj & Umrah, at Indo Gulf Awards held at Hajj House in Mumbai on 12th Aug 2017\n\nThe Award was given by Minister of Minority Affairs Mr. Mukhtar Abbas Naqvi at a function held at Hajj House, Crawford Market. Mumbai.\n\nThis award is a recognition of continued Hardwork & Dedication put in by Rahat Team.', 1, '2024-08-23 17:03:02', '2024-08-23 17:03:02', NULL),
(28, 'National Award for Best Umrah Tou', 'NATIONAL AWARD WINNER 2015 - 2016 awarded to Mr. Rahatullah Shaikh of  Rahat Travels Of India', 'NATIONAL AWARD WINNER 2015 - 2016 awarded to Mr. Rahatullah Shaikh of  \"Rahat Travels Of India\"\n\nRahat Travels Of India again won \"NATIONAL Award, for Best Hajj & Umrah Tour. 2015 - 2016\", in the category of Hajj & Umrah, at\nIndo Gulf Awards held at Hajj House in Mumbai on 19th August 2016.\n\n\nThe Award was given by Minister of Minority Affairs Mr. Mukhtar Abbas Naqvi at a function held at Hajj House, Crawford Market. Mumbai.\n\nThis award is a recognition of continued Hardwork & Dedication put in by Rahat Team.\n\n', 1, '2024-08-23 17:06:24', '2024-08-23 17:06:24', NULL),
(29, 'State Award (Mumbai) for Best Umrah Tour', 'STATE AWARD for \"Best Umrah Tour 2014 /15 Mr. Rahatullah Shaikh of  Rahat Travels Of India', '\nRahat Travels Of India was the proud recipient of the prestigious \"State Award, Best Umrah Tour.\", in the category of Hajj & Umrah, at Indo Gulf Awards held at Hajj House, Mumbai.\nThis award is a recognition of the Hardwork & Dedication put in by Rahat Team. Truly, \"Style, Class, Grace, Elegance and Charm of the Holy Journey through Rahat Travels makes that sacred experience all that much better\"\n\nPlace :: Hajj House,Palton Road, Mumbai.\nDate :: On 5th Sep 2015.\n\nPresent on Stage were :-\nMr. Ramdas Athawale (MP - Rajya Sabha - President - Republic Party Of India.)\nHis Excellency - Mr. Ahmad Al Babak (Consulate General of Afghanistan)\nHis Excellency - Mr. Rizaei (Consulate General of Iran)\nMaulana Mustaqim Azmi (President Jamiat Ulma Maharashtra)\nMr. Sohail Lokhandwala (Ex MLA and Principal Beg Mohammad High School)\nMr. Rafi Naik (Chairman Saboo Siddick Polytechnic)\nMr. Moheb Nasser (Chairman Habib Group Of Trusts)\nAdvocate Shakil Kaazi (Director Kokan Mercantile Co-Op Bank)\nMs. Razia (National Athlete)\nMr. Abdul Ahad Saaz (Eminent Poet)\nMr. Nabi Akhtar Qureshi (Jt. Secretary INDO ARAB SOCIETY)\nMr. Nooruddin Sevwala (Dy. Chairman Giants Group and owner of Crown Foods)\nMr. Sami Bubre (Chief Editor - Indo Gulf Times)\nAnd many Hajis who were going for Hajj this year...\n\nPlease find few photos of the Event ....', 1, '2024-08-23 17:08:33', '2024-08-23 17:08:33', NULL);
