(1, 1, 1, 7, 1, 650.00, 'The renter has received the mentioned vehicle and its accessories in proper and safe condition.', '<p><span class=\"BxUVEf ILfuVd\" lang=\"en\"><span class=\"hgKElc\">A car is <b>a vehicle that has wheels, carries a small number of passengers, and is moved by an engine or a motor</b>. </span></span></p>', 1, '2024-09-13 19:32:25', '2024-09-20 01:29:44', NULL),
(2, 3, 1, 7, 1, 750.00, ' <p>New technical developments are recognized to be the key to successful \ncompetition. Research and development engineers and scientists have been\n employed by all automobile manufacturers and suppliers to improve the \nbody, chassis, engine, drivetrain, control systems, safety systems, and \nemission-control systems.</p>', '<p>The modern automobile is a complex technical system employing subsystems with specific <span id=\"ref527639\"></span><a href=\"https://www.britannica.com/topic/industrial-design\" class=\"md-crosslink \" data-show-preview=\"true\">design</a> functions.</p>', 1, '2024-09-20 01:32:15', '2024-09-27 19:38:17', NULL);
