(9, NULL, 7, '<p>Ready for Hajj 2024? Dive into our curated Playlist by RAHAT GROUP on YouTube for essential guides and spiritual insights. Prepare for a fulfilling journey now!</p><p><a href=\"https://youtube.com/playlist?list=PL2d-OLJrD0XDRheJiY75le_pidjw-TXOK&amp;si=vo_FxMzCwtkbqFuw\" target=\"_blank\">HAJJ 2024 ORIENTATION PROGRAMS: Playlist</a></p><p><br></p><p>Before your Undertake the Journey please go through this PDF</p><p><a href=\"https://www.rahat.in/Hajj_Brochure_2024.pdf\" target=\"_blank\">HAJJ 2024 Brochure</a></p><p><br></p><ul><li><a href=\"https://rahat.in/PDFBrouchere/Hajj_Sheikh_Omar_Suleiman.pdf\" target=\"_blank\">Hajj Guide 1 (By Shaikh Omar)</a></li><li><a href=\"https://rahat.in/PDFBrouchere/Hajj_Guide_Salih_Al_Uthaimeen.pdf\" target=\"_blank\">Hajj Guide 2 (By Shaikh Saleh)</a></li><li><a href=\"https://rahat.in/PDFBrouchere/How_to_do_Umrah.pdf\" target=\"_blank\">How to Do Umrah (In a Nutshell)</a></li><li><a href=\"https://rahat.in/PDFBrouchere/GuideUmrah.pdf\" target=\"_blank\">Umrah Guide</a></li><li><a href=\"https://rahat.in/PDFBrouchere/GuideBaghdad.pdf\" target=\"_blank\">Baghdad Guide</a></li><li><a href=\"https://rahat.in/PDFBrouchere/GuideBM.pdf\" target=\"_blank\">Masjid Aqsa Guide</a></li><li>(Baitulmuqaddas, Egypt &amp; Jordan)</li></ul><p><br></p><p><a href=\"https://drive.google.com/file/d/1JuvVj9UZTfeMBxuiclrTJMFvRcoGaJMs/view?usp=drivesdk\" target=\"_blank\">Uzbekistan Guide</a></p><p><span style=\"color: rgb(255, 0, 0); background-color: rgb(255, 255, 255);\">(Tashkent, Samarkand Bukhara)</span></p><p><span style=\"background-color: rgb(255, 255, 255);\">Come to Uzbekistan - Land of Thousand Shrines.</span></p><p><span style=\"background-color: rgb(255, 255, 255);\">A traditional saying tells us that:</span></p><p><span style=\"background-color: rgb(255, 255, 255);\">Samarkand is the beauty of the earth, but Bukhara is the beauty of the spirit</span></p><p><span style=\"background-color: rgb(255, 255, 255);\">It is also said...</span></p><p><span style=\"background-color: rgb(255, 255, 255);\">In all other parts of the globe light descends upon the earth, from holy Bukhara it ascends’</span></p><p><span style=\"background-color: rgb(255, 255, 255);\">Uzbekistan Package 7 Nite 8 Days</span></p><ul><li><span style=\"background-color: rgb(255, 255, 255);\">Flight 05th September Return 13th September</span></li></ul><p>3 nite Bukhara + 2 Samarkand + 2 Tashkent</p><p>05 Sept 2024 - 13 Sept 2024</p><ul><li>Agents Price :: 79000.</li><li>Guest Price :: 85000.</li></ul><div>Uzbekistan + Umrah 17 nites 18 Days</div><div><br></div><ul><li>7 nite uzbek and 10 nites Umrah<br></li></ul><div><div>3 nite Bukhara + 2 Samarkand + 2 Tashkent + 5 madina + 5 makka</div><div><br></div><div>05 Sept 2024 - 24 Sept 2024</div></div><div><br></div><p></p><p></p><ul></ul><p></p><ul><li>Agents Price :: 112000.</li><li>Guest Price :: 119000.</li></ul><p>Rabiulawwal in Madina</p><p><br></p><p><a href=\"https://rahat.in/PDFBrouchere/GuideMoneyBack.pdf\" target=\"_blank\">Money Back Guarantee</a></p><p><a href=\"https://rahat.in/PDFBrouchere/GuideUmrahAgreement.pdf\" target=\"_blank\">Umrah &amp; Ziyarats Agreement</a></p><p><a href=\"https://rahat.in/PDFBrouchere/GuideUmrahKit.pdf\" target=\"_blank\">Hajj &amp; Umrah Kit&nbsp;</a></p><p><br></p><p>Please Find FOOD Menu For UPCOMING UMRAH SEASON</p><p><a href=\"https://drive.google.com/file/d/1kRKxjoP_IWCsfGN0F_xZxc3juzgkYjUE/view?usp=drivesdk\" target=\"_blank\">Food Menu For Golden Package</a></p><p><a href=\"https://drive.google.com/file/d/1kUAtj_fwl49wtk3DFf3ET4PAPbYuTUYU/view?usp=drivesdk\" target=\"_blank\">Food Menu For Bronze Package</a></p><p><a href=\"https://drive.google.com/file/d/1kWX1tZJn-Mt4svLlCIfdKgl6VArcBBA0/view?usp=drivesdk\" target=\"_blank\">Food Menu For Silver Package</a></p><p><a href=\"https://drive.google.com/file/d/1k_Qc8fStOF9q0EOnB8AzgrNvRwkpa776/view?usp=drivesdk\" target=\"_blank\">Food Menu For Super Saver Package</a></p><p><br></p><p>PDFs For Umrah Guiding</p><p><a href=\"https://drive.google.com/file/d/1IeUvoofum3edqdMlrrf1XRjcQuI7jfok/view?usp=drivesdk\" target=\"_blank\">Welcome Umrah Guide HINDI - A MUST READ.pdf</a></p><p><a href=\"https://drive.google.com/file/d/1IiruLl4FHbM4EZc7xngIxG2x0IiNwbgT/view?usp=drivesdk\" target=\"_blank\">IATA Checklist.pdf</a></p><p><a href=\"https://drive.google.com/file/d/1IlODiSCzJXhBmeK6en5U16MmiQxOWuqF/view?usp=drivesdk\" target=\"_blank\">Itenary BaitulMuqaddas Ziyrat List.pdf</a></p><p><a href=\"https://drive.google.com/file/d/1InjaaiScCCW4ITcRw4d_JUTggh4AHJhO/view?usp=drivesdk\" target=\"_blank\">Itenary IRAQ + UMRAH.pdf</a></p><p><a href=\"https://drive.google.com/file/d/1IzXEykkxq5SjfILkuciwRcfIzPOl_dEA/view?usp=drivesdk\" target=\"_blank\">Itenary ONLY IRAQ.pdf</a></p><p><a href=\"https://drive.google.com/file/d/1IsaDb8J8GxGfs6q0VvOMR1QZ-rbzRVNq/view?usp=drivesdk\" target=\"_blank\">Rahat Islamic Tours.pdf</a></p><p><a href=\"https://drive.google.com/file/d/1J8yF5-d8033l0LfTmpQLFWTijUSua1Gr/view?usp=drivesdk\" target=\"_blank\">Umrah by Bus from Dubai.pdf</a></p><p><br></p><p><a href=\"https://drive.google.com/file/d/1Kl3bw9pBnKyK9D49rwvHZTxYv7r0Xx6F/view?usp=drivesdk\" target=\"_blank\">UMRAH - Day to Day Itinerary</a></p>', '2024-08-23 15:16:43', 1, '2024-08-23 15:16:43', NULL),
(10, NULL, 8, '<ul><li><b>\"Unlock Your Potential: Explore Career Opportunities with Rahat\"</b></li><li><p></p><p>If you wish to serve the Guests of ALLAH. If you are ready to work hard we have opportunities for you.</p><p><b><br>We need the following STAFF for Delhi &amp; Mumbai Offices.</b><br></p><ol><li>Marketing Manager (Delhi &amp; Dubai)</li><li>Accountant.</li><li>Cashier.</li><li>Drivers.<br></li><li>Office Boy.</li><li>Sales Staff (Day Shift &amp; Night Shift)<br>Receptionist.</li><li>Visa Experts&nbsp;&nbsp;(Day Shift &amp; Night Shift)</li><li>Ticketing Staff (Day Shift &amp; Night Shift)<br><br></li></ol><p><b><span>&lt;b&gt;Important Note :: &lt;/b&gt; </span></b><span><span>We\n have exciting opportunities for Freelancers, Housewives and Students \nwho would like to Work From Home and are ready to work in Shift Late \nNights</span></span><b><br></b></p><p><b><b><br>We need the following STAFF to Travel with Umrah Groups for INTERNATIONAL Operations</b><br></b></p><ol><li><span>Professional\n Cook - North Indian Cook, Hyderabadi, Moughlai &amp; South Indian \nCooks.&nbsp; (Should be able to cook three time food for around 250-300 \npeople)</span></li><li><span>Tour Leaders (Should be able to manage around 100-200 people)</span></li><li><span>Helpers (Should be able to do all types of work including dish washing, cleaning etc.)</span></li><li><span>Roti makers (Professional Roti Makers for Rumali and Tandoori Roti)</span><b><br></b></li></ol><p><b><br><b>Important Note :: </b></b><span>Previous Gulf Experience and Knowledge of Arabic Language is an added advantage.</span><b><br></b></p><p><span>Only\n person having a valid Passport with Minimum 6 months validity and a \ncommitment to work for minimum 02 years abroad should apply.</span><b><br><br></b></p><p><span><span>Send us your CV to : </span><a href=\"mailto:akhtar@rahat.in\" target=\"_blank\">akhtar@rahat.in </a><span>or Call us on</span></span><b><span> </span><b>+91-8097734658</b><br></b></p><div><b><span><b><br></b></span></b></div></li></ul>', '2024-09-04 16:02:09', 1, '2024-09-04 16:02:09', NULL),
