(28, NULL, 23, '<p>AIRPORT REPORTING TIME 5 Hrs Before Departure.</p><p>Contact Details of Our Staff in JEDDAH, MAKKA &amp; MADINA</p><p>1 Jeddah International Airport :: +966 56 389 8353</p><p>2 Customer Care Number (Delhi) :: +91 786 10 786 17</p><p>3 Customer Care Number (Mumbai) :: +91 809 77 346 58</p><p>4 Saudi Customer Care Number :: +966 56 389 8353</p><p>5 24*7 IVR Number : +91 786 38 786 30</p><p>Important Contact Details of Our Representative on INDIAN AIRPORTS</p><p>1 Delhi Airport : Mr. Anwar :: +91 98108 87686, Mr. Afzal :: +91 82879 36082</p><p>2 Mumbai Airport : Mr. Rafiq :: +91 91372 97416, Mr. Khizar :: +91 99870 07864</p><p>VERY IMPORTANT POINTS -</p><p>1. Please activate ROAMING on your Sim before leaving India.</p><p>2. Download IMO, SKYPE, BOTIM for your VIDEO &amp; AUDIO CALLS, Whatsupp calls dont work in Saudi.</p><p>3. Please take Printout (HARD COPY) of your Ticket, Visa, Insurance, Hotel Voucher, Umrah Visa before reaching the</p><p>AIRPORT. Printouts will not be arranged on airport by our Staff.</p><p>4. Please wear EHRAM before crossing meeqat its advisable to wear EHRAM from your home if you are going to JEDDAH</p><p>AIRPORT for UMRAH.</p><p>5. Please Buy Saudi RIYAL from INDIA before reaching AIRPORT. Saudi Riyal is very expensive in MAKKA MADINA and on</p><p>AIPRORTS</p><p>6. PLEASE keep 50-100 sar change with you handy in pockets for emergency use to buy juice water etc.</p><p>7. Make sure to Keep your medicine handy with you in hand bags and don’t put it in Checking Baggage.</p><p>8. Keep an Extra set of EHRAM &amp; Slippers for emergency.</p><p>9. Do Not Carry INDIAN FLAGS with you or any other Country FLAGS. Taking pics with FLAGs is Totally Banned and Can</p><p>lead to Jail sentence</p><p>10. Watch YOUTUBE Videos and Consult Scholars AALISMs and MUFTIS before leaving for UMRAH</p><p>11. Please carry Extension board and Universal Adapter for your Mobile Recharges, Socket in Saudis do not support Indian</p><p>Round Plugs hence a universal square adapter is required.</p>', '2024-10-01 13:06:48', 1, '2024-10-01 13:06:48', NULL),
(29, NULL, 24, '<p>Cannot Join Your Parents or Family for Umrah.</p><p>Very Busy With your Bussiness or Jobs -<span style=\"color: rgb(255, 0, 0);\">&nbsp;DONT WORRY NOW.</span></p><p><span style=\"color: rgb(57, 123, 33);\">Book a English Speaking Assistant to stay (24*7)</span></p><p><span style=\"color: rgb(57, 123, 33);\">with your Loved Ones in Makka or Madina.</span><br class=\"Apple-interchange-newline\"></p><p>-24 Hour Attendant Just a phone Call Away for your Parents.</p><p>Our Assistant can provide help with the following:-</p><p>-WheelChairs.</p><p>-Luggage Handling &amp; Package.</p><p>-Shopping.</p><p>-Ziyarats</p><p>Cost:: 250 Sar Per Day.</p><div><br></div>', '2024-10-01 19:38:32', 1, '2024-10-01 19:38:32', NULL),
