INSERT INTO `aihut_faq` (`id`, `agent_id`, `title`, `question`, `answer`, `is_active`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, NULL, 'Title1', 'What if I need help while I am in Saudi?', 'Dial 930 to reach a 24-hour tourist helpline, or try these other useful contacts.', 1, '2024-08-27 16:55:54', '2024-08-27 16:55:54', NULL),
(2, NULL, 'Title2', 'What should I do on my trip?', 'To make the most of your stopover in Saudi, take a closer look at these day trip ideas in Jeddah, Riyadh and the Madina Province.', 1, '2024-08-27 17:01:45', '2024-08-27 17:01:45', NULL),
(3, NULL, 'Title3', 'Can I apply for a transit/stopover visa in Saudi if I am traveling on holiday or for business meetings?', 'Yes, you can apply for the transit/stopover visa if you are planning to visit Saudi en route to your final destination as long as your stop in Saudi does not exceed 96 hours.', 1, '2024-08-27 17:03:02', '2024-08-27 17:03:02', NULL),
(4, NULL, 'Title4', 'Can I perform Umrah on the transit/stopover visa?', 'Yes, transit/stopover visa holders can apply to perform Umrah during their stopover in Saudi via Nusuk.sa, but the transit/stopover visa may not be used for Hajj travel.', 1, '2024-08-27 17:04:25', '2024-08-27 17:04:25', NULL),
(5, NULL, 'Title5', 'How long is the transit/stopover visa valid?', 'The transit/stopover visa is valid for 96 hours upon arriving in Saudi.', 1, '2024-08-27 17:35:23', '2024-08-27 17:35:23', NULL),
(6, NULL, 'Title6', 'How far in advance can I get the transit/stopover visa?', 'You may apply for a transit/stopover visa up to 90 days before your travel.', 1, '2024-08-27 17:36:39', '2024-08-27 17:36:39', NULL),
(7, NULL, 'Title7', 'Do I have to pay for accommodations while in Saudi?', 'A complimentary one-night hotel stay is included with the transit/stopover visa when booking with Saudia. Please note that this is subject to availability. Alternatively, you can book your hotel via Visit Saudi.', 1, '2024-08-27 17:37:48', '2024-08-27 17:37:48', NULL),
(8, NULL, 'Title8', 'How much does the transit/stopover visa cost?', 'The transit/stopover visa is free but is subject to administrative and medical insurance fees.', 1, '2024-08-27 17:39:04', '2024-08-27 17:39:04', NULL),
(9, NULL, 'Title9', 'How long does it take to issue the transit/stopover visa?', 'Once you have booked and paid for your flights, your transit/stopover visa will be emailed to you almost instantly.', 1, '2024-08-27 17:41:32', '2024-08-27 17:41:32', NULL),
(10, NULL, 'Title10', 'How long does it take to apply for the transit/stopover visa?', 'It takes about three minutes to apply.', 1, '2024-08-27 17:42:39', '2024-08-27 17:42:39', NULL),
(11, NULL, 'Title11', 'Who is eligible for the transit/stopover visa?', 'Anyone can get a transit/stopover visa. Those passing through Saudi on their way to another destination and flying on Saudia or Flynas are eligible for special offers; those flying on another carrier should apply for a standard transit/stopover visa.', 1, '2024-08-27 17:43:44', '2024-08-27 17:43:44', NULL),
(12, NULL, 'Title12', 'Is it possible to come to perform Umrah an hour or more after the time of the permit?', 'We hope that you adhere to the attendance time specified in the Umrah Permit. You can book again after the time, which is specified in the permit expires.', 1, '2024-08-27 17:46:13', '2024-08-27 17:46:13', NULL),
(13, NULL, 'Title13', 'Is it possible to perform Umrah with a visa that is not an Umrah Visa?', 'Yes, the holders of a (visit, tourism, work) visa can perform Umrah.', 1, '2024-08-27 17:47:11', '2024-08-27 17:47:11', NULL),
(14, NULL, 'Title14', 'How many times is Umrah allowed to be performed?', 'There is no fixed number of times that Umrah may be performed.', 1, '2024-08-27 17:48:16', '2024-08-27 17:48:16', NULL),
(15, NULL, 'Title15', 'Are there specific airports for the entry and departure of mu’tamirs?', 'A mu’tamir can enter and depart using any international or regional airport in the Kingdom of Saudi Arabia.', 1, '2024-08-27 17:49:11', '2024-08-27 17:49:11', NULL),
(16, NULL, 'Title16', 'Can a mu’tamir enter and leave the Kingdom by different means?', 'Yes, he/she can.', 1, '2024-08-27 17:50:09', '2024-08-27 17:50:09', NULL),
(17, NULL, 'Title17', 'Is it possible to move between the cities of the Kingdom with the Umrah Visa?', 'Yes, the Umrah Visa enables the mu’tamir to move between Makkah al-Mukarramah, Medina, and all the cities of the Kingdom during the period of permitted stay.', 1, '2024-08-27 17:51:01', '2024-08-27 17:51:01', NULL),
(18, 2, 'Faq title', 'FAQ Question', 'FAQ Answer', 1, '2024-09-18 12:45:33', '2024-09-28 17:49:09', NULL);
