INSERT INTO `aihut_hotel` (`id`, `hotel_name`, `star_rating`, `city_id`, `country_id`, `distance`, `google_map`, `address`, `hotel_overview`, `contact`, `email`, `website_url`, `check_in`, `check_out`, `hotel_price`, `is_active`, `high_start_date`, `high_end_date`, `high_season_price`, `medium_start_date`, `medium_end_date`, `medium_season_price`, `low_start_date`, `low_end_date`, `low_season_price`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'VOCO Makkah an IHG Hotel', '5', 1, NULL, '2000', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7429.048063436068!2d39.817128!3d21.408638!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c205f09c965271%3A0x9721e2d8b9680507!2svoco%20Makkah%2C%20an%20IHG%20Hotel!5e0!3m2!1sen!2sus!4v1723554744697!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'Ibrahim Al Khalil, Misfalah, Mecca 24233, Saudi Arabia\n', 'Located in Makkah, 1.5 km from Masjid-Al-Haram, voco Makkah an IHG Hotel provides accommodation with a restaurant, free private parking and a shared lounge. This 5-star hotel offers an ATM and a concierge service. The accommodation offers a 24-hour front desk, a shuttle service, room service and free WiFi throughout the property.\nAll units are equipped with air conditioning, a flat-screen TV with satellite channels, a kettle, a shower, a hairdryer and a wardrobe. Every room is equipped with a private bathroom with a bath and free toiletries.\nA continental breakfast is available daily at the hotel.\nMasjid Al Haram is 1.5 km from voco Makkah an IHG Hotel, while Hira Cave is 10 km away. The nearest airport is King Abdulaziz International Airport, 99 km from the accommodation.', '7861078618', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 250.00, '2024-08-13', '2024-12-15', 170.00, '2024-08-13', '2024-12-15', 170.00, '2024-07-22 11:35:57', '2024-08-28 15:01:26', NULL),
(2, 'Erjwaan Saada Hotel', 'Standard Hotel', 2, NULL, '300', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7262.845101036821!2d39.603951!3d24.470812!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15bdbf03b7852969%3A0x77717220a7013dd7!2sGolden%20Ergwan%20Hotel!5e0!3m2!1sen!2sus!4v1723552736284!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', '2169-2207 ,6847, Al Manakhah, Al-Madinah al-Munawwarah 42311, Saudi Arabia', 'Ergwan Saada Hotel is located in western central area of Prophet\'s mosque. Te hotel is 35 minutes drive from Madinah International Airport. The hotel offers comfortable stay to his guests with variety of amenities like free wifi in public areas, restaurant facility, free parking.', '7861078618', 'Info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 320.00, '2024-08-13', '2024-12-15', 300.00, '2024-08-13', '2024-12-15', 300.00, '2024-07-22 11:43:06', '2024-09-27 18:02:27', NULL),
(3, 'Wahet Al Deafah Hotel', 'Standard Hotel', 1, NULL, '550', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7428.484200810044!2d39.832879!3d21.419727!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c205deffd87b41%3A0xee28eba520b0837a!2sWaha%20Aldeafah%20Ajyad%20Hotel!5e0!3m2!1sen!2sus!4v1723554272152!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'Waha Aldeafah Ajyad Hotel, Ajyad, 6948, 4977, Mecca 24231, Saudi Arabia', 'Featuring free WiFi and a restaurant, Wahet Al Deafah Hotel offers accommodations in Mecca.\nThe rooms are equipped with a flat-screen TV. Certain units have a sitting area to relax in after a busy day. Every room is equipped with a private bathroom.\nYou will find a 24-hour front desk at the property.\nSafwah tower is 600 m from Wahet Al Deafah Hotel, and Abraj Al Bait is 0.6 km from the property. The nearest airport is Ta’if Airport, 74 km from Wahet Al Deafah Hotel.', '9987864449', ' info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 300.00, '2024-08-13', '2024-12-15', 250.00, '2024-08-13', '2024-12-15', 250.00, '2024-07-23 12:01:40', '2024-08-26 18:04:31', NULL),
(4, 'Anwar Deafah Hotel', '3', 1, NULL, '300', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7428.443307535451!2d39.830312000000006!3d21.420531!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c204b9d52479df%3A0x74f4110ef869d3d8!2sAnwar%20Al%20Diyafah%20Hotel!5e0!3m2!1sen!2sus!4v1723553746228!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'King Abdul Aziz Rd, Ajyad, Makkah 24231, Saudi Arabia', 'Located in Makakh, Anwar Al Diyafah offers simply furnished accommodations. Al Masjid Al Haram is a 5-minute walk away. Free WiFi is available throughout the property.\n\nEach room here will provide you with a flat-screen TV, air conditioning and a living area. There is a full a kitchenette with a refrigerator and stovetop. The private bathroom also comes with free toiletries.\n\nAt Anwar Al Diyafah Hotel you will find a 24-hour front desk. Other facilities offered at the property include luggage storage.\n\nKing Abdulaziz International Airport is 76 km away from Anwar Al Diyafah Hotel.', '9987864449 ', ' info@rahat.in', 'https://www.rahattravels.com/', '20:30', '10:10', NULL, 1, '2024-12-15', '2025-01-15', 370.00, '2024-08-13', '2024-12-15', 350.00, '2024-08-13', '2024-12-15', 350.00, '2024-07-23 12:09:16', '2024-08-13 12:56:00', NULL),
(5, 'Diana Shannon', '4', 1, NULL, '1000', 'Praesentium asperior', 'Voluptas tempore te', NULL, 'Pariatur Cillum e', 'kuzycir@mailinator.com', 'https://www.deqevynypywuz.org.uk', '15:08', '01:57', NULL, 1, '2005-01-29', '2006-01-31', 651.00, '2006-05-27', '1994-12-07', 578.00, '1970-12-15', '2015-08-25', 653.00, '2024-07-23 12:20:52', '2024-07-24 10:56:06', '2024-07-24 10:56:06'),
(6, 'Borj Al Deafah Hotel', 'Standard Hotel', 1, NULL, '850', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d14857.846924008389!2d39.804706255419916!3d21.4110889!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c205267d9675b3%3A0x9d1120fa4d01ebd1!2sAl%20Deafah%20Tower%20Hotel!5e0!3m2!1sen!2sin!4v1723553661506!5m2!1sen!2sin\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'Al Hijra Street , Al Misfallah District, 21955 Makkah, Saudi Arabia', 'This air-conditioned studio offers a small living room with a flat-screen TV and a kitchenette complete with a dining area. The bathroom includes a bath or a shower.\nRoom Facilities: Safe, Air conditioning, Kitchenette, Refrigerator, Sitting area, Free toiletries, Bathroom, Satellite channels, Bathtub or shower, Flat-screen TV, Sofa, Tile/Marble floor, Electric kettle, Kitchenware, Wardrobe/Closet, Cleaning products, City view, Towels, Linens\nFree WiFi is available in all rooms.', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 230.00, '2024-08-13', '2024-12-15', 200.00, '2024-08-13', '2024-12-15', 200.00, '2024-07-24 10:55:58', '2024-08-26 18:04:45', NULL),
(7, 'Nusk Al Eiman', '3', 2, NULL, '100', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d14526.323780844556!2d39.59358001013634!3d24.465320199999994!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15bdbf863cb7a7e7%3A0x64b78e3f28e5a079!2zKNmB2YbYr9mCINix2YXYp9iv2Kcg2KfZhNmC2KjZhNipINiz2KfYqNmC2KcpINmB2YbYr9mCINmG2LPZgyDYp9mE2KXZitmF2KfZhiAtIE5VU0sgQUwgRU1BTiBIT1RFTA!5e0!3m2!1sen!2sin!4v1723553486017!5m2!1sen!2sin\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'South Central Area of Prophetic Mosque, Medina 42316, Saudi Arabia ', 'The Nusk Hotel Madinah is a luxury hotel designed with refinement that meets the highest standards, being located in the heart of Medina', '7861078618', 'info@rahat.in', 'www.rahatumrah.in', '17:30', '07:45', NULL, 1, '2024-12-15', '2025-01-15', 400.00, '2024-08-13', '2024-12-15', 350.00, '2024-08-13', '2024-12-15', 350.00, '2024-07-30 07:37:56', '2024-08-13 12:55:09', NULL),
(8, 'Johra Mayassar', 'Standard Hotel', 1, NULL, '1500', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7429.1114036824165!2d39.821481!3d21.407392000000005!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c204d2307e7c81%3A0xf9aeff23821dd2b9!2sJouhara%20Mouassar%20Hotel!5e0!3m2!1sen!2sus!4v1723553323133!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'CR4C+XH5, Misfalah, Makkah 24233, Saudi Arabia', 'With a stay at Jouhara Mouassar Hotel in Mecca, you\'ll be within a 5-minute drive of Great Mosque of Mecca and Well of Zamzam. This hotel is 4.8 mi (7.8 km) from Kaaba and 4.6 mi (7.4 km) from Abraj Al-Bait Towers.\nThis smoke-free hotel offers bellhop services.\nFeatured amenities include multilingual staff, an elevator (lift), and lockers.\nMake yourself at home in one of the 180 air-conditioned rooms featuring kitchenettes. Complimentary wireless Internet access keeps you connected, and flat-screen televisions are provided for your entertainment. Conveniences include phones, as well as minibars and electric kettles.', ' 9987864449 ', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '11:30', NULL, 1, '2024-12-15', '2025-01-15', 150.00, '2024-08-13', '2024-12-15', 120.00, '2024-08-13', '2024-12-15', 120.00, '2024-08-13 07:03:03', '2024-09-27 17:57:00', NULL),
(9, 'Jood Al Marjan ', 'Standard Hotel', 2, NULL, '1500', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7263.544027791309!2d39.618726!3d24.458694!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15bdbf40132d1e81%3A0xa8ad3ee435830c6e!2zSk9EIEFMIE1BUkpBTiBIT1RFTCDZgdmG2K_ZgiDYrNmI2K8g2KfZhNmF2LHYrNin2YY!5e0!3m2!1sen!2sus!4v1723553268275!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'FJ59+FCV, Qurban, Al-Madinah al-Munawwarah 42316, Saudi Arabia', 'Well set in the Central Madinah district of Al Madinah, Murjan Al Madinah Hotel is located 300m from Al-Masjid an-Nabawi, 350m from Old Bazaar and 2.8 km from Mazaya Mall. Among the facilities of this property are a restaurant, a 24-hour front desk and room service, along with free WiFi. The hotel features family rooms.', '9167866632 ', 'Info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 150.00, '2024-08-13', '2024-12-15', 120.00, '2024-08-13', '2024-12-15', 120.00, '2024-08-13 08:21:03', '2024-09-27 17:57:34', NULL),
(10, 'Burj Mawadda', '3', 2, NULL, '700', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7262.921423164929!2d39.601897!3d24.469489!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15bdbf0484dacf63%3A0x9359b92a89eb8b2c!2sBurj%20Mawadda%20Hotel!5e0!3m2!1sen!2sus!4v1723553140275!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'FJ92+QQR, King Faisal Rd, As Sih, Al-Madinah al-Munawwarah 42312, Saudi Arabia', 'Burj Al Madina is located in Medina. Al Noor Mall and Al-Rashid Mega Mall are worth checking out if shopping is on the agenda, while those wishing to experience the area\'s natural beauty can explore Mount Uhud and King Fahad Garden.', ' 9987864449 ', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 280.00, '2024-08-13', '2024-12-15', 250.00, '2024-08-13', '2024-12-15', 250.00, '2024-08-13 11:01:53', '2024-08-14 10:37:39', NULL),
(11, 'Azka Safa Hotel', '5', 1, NULL, '150', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d29713.836503514296!2d39.829857!3d21.42022!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c204b9a6ce356f%3A0x7754d70bbced882d!2sAzka%20Safa%20Hotel!5e0!3m2!1sen!2sus!4v1723555785690!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', '7019, Saudi Arabia', 'Along a bustling road, this informal high-rise hotel catering to Muslim guests only is a 6-minute walk from Masjid al-Haram, the world\'s largest mosque, and 5 km from Mina Train Station 3 Jamarat.\nStraightforward, warm rooms come with complimentary Wi-Fi and flat-screen TVs. Upgraded rooms add living areas. Room service is available.', '7861078618', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-12-15', 650.00, '2024-08-13', '2024-12-15', 550.00, '2024-08-13', '2024-12-15', 550.00, '2024-08-13 13:51:32', '2024-08-13 13:51:32', NULL),
(12, 'Crowne Plaza Madinah, an IHG Hotel', '5', 2, NULL, '250', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d6997.978250415689!2d77.109772!3d28.719871!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x390d01c9754c19dd%3A0x5c7a8a29abe998d2!2sCrowne%20Plaza%20New%20Delhi%20Rohini%2C%20an%20IHG%20Hotel!5e0!3m2!1sen!2sus!4v1723629055693!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', '1st Ring Road, Between, King Faisal Street, Al-Madinah al-Munawwarah Saudi Arabia', 'his hotel overlooks the Haram of Masjid al-Nabawi, so pilgrims can walk or take a free shuttle directly to the male and female entrances of the Prophet\'s Holy Mosque. In keeping with its location in the Muslim-only area of Madinah, the hotel provides a restful base for a visit or pilgrimage, with a warm Arab welcome from respectful and attentive staff.\nClassical motifs complement stylish modern design in 506 comfortable rooms and suites, and Haram-view rooms overlook the magnificent courtyard of the Prophet\'s tomb. Complimentary WiFi in all rooms and public areas keeps every guest connected.\nThe Concierge can help with advice on places to visit, as well as the best restaurants, markets and shopping malls in nearby modern Madinah.\nBusiness travelers can host a successful corporate event in five versatile, high-tech conference and boardrooms. Executives can also relax in the plush Club lounge.', ' 9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 650.00, '2024-08-15', '2024-12-15', 600.00, '2024-08-15', '2024-12-15', 600.00, '2024-08-14 09:52:48', '2024-08-14 09:52:48', NULL),
(13, 'Anjum Hotel Makkah', '5', 1, NULL, '200', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7428.225846714673!2d39.819754!3d21.424806!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c204b47a578a4b%3A0x70a3d202df30a258!2sAnjum%20Hotel%20Makkah%E2%80%8F!5e0!3m2!1sen!2sus!4v1723629368790!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'Umm Al Qura Street, Haratal Bab And Ash Shamiyyah, Mecca 21955, Saudi Arabia', 'Welcome to Anjum Hotel Makkah, your home away from home in the heart of the holy city of Makkah. During your stay with us, enjoy breathtaking views over the Holy Haram, from our expansive rooms and suites, experience rich culinary flavors, discover Hijazi hospitality and enjoy thoughtfully personalized service. We would like to wish you a warm and pleasant stay in the holy city of Makkah where Anjum is not just a hotel but a way of life.', '7861078618', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 650.00, '2024-08-14', '2024-12-15', 600.00, '2024-08-14', '2024-12-15', 600.00, '2024-08-14 09:58:30', '2024-08-14 09:58:30', NULL),
(14, 'Azka Al Madina Hotel', '3', 2, NULL, '100', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7263.1683618795705!2d39.61503!3d24.465208!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15bdbf28029faf3f%3A0x40d47c773d64c7fc!2sAzka%20Al%20Madina%20Hotel!5e0!3m2!1sen!2sus!4v1723629794997!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', '6232 Abu Ayyub Al-Ansari, Bani Khidrah  329, Al-Madinah al-Munawwarah 42311, Saudi Arabia', 'Al Azka Al Madinah Hotel\" is one of the best hotels in the city of the Prophet Muhammad (peace be upon him). It boasts over 10 years of experience in serving guests of the Prophet\'s Mosque in Medina. Our distance to the inside of the Prophet\'s Mosque is always within two minutes, and we are just 15 minutes away from Prince Mohammed bin Abdulaziz International Airport. We are distinguished by our proximity to famous landmarks, date markets, and commercial centers.\n\nOur mission is to treat our guests with the utmost respect and provide them with everything befitting the city of the Prophet Muhammad (peace be upon him). Our goal is to offer a religious and gracious hospitality to the guests of the Most Merciful.\"', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2024-01-15', 400.00, '2024-08-14', '2024-12-15', 350.00, '2024-08-14', '2024-12-15', 340.00, '2024-08-14 10:04:49', '2024-08-14 10:04:49', NULL),
(15, 'Mona Salam Hotel', 'Standard Hotel', 2, NULL, '800', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7263.084323051812!2d39.60008400000001!3d24.466665!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15bdbf1ab5d08d39%3A0xb60919b481a64cbc!2sMona%20Salam%20Hotel!5e0!3m2!1sen!2sus!4v1723657169009!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'As Salam Rd, Al Suqya, Al-Madinah al-Munawwarah 42315, Saudi Arabia', 'Welcome to Al Mona Al Madina, your Medina “home away from home.” Al Mona Al Madina aims to make your visit as relaxing and enjoyable as possible, which is why so many guests continue to come back year after year.\n\nRooms at Al Mona Al Madina provide air conditioning and a refrigerator.\n\nBest of all, Al Mona Al Madina makes it easy to experience many great Medina attractions like Quba Mosque (1.2 mi), Masjid al-Qiblatain (0.6 mi), and Masjid Al Ghamamah (0.8 mi), which are a short distance away.', '9987864449', 'info@rahat.in', 'www.rahattravels.com', '14:00', '12:00', NULL, 1, '2024-12-12', '2025-12-01', 180.00, '2024-08-14', '2024-12-15', 150.00, '2024-08-14', '2024-12-15', 150.00, '2024-08-14 17:42:26', '2024-08-14 17:42:26', NULL),
(16, 'Rua Taiba Hotel', 'Standard Hotel', 2, NULL, '700', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7263.241437810913!2d39.606592!3d24.463941!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15bdbfdbe3499091%3A0xda14324d02593a94!2sRua%20Taiba%20Hotel!5e0!3m2!1sen!2sus!4v1723709672708!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'DMAB2453, 2453, Al-Madinah al-Munawwarah 42311 ,Saudi Arabia', 'This 3-star Rua Taiba Hotel Medina offers 37 rooms about a 25-minute walk to the coloured Green Dome. You will find 24-hour front desk and valet parking service at the hotel too.\n\nSome of the air-conditioned rooms have a balcony and a cupboard, and facilities like complimentary wireless internet along with an electric kettle. They come with a bidet and a sink together with amenities like a hairdryer and bath sheets. Guests can also enjoy views of the city.\n\nThe property in Al Harra Al-Sharqiah, around a 25-minute walk from Al Masjid a Nabawi Mosque. When staying at this Medina hotel, you\'ll be within 25 minutes\' walk of Al-Baqi\'.', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2026-01-15', 150.00, '2024-08-15', '2024-12-15', 120.00, '2024-08-15', '2024-12-15', 120.00, '2024-08-15 08:16:22', '2024-08-26 11:40:02', '2024-08-26 11:40:02'),
(17, 'Dar Al Khalil Al Rushd Hotel', '3', 1, NULL, '550', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7428.751547775112!2d39.821405!3d21.41447!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c205cc898d446f%3A0x1c6e95eca90855f3!2sDar%20Al%20Khalil%20Al%20Rushad%20Hotel!5e0!3m2!1sen!2sus!4v1723710076719!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'Ibrahim Al Khalil, Ash Shubaikah, Mecca 24233, Saudi Arabia', 'The 3-star Dar Al Khalil Al Rushad Hotel Mecca lies 450 to 500 mtrs to Kaaba.\n\nLocated off Masjid Al Nur,  Dar El Khalil El Rushd Hotel is about 10 minutes’ walk from Mecca city centre. Masjid Al Haram King Abdullah Expension Gate is 0.7 km from the hotel and King Abdulaziz airport is 75 km away. There is the holy Black Stone about a 15-minute stroll away, and Saptco in a 10-minute stroll from the property.\n\nOffering international, Asian, Delhi and Arabic dishes, Zamzam Lobby Lounge is 10 minutes\' walk away.', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 300.00, '2024-08-15', '2024-12-15', 250.00, '2024-08-15', '2024-12-15', 250.00, '2024-08-15 08:21:40', '2024-08-26 11:41:16', '2024-08-26 11:41:16'),
(18, 'Mira Ajyad Hotel', '3', 1, NULL, '300', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7428.455870674723!2d39.829039!3d21.420284!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c20481fc0ab9c1%3A0x27615a19bc38ba7!2sMira%20Ajyad%20Hotel!5e0!3m2!1sen!2sus!4v1723710177006!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'CRCJ+66H,  Ajyad, Mecca 24231, Saudi Arabia', 'Mira Ajyad Hotel 3 stars\n\nLocated close to Abraj Al Bait Mall Towers, this 3-star Mira Ajyad Hotel Mecca has a shared lounge. Providing access to the massive Masjid al-Haram Mosque, the hotel is within 2.4 km from Jannat Al Muallaa Cemetery and offers an a la carte restaurant.\n\nAll 70 rooms are allergy-free and equipped with high-speed internet and a flat-screen TV with satellite channels. A bidet, a tub and a roll in shower along with comforts like hairdryers and bath sheets are also at guests\' disposal.\n\nBreakfast is served every morning in the restaurant. Mira Ajyad Hotel features miramar restaurant. You can visit the restaurant situated close by and taste Middle Eastern, Indian, Asian and Chinese cuisine.\n\nThe property is merely a 5-minute walk to Kaaba. You can reach the centre of Mecca in 20 minutes on foot. This Mecca hotel is situated 5 km of the known Ghar Thowr Mountain, while Saptco lies 600 metres away', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 400.00, '2024-08-15', '2024-12-15', 350.00, '2024-08-15', '2024-12-15', 350.00, '2024-08-15 08:26:39', '2024-08-15 08:26:39', NULL),
(19, 'Movenpick Makkah Hajar Tower', '5', 1, NULL, '0', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7428.512123362353!2d39.82454!3d21.419178000000002!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c204b7bd004af9%3A0xf468545cd6c9c58a!2sM%C3%B6venpick%20Hotel%20%26%20Residence%20Hajar%20Tower%20Makkah!5e0!3m2!1sen!2sus!4v1723710642069!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'Diamond Tower, Near King Abdul Aziz Rd, Al Haram, Mecca 21955, Saudi Arabia', 'Located in one of the tallest buildings in the world and overlooking the holy Grand Mosque, Hajar Tower combines traditions with modern comforts. It features in-house shops and fine dining options.\nOffering free WiFi, rooms at Mövenpick Hotel & Residence Hajar Tower Makkah are decorated with contemporary wooden furnishings, most facing the Masjid al-Haram and the sacred K’aba. All rooms are equipped with a flat-screen satellite TV, tea/coffee making facilities and a minibar.\nGuests can enjoy gourmet Saudi specialities at the Al Naim restaurant and an array of international classics at the Al Firdaous buffet bistros. Al Diwan Tea Lounge serves Arabic coffee and selected tea blends.\nFacing King Abdul Aziz Gate, Mövenpick Hajar Tower Makkah Hotel is situated in the centre of Mecca, adjacent to shopping malls and entertainment complexes. Wi-Fi is free in all public areas.\nThe Hotel is can help to issue your UMRA permit during your stay, Permits will only be issued to people whose status is shown Immune on Tawkalana, the Immune status is showed for three categories: 1. Immune, 2. Immune by recovery, 3. Immune by first dose. UMRA permit should be issued 24hours before your schedule time for performing UMRA.\n\nThis is our guests\' favourite part of Makkah, according to independent reviews.', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 1200.00, '2024-08-15', '2024-12-15', 1000.00, '2024-08-15', '2024-12-15', 900.00, '2024-08-15 08:31:34', '2024-08-26 11:40:58', '2024-08-26 11:40:58'),
(20, 'Swissotel Al Maqam Makkah', '5', 1, NULL, '0', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7428.554539923689!2d39.824104!3d21.418344!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c21ac79072f44d%3A0x8220a159164b09bd!2sSwiss%C3%B4tel%20Al%20Maqam%20Makkah!5e0!3m2!1sen!2sus!4v1723710924673!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'St Tower F, Ibrahim Al Khalil Rd, St, Tower F, Al Maqam 21955, Saudi Arabia', 'Overlooking the holy city, Swissotel Al Maqam Makkah stands tall at the heart of the Muslim world. As part of prominent Abraj Al Bait complex, the hotel faces the holy Kaaba and has direct access to to the holy mosque from Ibrahim Al-Khalil street and Tunnel entrance in B2. There is another direct entry way to the hotel from Abraj Al Bait complex.\nThe 1,624 rooms and suites carry an embracing atmosphere, many of them have a graceful view of the holy Kaaba.\nWith the variety of international and oriental delicacies, Al Khairat restaurant and Masharif tea lounge provide you an invigorating ambience with the fine quality service.\nFor a convenient shopping experience in Makkah, the hotel provides direct access to the shopping mall within Abraj Al Bait complex. The nearest airport is King Abdulaziz International Airport, 75 km from the property.', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 1200.00, '2024-08-15', '2024-12-15', 1000.00, '2024-08-15', '2024-12-15', 900.00, '2024-08-15 08:35:34', '2024-08-15 08:35:34', NULL),
(21, 'Mayer Mayassar Hotel', 'Standard Hotel', 1, NULL, '1500', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7429.451276423636!2d39.821508!3d21.400705!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c20599fcd70745%3A0x14d997570ffb842c!2sMayer%20Mayassar%20Hotel!5e0!3m2!1sen!2sus!4v1723711187138!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', '7691 Jabal Thawr Rd, Misfalah, 3420, Mecca 24233, Saudi Arabia', 'Mayar Measar Mecca Makkah Saudi Arabia. Book now your hotel in Mecca with Best and Last Minute Hotel deals Theme: Solo, Family\n\n', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 150.00, '2024-08-15', '2024-12-15', 120.00, '2024-08-15', '2024-12-15', 120.00, '2024-08-15 08:40:17', '2024-08-26 11:41:56', '2024-08-26 11:41:56'),
(22, 'Makkah Towers', '5', 1, NULL, '0', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7428.47794484415!2d39.823577!3d21.41985!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c205df48cd06f7%3A0xafa5bdc1439bc1e3!2sMakkah%20Towers!5e0!3m2!1sen!2sus!4v1723711447698!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', '21955, Ibrahim Al Khalil, Al Haram, Mecca 21955, Saudi Arabia', 'The 5-star Makkah Towers is overlooking the Makkah’s Holy Haram Mosque and the Kaaba. It offers stylish rooms, 7 dining options and a 10,000 seat carpeted prayer hall.\nMakkah Towers spacious, air-conditioned rooms feature Art Deco-style decor, satellite TV.  Kitchenette facilities include a coffee maker, and room service is available throughout the day.\nJasmin Caffe specialises in Arabic coffee and fresh-baked pastries.  Chinese and Arabic restaurants are also on site.\nStaff at Makkah Towers  24-hour front desk can arrange currency exchange or car hire.  A full-service business centre with fax and photocopying facilities is also available. Guests can enjoy relaxing foot massages at the Reflexology Health Centre.\nA shopping mall with over 450 shops is connected to the Makkah Towers. King Abdulaziz  International Airport is approximately one hours’ drive away.', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 1200.00, '2024-08-15', '2024-12-15', 1000.00, '2024-08-15', '2024-12-15', 900.00, '2024-08-15 08:44:48', '2024-08-15 08:44:48', NULL),
(23, 'Hilton Makkah Convention Hotel', '5', 1, NULL, '50', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7428.327689655721!2d39.820086!3d21.422804!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c204b45652ae21%3A0x2b222b823c26269a!2sHilton%20Makkah%20Convention%20Hotel!5e0!3m2!1sen!2sus!4v1723711681611!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'Ibrahim Al Khalil, Jabal Omar, Mecca 21955, Saudi Arabia', 'Hilton Makkah Convention Hotel, only moments from the Haram, offers majestic views and is close to the Sacred Mosque and few steps from Al Shubaikah Umrah entrance Gate. Our location is convenient to exploring the Holy City of Makkah. This hotel features 3 restaurants, a fitness center and a 24-hour business center.\nEach room at this hotel is air conditioned and is equipped with a flat-screen TV with satellite channels. The rooms come with a private bathroom. For your comfort, you will find bathrobes and slippers. Hilton Makkah Convention Hotel features free WiFi throughout the property.\nStart the day with a hearty breakfast or nutritious light bite; savour innovative dishes prepared with only the freshest ingredients, or simply relax with a cup of coffee in the hotel lounge. From business brunches to pre-dinner drinks and everything in between, the options at Hilton are catered especially for you.\nYou will find a 24-hour front desk and gift shop at the property.', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 1200.00, '2024-08-15', '2024-12-15', 1000.00, '2024-08-15', '2024-12-15', 900.00, '2024-08-15 08:48:18', '2024-08-15 08:48:18', NULL),
(24, 'Pullman ZamZam Makkah', '5', 1, NULL, '0', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7428.488829185543!2d39.823738!3d21.419636!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c204b7ed62d513%3A0xc7353680b7d8dbf8!2sPullman%20ZamZam%20Makkah!5e0!3m2!1sen!2sus!4v1723712154622!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'Abraj Al Bait Complex, King Abdul Aziz Rd, Endowment, Mecca 21955, Saudi Arabia', 'Pullman ZamZam Makkah is located just a few meters away from the Holy Mosque and offers luxurious studios and suites. It features a restaurant and views of the city and the Kaaba. Masjid Al Haram is 100 metres away. Guests can enjoy free WiFi in all areas of the hotel.\nAll the units at Zamzam are air-conditioned and elegantly decorated. They include a seating area with satellite TV and work desk. They also have a mini fridge and a safety deposit box. Some rooms feature Haram/Kaaba views. Guests can enjoy a buffet breakfast or choose to be served in the privacy of their rooms.\nFor lunch and dinner it is possible to taste the gourmet cuisine at the hotel restaurant or explore the variety of local restaurants.\nA 24-hour reception and a car rental are available at Pullman ZamZam Makkah. Currency exchange services and an ATM are also offered on-site.', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 1200.00, '2024-08-15', '2024-12-15', 1000.00, '2024-08-15', '2024-12-15', 900.00, '2024-08-15 08:56:43', '2024-09-26 21:51:07', '2024-09-26 21:51:07'),
(25, 'Pullman Zamzam Madina', '5', 2, NULL, '150', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7263.210177665671!2d39.611375!3d24.464483!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15bdbfa832eb7ab5%3A0xa5c713b21440d21e!2sPullman%20Zamzam%20Madina!5e0!3m2!1sen!2sus!4v1723712362763!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'Amr Bin Al Gmoh Street, Bani Khidrah, Al-Madinah al-Munawwarah 41499, Saudi Arabia', 'Located in the holy city of Madinah Al Munawara and only 150 meters from Bab Al Salam of Al Masjid Al Nabawi, Pullman Zamzam Madina offers free WiFi throughout the entire hotel.\n\nAll 835 rooms & suites are  blended with modern Arabic & French elegance, All rooms are air-conditioned and feature free WiFi, a flat-screen TV and tea/coffee making facilities. Some rooms offer a seating area and sofa bed. The bathrooms are fitted with a shower.\nThe property has 4 unique restaurants such as Acacia, which serves an all-day-dining International cusine for breakfast, lunch and dinner. Al Mandara features an a la carte menu and oriental specialties during lunch or dinner.\nQuba Mosque and Uhud Mountain are only 15-minutes away from the property. Indoor parking is available on site with additional charge\nDuring month of Ramadan Breakfast meal to be changed to be Suhoor - For adding extra meal Iftar meal supplement will be 200 SAR per meal per person - Suhoor meal supplement will be 150 SAR per meal per person. - After Ramadan Suhoor meal will be changed back to be Breakfast.\n\nThis is our guests\' favourite part of Al Madinah, according to independent reviews.', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 1200.00, '2024-08-15', '2024-12-15', 1000.00, '2024-08-15', '2024-12-15', 900.00, '2024-08-15 09:00:08', '2024-08-15 09:00:08', NULL),
(26, 'Dallah Taibah Hotel', '5', 2, NULL, '50', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7262.760524904123!2d39.612214!3d24.472278000000003!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15bdbe5536ccd2b3%3A0x5ee67ddd61bbbf53!2sDallah%20Taibah%20Hotel%20(5%20Star)!5e0!3m2!1sen!2sus!4v1723712521704!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'Bada\'ah,42311, Saudi Arabia', 'Dallah Taibah Hotel is located 50 metres away from Al Masjid Al-Nabawi, immersed in the commercial and shopping district of Medina.\nEach spacious room at the Dallah Taibah has air conditioning and some of them feature views over the Masjid  Al-Nabawi. All of them have flat-screen TVs and a safety deposit boxes. The bathrooms include free toiletries and slippers.\nThe coffee shop at the lobby offers a variety of hot beverages, fresh juices, pastries and light snacks. A breakfast is available at the Dallah Taibah upon request. A 24-hour room service is also provided.\nAl-Qiblatain Mosque and Quba Mosque are both within 7 km from the hotel. Prince Mohammed Airport is 25 km away.\n\nThis is our guests\' favourite part of Al Madinah, according to independent reviews.', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 1200.00, '2024-08-15', '2024-12-15', 1000.00, '2024-08-15', '2024-12-15', 900.00, '2024-08-15 09:04:18', '2024-08-15 09:04:18', NULL),
(27, 'Swissôtel Makkah', '5', 1, NULL, '50', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7428.530025987879!2d39.826887!3d21.418826!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c204c9adb68acb%3A0x6f8181ac425e9730!2sSwiss%C3%B4tel%20Hotel%20Makkah!5e0!3m2!1sen!2sus!4v1723713073877!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'King Abdul Aziz Rd, Endowment, Ajyad Street, Mecca Saudi Arabia', 'wissotel Makkah is not only the first Swissotel to be opened in Saudi Arabia, but is also the first to commence in the entire Middle East. As part of the prestigious Abraj Al Bait complex, the deluxe Swissotel Makkah is a contemporary five-star hotel located in close proximity to the holy Masjid Al Haraam, overlooking the Ka’aba, as well as the entire Masjid. Swissotel Makkah offers 1,487 elegant rooms and suites with modern contemporary design that complements the rich, hospitable values of Arab culture. The hotel includes two restaurants, one meeting room, and one business centre. With private entrances that make it easier for pilgrims to reach the Masjid Al Haram, Swissotel is also the only property in the Abraj Al Bait Endowment with a direct entrance through Ajyad Street.', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 1200.00, '2024-08-15', '2024-12-15', 1000.00, '2024-08-15', '2024-12-15', 900.00, '2024-08-15 09:12:56', '2024-08-15 09:12:56', NULL),
(28, 'Anwar Al Madinah Mövenpick', '5', 2, NULL, '50', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7262.817121055381!2d39.60771200000001!3d24.471297!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15bdbf01b04de507%3A0xf21df2dc37cd8a86!2sAnwar%20Al%20Madinah%20M%C3%B6venpick!5e0!3m2!1sen!2sus!4v1723713321746!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'Bada\'ah, Al-Madinah al-Munawwarah 42311, Saudi Arabia', 'The Anwar al Madinah Mövenpick Hotel is Madinah’s largest hotel. This 5 star hotel offers extensive facilities for families, individual travellers and leisure groups.  As well as being the nearest hotel to the Prophet’s Mosque, it is also close to all the main attractions in Madinah. This luxury hotel is directly linked to the shopping mall with underground parking available for guests to use.   Close to Masjid Al Nabawi, the Anwar al Madinah Mövenpick Hotel is located in the centre of the commercial district. It is the nearest hotel to the Ladies’ Prayer Entrance. Its proximity to the airport makes it the perfect choice for business travellers.   The Anwar al Madinah Mövenpick Hotel offers a large range of luxury hotel rooms and suites to pick from during your stay in Madinah Munawara, Saudi Arabia. Indulge in an unforgettable culinary experience in one of our four onsite restaurants. ', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 1000.00, '2024-08-15', '2024-12-15', 800.00, '2024-08-15', '2024-12-15', 600.00, '2024-08-15 09:18:28', '2024-08-15 09:18:28', NULL),
(29, 'Leader Al Muna Kareem Hotel', '5', 2, NULL, '100', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7262.730754820242!2d39.613358!3d24.472794!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15bdbe54e3af6b51%3A0x4714f15a8024a004!2sLeader%20Al-Muna%20Kareem%20Hotel!5e0!3m2!1sen!2sus!4v1723713879651!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'Masjid, King Faisal Rd, al haram gate no 26 Besid Imam Bukhari, Al-Madinah al-Munawwarah 42311, Saudi Arabia', 'The 16-floor LEADER Al Muna Kareem Hotel offers elegant 5-star accommodation in the centre of Madinah. It is just 70 metres from the Prophet’s Mosque and offers free WiFi.\nThe rooms at LEADER Al Muna Kareem Hotel have rich-coloured décor and furnishings. Each room is equipped with a work desk, satellite TV and bathroom toiletries.\nIn the mornings, guests can enjoy a rich buffet breakfast prepared with seasonal ingredients. The trendy restaurant also offers an à la carte menu consisting of local dishes as well as international specialities for lunch and dinner.\nLEADER Al Muna Kareem Hotel has a 24-hour front desk and free onsite parking. The commercial and business districts of Medina are within walking distance of the hotel.This is our guests\' favourite part of Al Madinah, according to independent reviews.', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 1000.00, '2024-08-15', '2024-12-15', 800.00, '2024-08-15', '2024-12-15', 600.00, '2024-08-15 09:26:01', '2024-08-15 09:26:01', NULL),
(30, 'Shahd al Madinah', '5', 2, NULL, '100', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7262.769813511275!2d39.611689!3d24.472117!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15bdbe554b587cd5%3A0xe31e19ec70ba3b55!2sSofitel%20Shahd%20Al%20Madinah!5e0!3m2!1sen!2sus!4v1723714207188!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'King Fahd Rd, Bada\'ah, Building 2943, Al-Madinah al-Munawwarah 42311, Saudi Arabia', 'Situated in Al Madinah, a minute\'s walk from Al-Masjid an-Nabawi, Shahd Al Madina offers accommodation with free WiFi. This 5-star hotel offers a concierge service. The accommodation features a 24-hour front desk, paid parking, an ATM and currency exchange for guests.\nGuests at the hotel can enjoy a continental or a buffet breakfast.\nPopular points of interest near Shahd Al Madina Hotel Managed by Accor  include Old Bazaar, Mazaya Mall and Al Baqia Cemetry. The nearest airport is Prince Mohammad bin Abdulaziz International Airport, 13 km from the accommodation.', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 1000.00, '2024-08-15', '2024-12-15', 800.00, '2024-08-15', '2024-12-15', 600.00, '2024-08-15 09:30:23', '2024-08-15 09:30:23', NULL),
(31, 'Artal International Hotel Madina', '5', 2, NULL, '700', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7262.6965415739!2d39.612802!3d24.473387!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15bdbe54f9616009%3A0x2df76ed1a9e7659d!2sArtal%20Al-Monawwarah%20Hotel!5e0!3m2!1sen!2sus!4v1723714475614!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'King Faisal Rd - 1St Ring Rd, 42311 Al Madinah, Saudi Arabia', 'Ideally situated in the centre of Al Madinah, Artal International Hotel offers accommodation with free WiFi 700 metres from Al-Masjid an-Nabawi. The property is around 5.6 km from Quba Mosque, 6.3 km from Jabal Ahad Garden Park and 6.7 km from Mount Uhud. The accommodation features room service, a business centre and currency exchange for guests.\nSpeaking Arabic, Bengali, English and Hindi at the reception, staff will be happy to provide guests with practical advice on the area.\nQiblatain Mosque is 6.8 km from the hotel, while King Fahad Garden is 10 km from the property. The nearest airport is Prince Mohammad bin Abdulaziz International Airport, 12 km from Artal International Hotel.\n\nThis is our guests\' favourite part of Al Madinah, according to independent reviews.', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 1000.00, '2024-08-15', '2024-12-15', 800.00, '2024-08-15', '2024-12-15', 600.00, '2024-08-15 09:37:10', '2024-08-15 09:37:10', NULL),
(32, 'Kiswah Tower', '3', 1, NULL, '800', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7428.01455219323!2d39.813514!3d21.428959!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c21b2a05224df9%3A0x98bbe3e12cd20e1b!2sAl%20Kiswah%20Towers%20Hotel!5e0!3m2!1sen!2sus!4v1723715352683!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', '2920, At Taysir, 8026 SA, Makkah 24231, Saudi Arabia', 'With a stay at Al Kiswah Towers Hotel, you\'ll be centrally located in Mecca, within a 10-minute drive of Great Mosque of Mecca and Well of Zamzam. ', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2024-01-15', 200.00, '2024-08-15', '2024-12-15', 150.00, '2024-08-15', '2024-12-15', 150.00, '2024-08-15 09:51:42', '2024-09-27 17:58:35', NULL),
(33, 'Le Meridian Towers', '5', 1, NULL, '50', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d12493.11369070632!2d39.82981629852697!3d21.420402473928856!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c204bc0fcb101d%3A0x272f95a1334c6c6a!2sLe%20M%C3%A9ridien%20Makkah!5e0!3m2!1sen!2sin!4v1723731666724!5m2!1sen!2sin\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'Area, King Abdul Aziz Rd, Ajyad, Makkah 13700', 'As per local law, access to the Holy City of Makkah and to the hotel is only allowed to Muslim guests. Designed and equipped with luxurious fittings and amenities, Le Méridien Towers Makkah is directly connected to the Holy Mosque through the tunnel of King Abdulaziz gate-just five minutes away by car. Guests can also access the Holy Mosque via Ajyad Road if the tunnel is closed. Strategically located in the Kudai area, the hotel comprises 467 Diplomatic Rooms, 120 Executive Suites, and 60 Royal Suites. The Hotel also has Asian, Moroccan, Gulf restaurants, a wedding hall and meeting rooms.', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-16', 1200.00, '2024-08-15', '2024-12-15', 1000.00, '2024-08-15', '2024-12-15', 800.00, '2024-08-15 14:22:11', '2024-08-15 14:22:11', NULL),
(34, 'Sheraton Makkah Jabal Al Kaaba', '5', 1, NULL, '100', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7428.16668004245!2d39.819486!3d21.425969!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c204b3a1b53a51%3A0x33a7232debdd1579!2sSheraton%20Makkah%20Jabal%20Al%20Kaaba%20Hotel!5e0!3m2!1sen!2sus!4v1723731927730!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'Jabal Al Kaaba, Makkah Al Mukkarammah, Mecca 24231 ·', 'Enjoy a luxurious stay at Sheraton Makkah Jabal Al Kaaba Hotel in Saudi Arabia. Our 5-star hotel features 412 spacious rooms, suites and apartments with partial view of the new expansion of Masjid Al Haram or city view. Our rooms have sumptuous furnishings designed for your comfort and relaxation and boast a unique location in a calm and serene environment. Each of our hotel\'s 110 elegantly appointed apartments features a sleek design complemented by Islamic motifs. The guests can choose from a variety of dining options at our three on-site restaurants, serving delicious Middle Eastern, Asian and International cuisines. The air conditioned pedestrian bridge allows our guests to easily access Masjid Al Haram during busy seasons in Ramadan ', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 1200.00, '2024-08-15', '2024-12-15', 1000.00, '2024-08-15', '2024-12-15', 800.00, '2024-08-15 14:26:19', '2024-08-15 14:26:19', NULL),
(35, 'Saja Al Madinah', '5', 2, NULL, '150', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7262.676809465965!2d39.607696!3d24.473729!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15bdbefe33416f9f%3A0x9b66bbeff9ec060d!2sSaja%20Al%20Madinah!5e0!3m2!1sen!2sus!4v1723732051457!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'King Faisal street, Northern Central Zone, Al Madinah Al Munawarah, Kingdom of Saudi Arabia', 'Stop at Saja Al Madinah to discover the wonders of Medina. Offering a variety of facilities and services the property provides all you need for a good night\'s sleep.', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 1000.00, '2024-08-15', '2024-12-15', 800.00, '2024-08-15', '2024-12-15', 700.00, '2024-08-15 14:30:08', '2024-08-15 14:30:08', NULL);
