(36, 'Jawhrat Al Tawheed', 'Standard Hotel', 1, NULL, '1500', '\n<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3714.414672912466!2d39.77462967526724!3d21.41293998033431!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c21b003d37c3e3%3A0x283cf8e83a6bb807!2sAl%20Tawheed%20Mosque!5e0!3m2!1sen!2sin!4v1723732451102!5m2!1sen!2sin\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>c', '3116 Al Hejrah, Misfalah, 7932, Makkah 24233, Saudi Arabia', '2 km from Masjid Al Haram, Jawhrat Al Tawheed is set in Al Masfalah and offers air-conditioned rooms. The property is located 11 km from Hira Cave, 4.6 km from Zamzam Well and 6.4 km from Makkah Museum. Al Sharaye Stadium is 39 km from the hotel and Masjid Al Haram King Abdul Aziz Gate is 4.6 km away.\n\nStaff speak Arabic and English at the 24-hour front desk.', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com/', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 150.00, '2024-08-15', '2024-12-15', 100.00, '2024-08-15', '2024-12-15', 100.00, '2024-08-15 14:48:37', '2024-08-15 14:48:37', NULL),
(37, 'Azka Safa Hotel ', '4', 2, NULL, '1000', 'https://maps.google.com/maps?ll=21.42022,39.829857&z=16&t=m&hl=en-US&gl=US&mapclient=embed&cid=8598734033971415085', '3116 Al Hejrah, Misfalah, 7932, Makkah 24233, Saudi Arabia ', '\nAzka Al Safa Hotel is located in Ajyad Al- Sud Street, approximately 150 m to the holy Haram. It is also 75 km to Jeddah Airport. The rooms include a flat-screen TV with satellite channels. You will find a kettle in the room. Extras include free toiletries and a hair dryer. Azka Al Safa Hotel features free WiFi throughout the property.\n', ' 9987864449 ', 'info@rahat.in', 'https://www.azkaalsafahotel.com/', '14:00', '23:00', NULL, 1, '2024-08-22', '2025-08-01', 200.00, '2024-08-09', '2024-08-02', 100.00, '2024-08-03', '2024-08-14', 100.00, '2024-08-23 10:28:52', '2024-08-26 18:45:51', '2024-08-26 18:45:51'),
(38, 'Crowne Plaza Madinah, an IHG Hotel ', '5', 2, NULL, '400', 'https://maps.google.com/maps?ll=24.46393,39.61016&z=16&t=m&hl=en-US&gl=US&mapclient=embed&cid=9906442453783030358', '1st Ring Road, Between, King Faisal Street, Al-Madinah al-Munawwarah Saudi Arabia', 'This hotel overlooks the Haram of Masjid al-Nabawi, so pilgrims can walk or take a free shuttle directly to the male and female entrances of the Prophet\'s Holy Mosque. In keeping with its location in the Muslim-only area of Madinah, the hotel provides a restful base for a visit or pilgrimage, with a warm Arab welcome from respectful and attentive staff.\nClassical motifs complement stylish modern design in 506 comfortable rooms and suites, and Haram-view rooms overlook the magnificent courtyard of the Prophet\'s tomb. Complimentary WiFi in all rooms and public areas keeps every guest connected.\nThe Concierge can help with advice on places to visit, as well as the best restaurants, markets and shopping malls in nearby modern Madinah.\nBusiness travelers can host a successful corporate event in five versatile, high-tech conference and boardrooms. Executives can also relax in the plush Club lounge.', ' 9987864449 ', ' info@rahat.in', ' https://www.ihg.com/crowneplaza/hotels/us/en/madinah/medin/hoteldetail', '14:00', '11:00', NULL, 1, '2024-08-02', '2024-09-24', 5000.00, '2024-08-24', '2024-08-26', 3000.00, '2024-08-17', '2024-08-07', 1000.00, '2024-08-23 11:22:44', '2024-08-28 15:01:36', NULL),
(39, 'Azka Safa Hotel', '4', 1, NULL, '350', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7428.459125878574!2d39.829857!3d21.42022!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c204b9a6ce356f%3A0x7754d70bbced882d!2sAzka%20Safa%20Hotel!5e0!3m2!1sen!2sus!4v1724390457200!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', '7019، 7019 4701 طريق الملك عبدالعزيز مكة 24231 7019, Saudi Arabia', 'Azka Al Safa Hotel is located in Ajyad Al- Sud Street, approximately 150 m to the holy Haram. It is also 75 km to Jeddah Airport. The rooms include a flat-screen TV with satellite channels. You will find a kettle in the room. Extras include free toiletries and a hair dryer. Azka Al Safa Hotel features free WiFi throughout the property.', '9987864449', 'info@rahat.in', 'https://www.azkaalsafahotel.com/', '14:00', '23:00', NULL, 1, '2024-08-01', '2024-11-30', 2000.00, '2024-12-01', '2025-03-31', 1600.00, '2025-04-01', '2025-07-31', 1200.00, '2024-08-23 11:23:36', '2024-08-26 18:42:07', NULL),
(40, 'Pullman ZamZam Makkah ', '5', 1, NULL, '0', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7546.814162536772!2d72.83324800000001!3d18.957621!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3be7ce3cd58b13c3%3A0xb07729f581586b81!2sRahat%20Travels%20Of%20India%20Pvt%20Ltd!5e0!3m2!1sen!2sin!4v1727368633452!5m2!1sen!2sin\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'Abraj Al Bait Complex, King Abdul Aziz Rd, Endowment, Mecca 21955, Saudi Arabia', 'Pullman ZamZam Makkah is located just a few meters away from the Holy Mosque and offers luxurious studios and suites. It features a restaurant and views of the city and the Kaaba. Masjid Al Haram is 100 metres away. Guests can enjoy free WiFi in all areas of the hotel.\nAll the units at Zamzam are air-conditioned and elegantly decorated. They include a seating area with satellite TV and work desk. They also have a mini fridge and a safety deposit box. Some rooms feature Haram/Kaaba views. Guests can enjoy a buffet breakfast or choose to be served in the privacy of their rooms.\nFor lunch and dinner it is possible to taste the gourmet cuisine at the hotel restaurant or explore the variety of local restaurants.\nA 24-hour reception and a car rental are available at Pullman ZamZam Makkah. Currency exchange services and an ATM are also offered on-site.', ' 9987864449 ', ' info@rahat.in', ' https://www.pullman-zamzam-makkah.com/', '14:00', '23:00', NULL, 1, '2024-08-06', '2024-08-28', 950.00, '2024-08-01', '2024-08-30', 750.00, '2024-08-12', '2024-08-26', 1150.00, '2024-08-23 11:28:51', '2024-09-26 22:14:13', NULL),
