(43, 'Tara Ajyad Hotel Makkah', 'Standard Hotel', 1, 3, '550', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7429.25393180434!2d39.830497!3d21.404588!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c204c51bcc5263%3A0xd2e431c0806c1d4d!2sArak%20Ajyad%20Hotel!5e0!3m2!1sen!2sin!4v1726475497919!5m2!1sen!2sin\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'Ajyad Street, Ajyad, Makkah, Makkah Province, Saudi Arabia', 'Property Location When you stay at Tera Ajyad Hotel Makkah in Mecca, you\'ll be within a 10-minute drive of Abraj Al-Bait Towers and Al Malaa Cemetery. This hotel is 4.7 mi (7.6 km) from Faqih Mosque and 5.1 mi (8.2 km) from Al-Rajhi Mosque. Rooms Make yourself at home in one of the 73 air-conditioned rooms featuring refrigerators and flat-screen televisions. Satellite television is provided for your entertainment. Bathrooms have showers and complimentary toiletries. Conveniences include electric kettles and complimentary bottled water, and housekeeping is provided daily. Business, Other Amenities Free self parking is available onsite.', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com ', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 300.00, '2024-09-16', '2024-12-15', 300.00, '2024-09-16', '2024-12-15', 270.00, '2024-09-16 14:02:09', '2024-09-16 14:02:37', NULL),
(44, 'Diyar Al Marwa Hotel', 'Standard Hotel', 1, 3, '950', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d29974286.972669706!2d36.80329520279039!3d23.49756923015494!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15c20324252a9dc7%3A0xd9b52b11b484ac79!2sDiyar%20Al%20Marwa%20Hotel!5e0!3m2!1sen!2sin!4v1726476442561!5m2!1sen!2sin\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'MBJB2517، 2517, 7801, Al Jummayzah, Makkah 24236, Saudi Arabia', 'Dyaar Al Marwaa Hotel is situatred at Gazza side with bus service available for 5 time Namaz', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 300.00, '2024-09-16', '2024-12-15', 250.00, '2024-09-16', '2024-12-15', 250.00, '2024-09-16 14:29:08', '2024-09-28 19:17:30', '2024-09-28 19:17:30'),
(45, 'Madina Baity', '3', 2, 3, '450', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d116211.98857485171!2d39.53190202806381!3d24.463804924659414!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x15bdbf5f966d24f1%3A0xfdf3ea74f383b158!2sMadina%20Baity%20Hotel!5e0!3m2!1sen!2sin!4v1726478198560!5m2!1sen!2sin\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', '3340 King Faisal Road, Central Area, Medina, Saudi Arabia, 42311', 'Get your trip off to a great start with a stay at this property, which offers free Wi-Fi in all rooms. Strategically situated in Central Area, allowing you access and proximity to local attractions and sights. Don\'t leave before paying a visit to the famous Al Masjid an Nabawi. This 5-star property is packed with in-house facilities to improve the quality and joy of your stay.', '9987864449', 'info@rahat.in', 'https://www.rahattravels.com', '14:00', '12:00', NULL, 1, '2024-12-15', '2025-01-15', 300.00, '2024-09-16', '2024-12-15', 250.00, '2024-09-16', '2024-12-15', 250.00, '2024-09-16 14:51:33', '2024-09-16 14:51:33', NULL),
