(2, 'Hajj Kit - Ladies', '2', 'hajj-kit-ladies', '2', '<p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and \ntypesetting industry. Lorem Ipsum has been the industry\'s standard dummy\n text ever since the 1500s, when an unknown printer took a galley of \ntype and scrambled it to make a type specimen book. </p>', 500.00, '57128e38-d270-4b59-ac93-7720d1cf7d0b.jpg', 1, '2024-09-24 17:42:08', '2024-09-24 17:42:08', NULL),
(3, 'Hajj kit 250924', '1', 'hajj-kit-250924', '2,3', '<p>The Hajj &amp; Umrah essentials kit has been specially designed to carry the necessary products for the Hajj and Umrah rituals. These products are not widely available and, in most cases, are not recognized as essential by pilgrims. We wanted to make Hajj and Umrah pilgrims\' lives easier by providing them with this kit.<br>If you are performing Hajj or Umrah, this is a must-have kit; if you are not traveling during this time, give it as a gift to friends and family.<br><br>This Hemani Hajj &amp; Umrah kit contains essentials to keep you comfortable during your spiritual journey.<br><br>• Fragrance-Free Soap<br>• Natural Potash Alum Deodorant Stick<br>• Fragrance-Free Shampoo<br>• Fragrance-Free Petroleum Jelly<br>• Fragrance-Free Lotion<br>• Miswak<br><br>Each product in this kit is fragrance-free, dye-free, alcohol-free, and free of animal ingredients.<br></p>', 780.00, '44bc83c8-5189-4e59-ae41-a2fef056140e.jpg', 1, '2024-09-25 15:32:56', '2024-09-25 15:32:56', NULL),
(4, 'Cabin Bag', '2', 'cabin-bag', '4', '<p><b>Cabin Bag</b><br></p>', 349.00, 'ea237072-e204-480c-b3d9-08cc87943c95.jpg', 1, '2024-10-03 16:13:49', '2024-10-03 16:17:29', '2024-10-03 16:17:29'),
