INSERT INTO `aihut_packages` (`id`, `name`, `type_ids`, `service_id`, `umrah_type`, `payment_policy`, `important_notes`, `cancellation_policy`, `inclusion`, `exclusion`, `itinerary`, `flight_transport`, `meals`, `visa_taxes`, `image`, `description`, `is_active`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Short Hajj (Shifting) - (15-18Days)', '6,8,9,12', 1, NULL, '<ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 14px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); font-family: Poppins, sans-serif; scroll-behavior: smooth; padding: 0px; border: 0px; font-size: 15px; vertical-align: baseline; list-style: none;\"><li style=\"margin: 0px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); font-family: Gotham, ZaridSans-Regular, ui-sans-serif, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif; scroll-behavior: smooth; padding: 5px 0px; border: 0px; vertical-align: baseline; list-style: disc; line-height: 18px; text-align: left;\">50% payment at the time of booking</li><li style=\"margin: 0px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); font-family: Gotham, ZaridSans-Regular, ui-sans-serif, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif; scroll-behavior: smooth; padding: 5px 0px; border: 0px; vertical-align: baseline; list-style: disc; line-height: 18px; text-align: left;\">Rest 50% before 30 Days</li></ul><p></p>', '<ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 14px; padding: 0px; font-family: Poppins, sans-serif;\"><li style=\"list-style-type: disc; margin: 0px; padding: 5px 0px; line-height: 18px; text-align: left;\">Everyone carries his own baggage hence please travel light. Excess baggage fees to be paid by Haji.</li><li style=\"list-style-type: disc; margin: 0px; padding: 5px 0px; line-height: 18px; text-align: left;\">Food will not be provided on Airports &amp; During Intercity Transfers.</li><li style=\"list-style-type: disc; margin: 0px; padding: 5px 0px; line-height: 18px; text-align: left;\">If any fluctuation in taxes/currency by the Indian or Saudi Government, passengers have to bear the difference.</li><li style=\"list-style-type: disc; margin: 0px; padding: 5px 0px; line-height: 18px; text-align: left;\">Indian Passport with Minimum 6 month validity.</li><li style=\"list-style-type: disc; margin: 0px; padding: 5px 0px; line-height: 18px; text-align: left;\">Room Allottment will be as per Our Arrangements.</li><li style=\"list-style-type: disc; margin: 0px; padding: 5px 0px; line-height: 18px; text-align: left;\">We will not be responsible for any Delay, Rejection or Mistake in Umrah Visa from Saudi Ambassy.</li><li style=\"list-style-type: disc; margin: 0px; padding: 5px 0px; line-height: 18px; text-align: left;\">If\n pilgrim misses his flight due to any reason MEDICAL or LATE ARRIVAL or \nANY REASON. In such case the passenger will have to bear the Ticket cost\n himself. Visa company or Our Travel Agency will not be responsible for \nReturn Tickets.</li><li style=\"list-style-type: disc; margin: 0px; padding: 5px 0px; line-height: 18px; text-align: left;\">Quad, Triple &amp; Double Sharing is Available Only in Makka and Madina Hotels &amp; Not in Azizia and Mina</li><li style=\"list-style-type: disc; margin: 0px; padding: 5px 0px; line-height: 18px; text-align: left;\">Stay in Aziziya will be Five Sharing</li><li style=\"list-style-type: disc; margin: 0px; padding: 5px 0px; line-height: 18px; text-align: left;\">Stay in Mina Camps will be in Tents having 40-50 people in One Camp</li></ul><p></p>', '<p>Non Refundable Amount <br></p><p></p>', '', '', '', '<p>Full Round Trip Ticket Has Been Included In package</p>', '<div class=\"infotxt\" style=\"margin: 0px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); font-family: Poppins, sans-serif; scroll-behavior: smooth; padding: 0px; border: 0px; font-size: 15px; vertical-align: baseline; line-height: 22px;\"><ul id=\"ulMeals\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 14px; scrollbar-width: auto; scrollbar