(14, '10 Days Baghdad 11Vi Sharif Package Astaana, Karbala, Najaf -Hotel', '6,8', 21, NULL, '<div class=\"infotxt\">\n                                    <div id=\"divPaymentPolicy\"><ul><li>   Pay 50% Advance per person to Book your Umrah tour.</li><li>   Final Balance  Amount to be paid 15 days before departure or the booking will get cancelled without informing.</li><li>   25% before 21 days of Departure</li></ul></div>\n                                </div><p><br></p><p></p>', '<div class=\"infotxt\">\n                                    <div id=\"divImportantNotes\"><ul><li>Everyone carries his own baggage hence please travel light. Excess baggage fees to be paid by Haji.</li><li>Food will not be provided on Airports &amp; During Intercity Transfers. </li><li>If\n pilgrim misses his flight due to any reason MEDICAL or LATE ARRIVAL or \nANY REASON. In such case the passenger will have to bear the Ticket cost\n himself. Visa company or Our Travel Agency will not be responsible for \nReturn Tickets.</li><li>Indian Passport with Minimum 6 month validity.</li><li>Room Allottment will be as per Our Arrangements.</li><li>We will not be responsible for any Delay, Rejection or Mistake in Umrah Visa from Saudi Ambassy. </li></ul></div>\n                                </div><p><br></p><p></p>', '<div class=\"infotxt\">\n                                    <div id=\"divCancellationPolicy\"><ul><li>25% cancellation charges before 30 days of departures</li><li>50% cancellation charges before 21 days of departures</li><li>100% cancellation charges within 21 days of departures</li></ul></div>\n                                </div><p><br></p><p></p>', '<ul><li>Inclusion</li></ul>', '<ul><li>Exclusion</li></ul>', '<ul><li>Itinerary</li></ul>', '<ul id=\"ulFlightTransport\"><li>Pickup and Drop will be in SIC basis</li><li>All Transport On SIC Basis</li><li>Full Round Trip Ticket Has Been Included In package</li></ul><p><br></p><p></p>', '<ul id=\"ulMeals\"><li>Breakfast - 10</li><li>Lunch - 10</li><li>Dinner - 10</li></ul><p><br></p><p></p>', '<p>Baghdad Visa</p><p></p>', NULL, 'Ex Delhi, Ex Mumbai', 1, '2024-09-17 16:42:08', '2024-09-19 18:51:48', '2024-09-19 18:51:48');
