in-left: 14px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); font-family: Poppins, sans-serif; scroll-behavior: smooth; padding: 0px; border: 0px; font-size: 15px; vertical-align: baseline; list-style: none;\"><li style=\"margin: 0px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); font-family: Gotham, ZaridSans-Regular, ui-sans-serif, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif; scroll-behavior: smooth; padding: 5px 0px; border: 0px; vertical-align: baseline; list-style: disc; line-height: 18px; text-align: left;\">Umrah Visa &amp; Insurance are not included</li><li style=\"margin: 0px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); font-family: Gotham, ZaridSans-Regular, ui-sans-serif, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif; scroll-behavior: smooth; padding: 5px 0px; border: 0px; vertical-align: baseline; list-style: disc; line-height: 18px; text-align: left;\">No Taxes Are Not Included</li></ul><p></p>', NULL, 'We take every measure to ensure your journey is as safe and comfortable as possible. Special arrangements include Best of Hotels, Transportation, Meals & Other Complimentary Services. Hajj and Umrah Travel for us is a noble service in which we aim to offer the best possible advice and assistance, making us unique from other tour operators.', 1, '2024-09-18 16:31:56', '2024-09-19 18:51:43', '2024-09-19 18:51:43'),
(16, 'Umrah 15 Days Fixed Departure', '29,6,8,27', 2, 1, '<p>Payment Policy entered here<br></p>', '<p>Important Notes entered here<br></p>', '<p>Cancellation Policy entered here<br></p>', '<h4>Inclusions Entered here...<br>hotel, food, laundry zamzam<br></h4><p></p>', '<p>Exclusion Entered here<br>Gst Tcs &amp; Private Tranfsers<br></p>', '<p>Itinerary entered here<br>Day 1<br>Day 2<br>Day 3<br></p>', '<p>Flight &amp; Transport Entered here<br>Direct Flights<br>30 kg Luggage<br>With All Meals in Flight<br></p>', '<p>Meals Plan Entered here<br>Breakfast Lunch Dinner in Buffet&nbsp;&nbsp;&nbsp;&nbsp;<br></p>', '<p>Visa &amp; Taxes Entered here<br>Saudi Umrah Visa Included <br></p>', NULL, '15 Days Umrah Fixed Group Departures from Major Cities of India', 1, '2024-09-19 19:14:27', '2024-09-27 19:16:49', '2024-09-27 19:16:49'),
(17, '15 Day Umrah', '6', 2, 2, '', '', '', '', '', '', '', '', '', NULL, 'Test By Narendra', 0, '2024-09-23 15:23:18', '2024-09-27 19:16:54', '2024-09-27 19:16:54'),
(18, 'Economy Hajj Package', '27', 1, NULL, '<p align=\"left\" style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234);\"><strong>Cancellation Policy</strong>&nbsp;<strong>:</strong></p><ul style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234);\"><li>After Booking &amp; Before Visa Appointment (Administrative Charges) :: Rs. 10,000/</li><li>After Visa Approval - 25000/-</li><li>Less than 60 days of tour departure - 50%</li><li>Less than 45 days of tour departure - 75%</li><li>Less than 30 days of tour departure - 100%</li><li>Flight &amp; Visa Cost is 100% Non Refundable once Booked.</li></ul>', '<p align=\"left\" style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234);\"><strong>Terms &amp; Conditions :</strong></p><ol style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234);\"><li>Any increase in Air Ticket or Saudi Riyal will have to be paid by the Passenger before departure.</li><li>Private Transfers, Personal Expenses &amp; Room Service are not included in Package.</li><li>In case of&nbsp;<strong>Flight Cancellation&nbsp;</strong>or&nbsp;<strong>Delays&nbsp;</strong>Rahat Group cannot be held responsible. We do not control any Airlines or coach.</li><li>In case of&nbsp;<strong>Flight Cancellation</strong>&nbsp;Hotel Room Bookings cannot be adjusted as per the New Flight Details, As Hotels are already Prepaid and Flight Cancellation will result in No Show at the Hotel. If guest needs to Increase the Nights in Hotel they will have to do the same at their own cost.</li><li>In the event of a&nbsp;<strong>Flight Cancellation&nbsp;</strong>or&nbsp;<strong>Coach breakdown&nbsp;</strong>or&nbsp;<strong>unfavorable climatic conditions&nbsp;</strong>that prevent the scheduled activity from taking place, There will be&nbsp;<strong>no refund of any kind</strong>. However, we value the satisfaction of our guests, we will make every effort to accommodate the missed activity on the next available day, depending on time availability and logistical feasibility.</li><li>Satisfaction of the pilgrim is our prime consideration any claim or complaint by the client must be intimated to Rahat Group in proper format. In the very unlikely event of there being something not to your satisfaction on the pilgrimage that is directly under our control, it should be reported immediately so that there is an opportunity to correct / rectify the same. The Tour Operator shall not accept liability in respect of claims which are not reported to us immediately.</li><li>Room Allotment as per our arrangement, No Choice of room will be entertained.</li><li>Personal food demands will not be entertained. Special food for Infants, Old Age people or Medical patients will have to be arranged by Guest himself. 6. Friends and Relatives of Guests are not allowed to Eat or Stay in our Hotels. Especially Iqaama Holders will not be allowed within our Hotel Premises.</li><li>Excess baggage fees to be paid by Pilgrim.</li><li>AIHUT accepts no responsibility for Luggage Losses, Money Loss, Injuries, Damages, Accidents and Additional Expenses due to any reason for example delay of flights, Misconnection, Sickness, Bad Weather, Strike, War, Transport breakdown or the closure of Airport. You are sole responsible for your luggage and belongings be it at Airport or Hotel premises.</li><li>AIHUT will not be responsible if the pilgrim misses his flight due to any reason and in such case the passenger will have to bear the cost of rescheduling in case the ticket can be rescheduled or else if the ticket is Non Refundable no refund will be made at all. If during the period of rescheduling the Umrah Visa Expires New Visa fees has to be paid by Pilgrim.</li><li>Laundry services: All India Hajj and Umrah Tours Pvt. Ltd. shall not be responsible for any Loss, Delay, and Fading of color, Stains of any type or Shrinking of clothes by the Laundry service provider. Laundry is Complimentary service.</li><li>Due to unavoidable circumstances changes and alterations in the package have to be made regarding Hotel, Bus, Staying period or change of flight. ALL INDIA HAJJ AND UMRAH TOURS PVT. LTD. Reserves the Right to make alterations which pilgrim has to accept and for which no refund shall be made nor any claim shall be entertained.</li><li>After entering into Saudi Arabia no pilgrim of ALL INDIA HAJJ AND UMRAH TOURS PVT. LTD. shall be allowed to give up his/her companionship with his/her group. He/she will have to travel with the group and will not be allowed under any circumstances to leave the group. Nobody will be allowed to Travel outside the tour plan without permission</li><li>Partly utilized services are also considered as fully utilized. In such circumstances no refund shall be applicable.</li><li>For all claims, disputes of whatever nature relating to the tours Marketed / Coordinated by All India Hajj and Umrah Tours Pvt. Ltd. the Courts in Mumbai shall alone have jurisdiction.</li><li>Handicap passengers are requested to carry their own Wheelchair. Special requests (Pregnant or Handicapped) if any please inform us before departure without fail.</li><li>All payments should be cleared Two Weeks before departure. Visa stamping is subject to approval by Saudi Embassy. AIHUT will not be responsible for any Delay, Rejection or Mistake by Saudi Embassy.</li><li>Visa stamping fees is Non Refundable.</li><li>Any person using Foul language or Bad Words or trying to create nuisance and fight in the group will be immediately removed from the group.</li><li>Zamzam and Saudi Sim Card are complimentary services and are subject to availability by Saudi Government 20. Under unforeseen circumstances Hotel Names mentioned on Brochures can change and Similar Hotels may be provided to the Guests.</li><li>It is advisable to carry Saudi Riyal from Home Country as Exchange rates are high on Airport &amp; Foreign Country.</li><li>Terms &amp; Conditions / Package prices / Airfare are subject to change without any prior notice. I have read and understood all the above terms and conditions.</li></ol>', '<p align=\"left\" style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234);\"><strong>Cancellation Policy</strong>&nbsp;<strong>:</strong></p><ul style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234);\"><li>After Booking &amp; Before Visa Appointment (Administrative Charges) :: Rs. 10,000/</li><li>After Visa Approval - 25000/-</li><li>Less than 60 days of tour departure - 50%</li><li>Less than 45 days of tour departure - 75%</li><li>Less than 30 days of tour departure - 100%</li><li>Flight &amp; Visa Cost is 100% Non Refundable once Booked.</li></ul>', '<p class=\"style17\" style=\"color: rgb(255, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234); font-weight: bold;\">Package Includes ::</p><div style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234); font-weight: bold;\"><ul><li>Return Airline Tickets.</li><li>Accomodation in Aziziya, Mina, Arafat, Makka and Madina as per package selected.</li><li>Provision of Hajj Visa an Moulim Draft.</li><li>All Daily Meals : As per Meal Plan of Hotels.</li><li>Complimentary Laundry Service. (<span class=\"style17\" style=\"color: rgb(255, 0, 0);\">Not Available in Arafat, Mina and Azizia</span>)</li><li>Internal Transportation by Government / Moulim Coaches.</li><li>All Stay in Licensed Hotels.</li><li>All Transportation.</li></ul></div>', '<p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234);\"><span class=\"style17\" style=\"color: rgb(255, 0, 0);\"><strong>Package does Not Include ::</strong></span></p><ul style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234);\"><li style=\"font-weight: bold;\"><span mce_name=\"strong\" mce_style=\"font-weight: bold;\">Qurbani</span>&nbsp;is&nbsp;<span class=\"style17\" style=\"color: rgb(255, 0, 0);\">NOT Included</span>, though can be arranged upon request and extra cost.</li><li style=\"font-weight: bold;\">Medical Expenses incurred for Immunization before going for Hajj.</li><li style=\"font-weight: bold;\">Transport from Muzdalifa to Mina.</li><li style=\"font-weight: bold;\">Transportation for&nbsp;<span mce_name=\"strong\" mce_style=\"font-weight: bold;\">Tawaf-e-Ziarat.</span></li><li style=\"font-weight: bold;\">If you travel other than programme and / or Group Dates, individually and / or travel by private Taxi in Saudi Arabia you will incur and pay for additional transportation charge which is also subject&nbsp; to the Rules and Regulation of Ministry of Haj, Saudi Arabia.</li><li style=\"font-weight: bold;\">Room Service &amp; Laundry is not available in Azizia &amp; Mina.</li><li style=\"font-weight: bold;\">Excess Baggage other than weight allowance at the Airport.</li></ul>', '<p>Day 1<br>Day 2</p>', '<p>Not yet dediced&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>all meals are tasty&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>Only Hajj Visa<br>GST Included in Cost<br>TCS should be paid extra</p>', NULL, 'f you have made the intention to embark upon this truly unique journey, then we at Rahat Travels ask that you allow us to host you upon this trip. Rahat Travels Hajj packages, which range from 5 star Hajj Packages to Budget Hajj tours, have evolved from years of experience and dedication, and through the valued feedback of our previous customers. We have listened to you, our customers, and developed a number of packages. Whichever package you choose, rest assured that we endeavour to provide you with all the comfort, religious and practical advice which will allow you to dedicate yourselves to the monumental task of performing the task at hand.', 0, '2024-09-23 16:21:03', '2024-09-27 19:14:35', '2024-09-27 19:14:35'),
(19, '14 Day Ziyarat', '6,9', 21, NULL, '<p><span style=\"color: rgb(108, 117, 125);\">Payment Policy1</span><br></p>', '<p><span style=\"color: rgb(108, 117, 125);\">Important Notes2</span><br></p>', '<p><span style=\"color: rgb(108, 117, 125);\">Cancellation Policy3</span><br></p>', '<p><span style=\"color: rgb(108, 117, 125);\">Inclusion7</span><br></p>', '<p><span style=\"color: rgb(108, 117, 125);\">Exclusion8</span><br></p>', '', '<p><span style=\"color: rgb(108, 117, 125);\">Flight &amp; Transport4</span><br></p>', '<p><span style=\"color: rgb(108, 117, 125);\">Meals5</span><br></p>', '<p><span style=\"color: rgb(108, 117, 125);\">Visa &amp; Taxes6</span><br></p>', NULL, 'test', 1, '2024-09-24 11:30:16', '2024-09-27 19:16:58', '2024-09-27 19:16:58'),
(20, 'Ramzaan Test', '39,40', 20, NULL, '<p><span style=\"color: rgb(108, 117, 125);\">Payment Policy ramzaan</span><br></p>', '<p><span style=\"color: rgb(108, 117, 125);\">Important Notes5</span><br></p>', '<p><span style=\"color: rgb(108, 117, 125);\">Cancellation Policy5</span><br></p>', '<p><span style=\"color: rgb(108, 117, 125);\">Inclusion5</span><br></p>', '<p><span style=\"color: rgb(108, 117, 125);\">Exclusion5</span><br></p>', '', '<p><span style=\"color: rgb(108, 117, 125);\">Flight &amp; Transport5</span><br></p>', '<p><span style=\"color: rgb(108, 117, 125);\">Meals5</span><br></p>', '<p><span style=\"color: rgb(108, 117, 125);\">Visa &amp; Taxes5</span><br></p>', NULL, 'gfgfjhfjhkj', 1, '2024-09-24 12:02:29', '2024-09-27 19:17:06', '2024-09-27 19:17:06'),
(21, '15 Days Umrah Package Delhi-Mumbai-Ahmedabad-Hyderabad ', '29', 2, 1, '<p>Optional program of Local Ziarat with Professional Tour Guide such as \nMina, Arafat, Muzdalifa, Jabal e Noor, Jabal E Soor and Jannat ul Mala \nwith Live Commentaries &amp; Duaas from Islamic Scholars. Also Optional \nVisit to Masjid e Juraana. (2nd Umrah from Jurana)</p>', '<p>AT YOUR DISPOSAL - For doing optional Second and Third Umrah, or Just Do your <br></p>', '<p>Optional program of TAIF with Professional Tour Guide (3 nd Umrah on return from Taif is a Must)</p>', '<p>Optional program of Local Ziarats with Professional Tour Guide visiting \nall the Historical places in Madina i.e. Masjid E Quba, Masjid E \nQiblatain, Saba-Masajid, and Jabal e Ohud with Live Commentaries &amp; \nDuaas from Islamic Scholars. You</p>', '<p>Optional program of Ziarat Badar with Professional Tour Guide. It is \nsituated approximately 80 miles southwest of Medina, Saudi Arabia. The \npilgrimage to Ziarat Badar provides an opportunity for Muslims to step \nback in time and reflect upon the courage and faith of the early Muslims\n who participated in the Battle of Bad</p>', '<p>Spend your Time in Masjid E Nabvi or Visit Quba on Foot and spend most of the time in Ibadats and Astagfaar</p>', '<p>For doing optional Second and Third Umrah, or Just Do your Ibaadats in Haram</p>', '<p>For Relaxation or Just Do your Ibaadats &amp; Duaas in Haram</p>', '<p>Today get ready to checkout from your hotel as we will be moving to \nMadinah Munawwarah (4½ - 5hrs Journey) the 2nd Holiest City (time will \nbe given after your arrival to Makkah, you are kindly requested to \nfollow the timing), arrive Madinah and transfer to your hotel, check in \nto your hotel and relax, fresh up as you will be visiting the most \nawaited Masjid e Nabwi (S.A.W), enter with respect and lower your voice \nas our Prophet (S.A.W) is relaxing here, present your Salam to him and \nalso give our Salam too (Meals will be arranged as per your arrival \ntiming).</p>', NULL, 'Assemble at International Airport and board Flight to Jeddah, After arrival at Jeddah Airport & immigration clearance meet our local representative who will assist and transfer you to Makkah Mukarramah (1½ - 2 hrs Journey), arrive at the Holiest City and transfer to Hotel, check in and relax to reassemble yourself for the main objective of your journey The Umrah as per instructions from our Hotel Manager. Perform Umrah (1st Umrah) with our Representative and remember us also in your dua... (Meals will be arranged as per your arrival timing)', 1, '2024-09-24 17:26:00', '2024-09-27 19:17:15', '2024-09-27 19:17:15'),
(22, '05 Nites Regular Umrah Package', '8,24,27', 2, 2, '<p><span style=\"color: rgb(71, 71, 71) font-family: \">Mount\n Arafat is a granite hill about 20km southeast of Makkah in the plain of\n Arafah. It is often called the “Mountain of Mercy,” because it is the \nhill upon which&nbsp;</span><span style=\"background-color: rgb(211, 227, 253) color: rgb(4, 12, 40) font-family: \">Prophet\n Ibrahim (as) was prepared to sacrifice his son Ismail (as) before Allah\n mercifully substituted a ram for sacrifice in place of the boy</span><span style=\"color: rgb(71, 71, 71) font-family: \">.</span></p>', '<p><span style=\"color: rgb(71, 71, 71) font-family: \">Located in Arafah, Jabal Rahmah holds a significant meaning as this was the location reportedly where&nbsp;</span><span style=\"color: rgb(4, 12, 40) font-family: \">Prophet Adam A.S. and Hawa A.S. were reunited and also where Prophet Muhammad S.A.W.</span><span style=\"color: rgb(71, 71, 71) font-family: \">&nbsp;</span><span style=\"color: rgb(4, 12, 40) font-family: \">delivered his final sermon of his final Hajj</span><span style=\"color: rgb(71, 71, 71) font-family: \">.</span></p>', '<p><span style=\"color: rgb(77, 81, 86) font-family: arial, sans-serif text-align: start\">Jabal\n Thawr is a mountain in Saudi Arabia, located in the lower part of Mecca\n to the south of the district of Misfalah. The height of the mountain is\n 750 m.</span></p>', '<p>Masjid Al-Jinn was named after the place where Prophet Muhammad (peace \nbe upon him) met the jinn. It is also known as Al-Haras Mosque because \nthe guards used to circumambulate the Kaaba until they reached the \nmosque, where they would stop until its companions and guards caught up \nwith it.</p>', '<p><font color=\"#000000\">Masjid Al-Khaif, also known as the Mosque of the \nTent, is a historic mosque located in Mina, near the city of Mecca in \nSaudi Arabia. It is one of the largest mosques in the world, with a \ncapacity to accommodate over 50,000 worshippers at a time. The mosque is\n of great religious significance to Muslims, as it is believed to have \nbeen built by Prophet Ibrahim (Abraham) and his son Prophet Ismail \n(Ishmael) over 4000 years ago. The mosque was rebuilt several times \nthroughout history, most recently in the 20th century.</font></p>', '<p>Masjid Mashar al-Haram is a mosque situated in Muzdalifah which marks \nthe area where the Prophet&nbsp; supplicated during his Farewell Pilgrimage. \nIt is located midway between Masjid al-Khayf in Mina and Masjid \nal-Namirah in Arafat.</p>', '<p><span style=\"color: rgb(77, 81, 86) font-family: arial, sans-serif text-align: start\">Jabal\n al-Nour is a mountain near Mecca in the Hejaz region of Saudi Arabia. \nThe mountain houses the grotto or cave of Hira\', which holds tremendous \nsignificance for Muslims throughout the world.</span></p>', '<p>Jamarat is the plural of Jamrah in Arabic, meaning small stone or \npebble. In the context of the Jamarat Hajj, the word refers to the three\n pillars at which pilgrims cast pebbles to reject sin and invoke Allah\'s\n strength.</p>', '<p><span style=\"color: rgb(77, 81, 86) font-family: arial, sans-serif text-align: start\">Jannat\n al-Mu\'alla, also known as the \"Cemetery of Ma\'la\", is a cemetery to the\n north of Al-Masjid Al-Haram, and near the Mosque of the Jinn in Makkah,\n Saudi Arabia. It is the place where the Islamic prophet Muhammad\'s \nwife, grandfather, and other ancestors are buried.</span></p>', NULL, 'The rituals of Umrah include wearing the Ihram (a special set of clothing), performing Tawaf (circumambulation) around the Kaaba in Mecca, and Sa\'i (walking seven times between the hills of Safa and Marwah). Unlike Hajj, Umrah does not include standing at the plain of Arafat or other specific rituals.', 1, '2024-09-24 17:53:08', '2024-09-27 19:17:22', '2024-09-27 19:17:22'),
(23, 'Budget Hajj Package 40-45 Days', '29', 1, NULL, '<p>Pay Now 50,000 Rs with Passport and confirm your seat<br>Balance 50% at time of Quota.<br>Balance 30 Days before Departure</p>', '', 'Bookings Cancelled 45 Days Before Departure will have to bear a\n Cancellation fee of 20% Booking Amount.\n<br>Bookings Cancelled Within 45 Days of Departure will have to bear a\n Cancellation fee of 50% Booking Amount.&nbsp;<br>Once Visa is Issued there is no Cancellation of Booking.\n<br>No Refund will be Given in this Case', '<p>&nbsp;Economy Class Air Ticket, Hajj Visa &amp; Draft, Insurance.\n Full Board Accommodation, Round Trip Transportation.\n Stay in Mina Arafat Muzdalifa, Ziyarats, Laundry, Saudi Sim.\n Guide &amp; Moallim Fees, Ziyarats in Makkah and Madina.\n Trolley Bags, Duffle Bags, Shoulder Bag, Laptop Bags, Hajj Kit, GST 5%.<br></p>', 'Qurbaani, Transportation from Muzdalifa to Mina\n on 10th Zil Hajj, Transportation for Tawaaf-e-Ifaada from Mina to Makkah\n on 10th and 11 Zilhajj, Private Individual Transfers from Airport to\n Hotel or Vice Varsa, Room Service, TCS 5%', '<p><br></p>', '<p>Flight Details Coming soon</p>', '<p>All Meals are included,<br>Meals are prepared in Licensed and Hygenic KItchens</p>', '<p>Hajj Visa and Insurance is Included</p>', NULL, 'Throughout your life you have prayed, fasted and given in charity. Now, only one pillar remains; a pillar combining both physical and financial acts of worship, an act dating back to the time of Ibrahim (AS); the Hajj. Follow in the footsteps of millions before you; prophets, scholars and the righteous. Stand before Allah on the plains of Arafat and beseech Him to wipe away your sins, sleep alongside other Muslims from all over the world under a canopy of stars in Muzdalifah and add to the mountain of stones thrown at the pillars in Mina. Make tawaf within touching distance of the Ka’bah and pray behind the imam in the Prophet’s mosque in Madinah. How many yearn for this chance and eagerly anticipate its arrival? Will you be among the fortunate ones this year', 1, '2024-09-26 22:00:37', '2024-10-08 11:47:42', NULL),
(24, '14 Nites Umrah Land Packages', '6,8,27', 2, 2, '<p align=\"left\" style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234);\"><strong>Payment Policy (Umrah and Holidays)</strong></p><blockquote style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-style: normal; letter-spacing: normal; background-color: rgb(242, 242, 234);\"><p align=\"left\">• 1st Payment RS. 40,000/- per person On Booking<br>• Final Payment : Balance Amount 21 Days before departure</p></blockquote><p align=\"left\" style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234);\"><strong>Payment Policy (Hajj &amp; Ramzaan)</strong></p><blockquote style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-style: normal; letter-spacing: normal; background-color: rgb(242, 242, 234);\"><p align=\"left\">• 1st Payment RS. 100,000/- per person On Booking.<br>• Final Payment : 100% Before Hajj Visa Issuancne.</p></blockquote>', '<p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234);\"><strong align=\"left\">Important Notes</strong>&nbsp;Read before you travel.</p><ol style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234);\"><li>Please activate ROAMING on your Sim before leaving India.</li><li>Download&nbsp;<strong>*IMO, SKYPE, BOTIM* for your VIDEO &amp; AUDIO CALLS,</strong>&nbsp;Whatsupp calls dont work in Saudi.</li><li>Please take *Printout (HARD COPY)* of your Ticket, Visa, Insurance, Hotel Voucher, Umrah Visa before reaching the AIRPORT. Printouts will not be arranged on airport by our Staff.</li><li>Please wear EHRAM before crossing meeqat its advisable to wear EHRAM from your home if you are going to JEDDAH AIRPORT for UMRAH.</li><li>Please Buy Saudi RIYAL from INDIA before reaching AIRPORT. Saudi Riyal is very expensive in MAKKA MADINA and on AIPRORTS.</li><li>PLEASE keep 50-100 sar change with you handy in pockets for emergency use to buy juice water etc.</li><li>Make sure to Keep your medicine handy with you in hand bags and don’t put it in Checking Baggage.</li><li>Keep an Extra set of EHRAM &amp; Slippers for emergency.</li><li>Do Not Carry INDIAN FLAGS with you or any other Country FLAGS. Taking pics with FLAGs is Totally Banned and Can lead to Jail sentence.</li><li>Watch YOUTUBE Videos and Consult *Scholars AALISMs and MUFTIS before leaving for UMRAH.</li><li>Please carry Extension board and Universal Adapter for your Mobile Recharges, Socket in Saudis do not support Indian Round Plugs hence a universal square adapter is required.</li><li>Carry your own wheelchairs, Wheelchairs are not available in Hotel and in HARAM it’s a paid service, you can use electric Scooters also</li></ol>', '<p align=\"left\" style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234);\"><strong>Cancellation Policy</strong>&nbsp;<strong>:</strong></p><ul style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: rgb(242, 242, 234);\"><li>After Booking &amp; Before Visa Appointment (Administrative Charges) :: Rs. 10,000/</li><li>After Visa Approval - 25000/-</li><li>Less than 60 days of tour departure - 50%</li><li>Less than 45 days of tour departure - 75%</li><li>Less than 30 days of tour departure - 100%</li><li>Flight &amp; Visa Cost is 100% Non Refundable once Booked.</li></ul>', '<ul><li><span style=\"background-color: rgb(242, 242, 234); font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: 700;\">All Meals,</span><br></li><li><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: 700; background-color: rgb(242, 242, 234);\"> Laundry,</span></li><li><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: 700; background-color: rgb(242, 242, 234);\"> Zamzam,</span></li><li><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: 700; background-color: rgb(242, 242, 234);\"> Ziyarats,</span></li><li><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: 700; background-color: rgb(242, 242, 234);\"> Taif &amp; Badar, </span></li><li><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: 700; background-color: rgb(242, 242, 234);\">Rowda Permit. </span></li><li><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: 700; background-color: rgb(242, 242, 234);\">Zamzam, </span></li><li><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: 700; background-color: rgb(242, 242, 234);\">Local Ziyarats, </span></li><li><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: 700; background-color: rgb(242, 242, 234);\">Intercity Transfers, </span></li><li><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: 700; background-color: rgb(242, 242, 234);\">Airport Pickup and Drop.</span><br></li></ul>', '<ul><li>GST</li><li>TCS</li><li>Room Service</li><li>Private Transfers</li></ul>', '<h3 style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; text-align: -webkit-center;\"><strong>Umrah Tour Itinerary &amp; Program</strong></h3><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><strong>Day 1: Arrival in Makkah</strong></p><ul style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><li><strong>Assemble at International Airport</strong>&nbsp;and board the flight to Jeddah.</li><li><strong>Arrival at Jeddah Airport</strong>: Complete immigration clearance and meet our local representative.</li><li><strong>Transfer to Makkah Mukarramah</strong>: Approximately 1½ - 2 hours journey.</li><li><strong>Hotel Check-in</strong>: Relax and prepare for Umrah.</li><li><strong>Perform 1st Umrah</strong>: With our representative. Meals will be arranged based on your arrival time.</li></ul><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><strong>Day 2: Makkah</strong></p><ul style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><li><strong>At Your Disposal</strong>: Use this day for relaxation or engage in Ibaadats (worship) and Duas in Haram.</li></ul><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><strong>Day 3: Optional Ziarat</strong></p><ul style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><li><strong>Local Ziarat</strong>: With a professional tour guide visiting Mina, Arafat, Muzdalifa, Jabal e Noor, Jabal E Soor, and Jannat ul Mala.</li><li><strong>Optional Visit to Masjid e Juraana</strong>: Perform 2nd Umrah from Jurana.</li></ul><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><strong>Day 4: Makkah</strong></p><ul style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><li><strong>At Your Disposal</strong>: Time for optional Nafil Tawafs or additional Ibaadats in Haram.</li></ul><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><strong>Day 5: Optional Taif Excursion</strong></p><ul style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><li><strong>Program to Taif</strong>: With a professional tour guide. Return from Taif and perform 3rd Umrah.</li></ul><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><strong>Day 6: Makkah</strong></p><ul style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><li><strong>At Your Disposal</strong>: Opportunity for optional second and third Umrahs, or additional Ibaadats in Haram.</li></ul><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><strong>Day 7 or 8: Transfer to Madinah</strong></p><ul style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><li><strong>Checkout from Hotel in Makkah</strong>: Proceed to Madinah Munawwarah (4½ - 5 hours journey).</li><li><strong>Arrival in Madinah</strong>: Check-in at your hotel, relax, and prepare to visit Masjid e Nabwi (S.A.W).</li><li><strong>Visit Masjid e Nabwi</strong>: Enter with respect, offer Salam to the Prophet (S.A.W) and make Duas. Meals arranged as per arrival timing.</li></ul><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><strong>Day 9: Optional Madinah Ziarats</strong></p><ul style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><li><strong>Local Ziarats</strong>: With a professional tour guide visiting Masjid E Quba, Masjid E Qiblatain, Saba-Masajid, and Jabal e Ohud. Time for two Rakaat Namaaz in Masjid e Quba and Masjid e Qiblatain.</li></ul><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><strong>Day 10: Optional Ziarat Badar</strong></p><ul style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><li><strong>Ziarat Badar</strong>: With a professional tour guide. Reflect on the Battle of Badr and the courage of early Muslims.</li></ul><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><strong>Day 11, 12, 13: Madinah</strong></p><ul style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><li><strong>At Your Disposal</strong>: Spend time in Masjid e Nabvi, visit Quba on foot, and engage in Ibaadats and Astaghfaar (seeking forgiveness).</li></ul><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><strong>Day 14 or 15: Departure</strong></p><ul style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><li><strong>Pack and Prepare</strong>: Checkout from the hotel and transfer to Jeddah Airport (5 – 6 hours journey).</li><li><strong>Departure</strong>: With all the happy memories of your journey.</li></ul><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><strong>Airport Reporting</strong>:</p><ul style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><li><strong>Mumbai Airport</strong>: Report at Terminal 2, Gate No. 5.</li><li><strong>Delhi Airport</strong>: Report at Terminal 3, Gate No. 6.</li><li><strong>Report 4 Hours Before Departure</strong>.</li></ul><p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: -webkit-center;\"><strong>Happy Tour Concludes</strong>.</p>', '<p>Flight is Not Included in this package&nbsp;&nbsp;&nbsp;&nbsp;</p>', '<p>All Meals are included in this package</p>', '<p>Umrah Visa is Included<br>Gst and TCS is not Included</p>', NULL, 'Umrah Land Packages are designed to cater to travelers who already hold a valid Multiple Entry Visa.\n\nThese packages exclude the airfare and visa but include all other necessary services, such as accommodation, meals, local transportation, and guided tours.\n\nFly From Anywhere in the World\nTalk to our Travel Expert Today\nCall :: +91 786 10 786 18\n------------------\nMAKE YOUR UMRAH\nA MEMORABLE AND HASSLE FREE JOURNEY\nWITH Rahat GORUP\n\nThe primary purpose of these packages is to offer convenience and cost savings for people who don’t need an additional visa and can easily arrange their own flights from any part of India or the world.\n\nWith these packages, travelers can seamlessly plan their journey by simply adding the land package to their itinerary and focusing on their spiritual experience without worrying about the logistics.\n\n', 1, '2024-09-27 01:34:29', '2024-09-27 19:17:36', '2024-09-27 19:17:36');
INSERT INTO `aihut_packages` (`id`, `name`, `type_ids`, `service_id`, `umrah_type`, `payment_policy`, `important_notes`, `cancellation_policy`, `inclusion`, `exclusion`, `itinerary`, `flight_transport`, `meals`, `visa_taxes`, `image`, `description`, `is_active`, `created_at`, `updated_at`, `deleted_at`) VALUES
(25, '15 Days Umrah Package Delhi-Mumbai-Ahmedabad-Hyderabad-Banglore', '29,6,8,9,24,12,27,38,39', 2, 1, '<p style=\"margin-bottom: 0px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px;\">Payment Policy (Umrah and Holidays)</p><ul style=\"margin-bottom: 5px; padding: 0px 18px; color: rgb(37, 37, 37); font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">&nbsp;1st Payment RS. 40,000/- per person On Booking</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Final Payment : Balance Amount 21 Days before departure</li></ul><p style=\"margin-bottom: 0px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px;\">Payment Policy (Hajj &amp; Ramzaan)</p><ul style=\"margin-bottom: 5px; padding: 0px 18px; color: rgb(37, 37, 37); font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">1st Payment RS. 100,000/- per person On Booking.</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Final Payment : 100% Before Hajj Visa Issuancne.</li></ul>', '', '<ul style=\"margin-bottom: 5px; padding: 0px 18px; color: rgb(37, 37, 37); font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">After Booking &amp; Before Visa Appointment (Administrative Charges) :: Rs. 10,000/</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">After Visa Approval - 25000/-</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Less than 60 days of tour departure - 50%</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Less than 45 days of tour departure - 75%</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Less than 30 days of tour departure - 100%</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Flight &amp; Visa Cost is 100% Non Refundable once Booked.</li></ul>', '<ul style=\"margin-bottom: 5px; color: rgb(102, 102, 102); padding: 0px 0px 0px 14px; line-height: 12px; font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Return Air Tickets.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Umrah Visa with Insurance.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Hotel Stay in Makka Madina</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Food :: Indian Set Menu 3 Meals.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Ziarats in Makka &amp; Madina.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Round Trip Transfers.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Complimentary items provided by the Tour operator (Not for booked without bed)</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Saudi Simcard.*</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Laundry *</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Zamzam *</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Internal Transportation by bus in Groups.</li></ul>', '<ul style=\"margin-bottom: 5px; color: rgb(102, 102, 102); padding: 0px 0px 0px 14px; line-height: 12px; font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">GST &amp; TCS.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Private &amp; Personal Transfers.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Room Service.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Anything not Mentioned in Inclusions.</li></ul><p style=\"margin-bottom: 0px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); padding: 0px; line-height: 18px !important;\"><span style=\"font-weight: 600;\">- Please note :-&nbsp; Bucket and Tubs will not be available in hotels</span></p><p style=\"margin-bottom: 0px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); padding: 0px; line-height: 18px !important;\"><span style=\"font-weight: 600;\">- No Fans are not available in Rooms Only AC</span></p><p style=\"margin-bottom: 0px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); padding: 0px; line-height: 18px !important;\"><span style=\"font-weight: 600;\">- Indian Toilets are not available only English Toilets</span></p><p style=\"margin-bottom: 0px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); padding: 0px; line-height: 18px !important;\"><span style=\"font-weight: 600;\">- Water is available only on Buffet Not in Rooms.</span></p>', '<p>DAY 1 : Assemble at International Airport and board Flight to Jeddah, After arrival at Jeddah Airport &amp; \nimmigration clearance meet our local representative who will assist and transfer you to Makkah Mukarramah \n(1½ - 2 hrs Journey), arrive at the Holiest City and transfer to Hotel, check in and relax to reassemble yourself for \nthe main objective of your journey The Umrah as per instructions from our Hotel Manager. Perform Umrah (1st \nUmrah) with our Representative and remember us also in your dua... (Meals will be arranged as per your arrival \ntiming) <br>&nbsp;DAY 2 : AT YOUR DISPOSAL - For Relaxation or Just Do your Ibaadats &amp; Duaas in Haram. <br>&nbsp;DAY 3 : Optional program of Local Ziarat with Professional Tour Guide such as Mina, Arafat, Muzdalifa, Jabal e \nNoor, Jabal E Soor and Jannat ul Mala with Live Commentaries &amp; Duaas from Islamic Scholars. Also Optional Visit \nto  Masjid e Juraana. (2nd Umrah from Jurana) <br>&nbsp;DAY 4: AT YOUR DISPOSAL - For doing Nafil Tawafs Relax or Just Do your Ibaadats in Haram. <br>&nbsp;DAY 5 : : Optional program of TAIF with Professional Tour Guide (3nd Umrah on return from Taif is a Must) <br>&nbsp;DAY 6 : AT YOUR DISPOSAL - For doing optional Second and Third Umrah, or Just Do your Ibaadats in Haram <br>&nbsp;DAY 7 or 8 : Today get ready to checkout from your hotel as we will be moving to Madinah Munawwarah (4½ - \n5hrs Journey) the 2nd Holiest City (time will be given after your arrival to Makkah, you are kindly requested to \nfollow the timing), arrive Madinah and transfer to your hotel, check in to your hotel and relax, fresh up as you \nwill be visiting the most awaited Masjid e Nabwi (S.A.W), enter with respect and lower your voice as our Prophet \n(S.A.W) is relaxing here, present your Salam to him and also give our Salam too \n(Meals will be arranged as per your arrival timing). <br>&nbsp;DAY 09 : Optional program of Local Ziarats with Professional Tour Guide visiting all the Historical places in \nMadina i.e. Masjid E Quba, Masjid E Qiblatain, Saba-Masajid, and Jabal e Ohud with Live Commentaries &amp; Duaas \nfrom Islamic Scholars. You will be given time to offer two Rakaat Namaaz in Masjid e Quba and Masjid e \nQiblatain. \nDAY 10 : Optional program of Ziarat Badar with Professional Tour Guide. It is situated approximately 80 miles \nsouthwest of Medina, Saudi Arabia. The pilgrimage to Ziarat Badar provides an opportunity for Muslims to step \nback in time and reflect upon the courage and faith of the early Muslims who participated in the Battle of Badr. <br>DAY 11,12,13 : Spend your Time in Masjid E Nabvi or Visit Quba on Foot and spend most of the time in Ibadats \nand Astagfaar. <br>&nbsp;DAY 14 or 15 : Today is the last day of our Holy Journey, pack your baggage and get ready until your pickup from \nHotel and drop to Jeddah Airport (5 – 6 Hrs Journey) with all the happy memories of your Journey.&nbsp;<br></p>', '<p>Ticket cost is included&nbsp;<br>all transports are in SIC basis</p>', '3 Time meals in buffet', '<p>Visa and Insurance are included&nbsp;<br>Taxes are excluded</p>', NULL, 'TEST PAGES', 1, '2024-09-27 14:51:51', '2024-09-28 19:35:15', NULL),
(26, '3 Nights Regular Umrah Package with Visa', '29,6,8,27,38,39', 2, 2, '<p style=\"margin-bottom: 0px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px;\"><span style=\"font-weight: 600;\">Payment Policy (Umrah and Holidays)</span></p><ul style=\"padding: 0px 18px 0px 14px; color: rgb(37, 37, 37); font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">&nbsp;1st Payment RS. 40,000/- per person On Booking</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Final Payment : Balance Amount 21 Days before departure</li></ul>', '<ul style=\"padding: 0px 18px 0px 14px; color: rgb(37, 37, 37); font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\"><p style=\"margin-bottom: 0px; line-height: 20px; padding: 0px 0px 10px;\">In case client wishes to prepone /postpone his or her travel dates, we request you to kindly reach us 15 days prior to journey date via e-mail/SMS.</p></li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\"><p style=\"margin-bottom: 0px; line-height: 20px; padding: 0px 0px 10px;\">The customers can prepone /postpone their tour once without any additional charges (if intimated before 15 days of travel date in written). However postponing &amp; preponing second time will attract additional charges.</p></li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\"><p style=\"margin-bottom: 0px; line-height: 20px; padding: 0px 0px 10px;\">Also note that few service providers (Hoteliers, Transporter etc.) may apply postpone/prepone charges even after meeting above requirement. In such cases postpone/prepone charges will deducted from the advance amount deposited.</p></li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\"><p style=\"margin-bottom: 0px; line-height: 20px; padding: 0px 0px 10px;\">In all prepone or postpone scenarios, the services and the costing will be subject to availability of Hotel/Volvo and season/off season time.</p></li></ul><p style=\"margin-bottom: 0px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px;\">&nbsp;</p><ul style=\"padding: 0px 18px 0px 14px; color: rgb(37, 37, 37); font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\"><p style=\"margin-bottom: 0px; line-height: 20px; padding: 0px 0px 10px;\">We do not accept any changes in plan within 15 days of travel date. However in rare cases like adverse climatic conditions or strikes, package can be postponed which will be intimated to you beforehand.</p></li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\"><p style=\"margin-bottom: 0px; line-height: 20px; padding: 0px 0px 10px;\">The validity to utilize your Advance payment in prepone/postpone scenarios is 1 Year from the date of advance payment.</p></li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\"><p style=\"margin-bottom: 0px; line-height: 20px; padding: 0px 0px 10px;\">The avance payment and the invoice Number allotted to you, are transferable i.e. you can pass on your booking to any of your friends/ relatives. (Please Note: In order to transfer your booking you must meet the above terms and conditions first)...</p></li></ul>', '<ul style=\"margin-bottom: 5px; padding: 0px 18px; color: rgb(37, 37, 37); font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">After Booking &amp; Before Visa Appointment (Administrative Charges) :: Rs. 10,000/</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">After Visa Approval - 25000/-</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Less than 60 days of tour departure - 50%</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Less than 45 days of tour departure - 75%</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Less than 30 days of tour departure - 100%</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Flight &amp; Visa Cost is 100% Non Refundable once Booked.</li></ul>', '<ul style=\"margin-bottom: 4px; color: rgb(102, 102, 102); padding: 0px 18px 0px 14px; line-height: 12px; font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">VIsa and insurance</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Hotel Stay in Makka Madina</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Food :: Indian Set Menu 3 Meals.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Ziarats in Makka &amp; Madina.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Round Trip Transfers.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Complimentary items provided by the Tour operator (Not for booked without bed)</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Saudi Simcard.*</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Laundry *</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Zamzam *</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Internal Transportation by bus in Groups.</li></ul>', '<p style=\"margin-bottom: 0px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); padding: 0px; line-height: 18px !important;\"><span style=\"font-weight: 600;\">Exclusions</span></p><ul style=\"margin-bottom: 4px; color: rgb(102, 102, 102); padding: 0px 18px 0px 14px; line-height: 12px; font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Air Tickets</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">GST &amp; TCS.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Private &amp; Personal Transfers.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Room Service.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Anything not Mentioned in Inclusions.</li></ul><p style=\"margin-bottom: 0px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); padding: 0px; line-height: 18px !important;\"><span style=\"font-weight: 600;\">- Please note :-&nbsp; Bucket and Tubs will not be available in hotels</span></p><p style=\"margin-bottom: 0px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); padding: 0px; line-height: 18px !important;\"><span style=\"font-weight: 600;\">- No Fans are not available in Rooms Only AC</span></p><p style=\"margin-bottom: 0px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); padding: 0px; line-height: 18px !important;\"><span style=\"font-weight: 600;\">- Indian Toilets are not available only English Toilets</span></p><p style=\"margin-bottom: 0px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); padding: 0px; line-height: 18px !important;\"><span style=\"font-weight: 600;\">- Water is available only on Buffet Not in Rooms.</span></p>', '<p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">Day : 1<br>Assemble at International Airport and board Flight to Jeddah, After arrival at Jeddah Airport &amp; immigration clearance meet our local representative who will assist and transfer you to Makkah Mukarramah (1½ - 2 hrs Journey), arrive at the Holiest City and transfer to Hotel, check in and relax to reassemble yourself for the main objective of your journey The Umrah as per instructions from our Hotel Manager. Perform Umrah with our Representative and remember us also in your dua... (Meals will be arranged as per your arrival timing)</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">Day : 2&nbsp;Makkah</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">&nbsp;Optional program of Local Ziarat with Professional Tour Guide such as Mina, Arafat, Muzdalifa, Jabal e Noor, Jabal E Soor and Jannat ul Mala with Live Commentaries &amp; Duaas from Islamic Scholars. Also Optional Visit to Masjid e Juraana.<br>Day : 3&nbsp;Makkah - Madinah</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">Today get ready to checkout from your hotel as we will be moving to Madinah Munawwarah (4½ - 5hrs Journey) the 2nd Holiest City (time will be given after your arrival to Makkah, you are kindly requested to follow the timing), arrive Madinah and transfer to your hotel, check in to your hotel and relax, fresh up as you will be visiting the most awaited Masjid e Nabwi (S.A.W), enter with respect and lower your voice as our Prophet (S.A.W) is relaxing here, present your Salam to him and also give our Salam too (Meals will be arranged as per your arrival timing). We do Ziyarats of Badar also on the way from Makka to Madina&nbsp;<br>Day : 4&nbsp;Madinah</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">Optional program of Visit to Masjid e Quba on Foot with our Guide to follow this SUNNAH of our Beloved Prophet and Earn Rewards of One Maqbool Umrah.</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">Today is the last day of our Holy Journey, pack your baggage and get ready until your pickup from Hotel and drop to Jeddah Airport (5 – 6 Hrs Journey) with all the happy memories of your Journey.&nbsp;&nbsp;</p>', '<ul><li>All Transport on SIC Basis</li><li>All Ziyarats on SIC basis</li></ul>', '<p><span style=\"font-family: Gotham, ZaridSans-Regular, ui-sans-serif, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif; font-size: 15px;\">Breakfast Lunch Dinner in Buffet&nbsp;&nbsp;</span><br></p>', '<ul><li>Umrah Visa and Insu Are Included</li><li>No taxes are included</li></ul>', NULL, 'The rituals of Umrah include wearing the Ihram (a special set of clothing), performing Tawaf (circumambulation) around the Kaaba in Mecca, and Sa\'i (walking seven times between the hills of Safa and Marwah). Unlike Hajj, Umrah does not include standing at the plain of Arafat or other specific rituals.', 1, '2024-09-27 14:54:46', '2024-09-28 19:10:41', '2024-09-28 19:10:41');
