-weight: 600;\">- Please note :-&nbsp; Bucket and Tubs will not be available in hotels</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); font-family: Rubik, sans-serif; scroll-behavior: smooth; padding: 0px; border: 0px; font-size: 15px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(102, 102, 102); line-height: 18px !important;\"><span style=\"margin: 0px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); font-family: Gotham, ZaridSans-Regular, ui-sans-serif, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif; scroll-behavior: smooth; padding: 0px; border: 0px; vertical-align: baseline; font-weight: 600;\">- No Fans are not available in Rooms Only AC</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); font-family: Rubik, sans-serif; scroll-behavior: smooth; padding: 0px; border: 0px; font-size: 15px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(102, 102, 102); line-height: 18px !important;\"><span style=\"margin: 0px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); font-family: Gotham, ZaridSans-Regular, ui-sans-serif, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif; scroll-behavior: smooth; padding: 0px; border: 0px; vertical-align: baseline; font-weight: 600;\">- Indian Toilets are not available only English Toilets</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); font-family: Rubik, sans-serif; scroll-behavior: smooth; padding: 0px; border: 0px; font-size: 15px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(102, 102, 102); line-height: 18px !important;\"><span style=\"margin: 0px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); font-family: Gotham, ZaridSans-Regular, ui-sans-serif, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif; scroll-behavior: smooth; padding: 0px; border: 0px; vertical-align: baseline; font-weight: 600;\">- Water is available only on Buffet Not in Rooms.</span></p>', '<p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY-1&nbsp;Assemble at International Airport and board Flight to Jeddah, After arrival at Jeddah Airport &amp; immigration clearance meet our local representative who will assist and transfer you to Makkah Mukarramah (1½ - 2 hrs Journey), arrive at the Holiest City and transfer to Hotel, check in and relax to reassemble yourself for the main objective of your journey The Umrah as per instructions from our Hotel Manager. Perform Umrah with our Representative and remember us also in your dua... (Meals will be arranged as per your arrival timing)&nbsp;</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY-2&nbsp;&nbsp;AT YOUR DISPOSAL - For Relaxation or Just Do your Ibaadats &amp; Duaas in Haram</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY-3&nbsp;&nbsp;Optional program of Local Ziarat with Professional Tour Guide such as Mina, Arafat, Muzdalifa, Jabal e Noor, Jabal E Soor and Jannat ul Mala with Live Commentaries &amp; Duaas from Islamic Scholars. Also Optional Visit to Masjid e Juraana.&nbsp;<br><br>DAY-4&nbsp;&nbsp;Today get ready to checkout from your hotel as we will be moving to Madinah Munawwarah (4½ - 5hrs Journey) the 2nd Holiest City (time will be given after your arrival to Makkah, you are kindly requested to follow the timing), arrive Madinah and transfer to your hotel, check in to your hotel and relax, fresh up as you will be visiting the most awaited Masjid e Nabwi (S.A.W), enter with respect and lower your voice as our Prophet (S.A.W) is relaxing here, present your Salam to him and also give our Salam too (Meals will be arranged as per your arrival timing). We do Ziyarats of Badar also on the way from Makka to Madina&nbsp;<br><br>DAY-5&nbsp;Optional program of Visit to Masjid e Quba on Foot with our Guide to follow this SUNNAH of our Beloved Prophet and Earn Rewards of One Maqbool Umrah.Optional program of Ziarat with Professional Tour Guide visiting all the Historical places in Madina i.e. Masjid E Quba, Masjid E Qiblatain, Saba-Masajid, and Jabal e Ohud with Live Commentaries &amp; Duaas from Islamic Scholars. You will be given time to offer two Rakaat Namaaz in Masjid e Quba<br><br><br>DAY-6&nbsp;Today is the last day of our Holy Journey, pack your baggage and get ready until your pickup from Hotel and drop to Jeddah Airport (5 – 6 Hrs Journey) with all the happy memories of your Journey.&nbsp;</p>', '<h6 style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); font-family: Gotham, ZaridSans-Regular, ui-sans-serif, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif; scroll-behavior: smooth; padding: 0px; border: 0px; font-size: 18px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(154, 119, 75); line-height: 20px; background-color: rgb(255, 248, 244);\">Flight &amp; Transport</h6><div class=\"infotxt\" style=\"margin: 0px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); font-family: Gotham, ZaridSans-Regular, ui-sans-serif, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif; scroll-behavior: smooth; padding: 0px; border: 0px; font-size: 15px; vertical-align: baseline; line-height: 24px; background-color: rgb(255, 248, 244);\"><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 20px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); scroll-behavior: smooth; padding: 0px; border: 0px; vertical-align: baseline; list-style: none;\"><li style=\"margin: 0px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); scroll-behavior: smooth; padding: 5px 0px; border: 0px; vertical-align: baseline; list-style: disc; line-height: 24px; text-align: left;\">All Transport on SIC Basis</li><li style=\"margin: 0px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); scroll-behavior: smooth; padding: 5px 0px; border: 0px; vertical-align: baseline; list-style: disc; line-height: 24px; text-align: left;\">All Ziyarats on SIC basis</li></ul></div>', '<p><span style=\"font-family: Gotham, ZaridSans-Regular, ui-sans-serif, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif; font-size: 15px; background-color: rgb(255, 248, 244);\">Breakfast Lunch Dinner in Buffet&nbsp;&nbsp;</span><br></p>', '<h6 style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); font-family: Gotham, ZaridSans-Regular, ui-sans-serif, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif; scroll-behavior: smooth; padding: 0px; border: 0px; font-size: 18px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(154, 119, 75); line-height: 20px; background-color: rgb(255, 248, 244);\">Visa &amp; Taxes</h6><div class=\"infotxt\" style=\