(28, '16 days Umrah package SV Lucknow', '29,6,8,27', 2, 1, '<p style=\"margin-bottom: 0px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px;\"><span style=\"font-weight: 600;\">Payment Policy (Umrah and Holidays)</span></p><ul style=\"padding: 0px 18px 0px 14px; color: rgb(37, 37, 37); font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">&nbsp;1st Payment RS. 40,000/- per person On Booking</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Final Payment : Balance Amount 21 Days before departure</li></ul><p style=\"margin-bottom: 0px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px;\"><span style=\"font-weight: 600;\">Payment Policy (Hajj &amp; Ramzaan)</span></p><ul style=\"padding: 0px 18px 0px 14px; color: rgb(37, 37, 37); font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">1st Payment RS. 100,000/- per person On Booking.</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Final Payment : 100% Before Hajj Visa Issuancne.</li></ul>', '<p>NA</p>', '<p style=\"margin-bottom: 0px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px;\"><br></p><ul style=\"padding: 0px 18px 0px 14px; color: rgb(37, 37, 37); font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">After Booking &amp; Before Visa Appointment (Administrative Charges) :: Rs. 10,000/</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">After Visa Approval - 25000/-</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Less than 60 days of tour departure - 50%</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Less than 45 days of tour departure - 75%</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Less than 30 days of tour departure - 100%</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Flight &amp; Visa Cost is 100% Non Refundable once Booked.</li></ul><p style=\"margin-bottom: 0px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px;\">&nbsp;</p>', '<p style=\"margin-bottom: 0px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); padding: 0px; line-height: 18px !important;\"><span style=\"font-weight: 600;\">Inclusions</span></p><ul style=\"margin-bottom: 4px; color: rgb(102, 102, 102); padding: 0px 18px 0px 14px; line-height: 12px; font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Return Air Tickets.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Umrah Visa with Insurance.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Hotel Stay in Makka Madina</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Food :: Indian Set Menu 3 Meals.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Ziarats in Makka &amp; Madina.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Round Trip Transfers.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Complimentary items provided by the Tour operator (Not for booked without bed)</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Saudi Simcard.*</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Laundry *</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Zamzam *</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Internal Transportation by bus in Groups.</li></ul>', '<p style=\"margin-bottom: 0px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); padding: 0px; line-height: 18px !important;\"><br></p><ul style=\"margin-bottom: 4px; color: rgb(102, 102, 102); padding: 0px 18px 0px 14px; line-height: 12px; font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">GST &amp; TCS.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Private &amp; Personal Transfers.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Room Service.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Anything not Mentioned in Inclusions.</li></ul><p style=\"margin-bottom: 0px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); padding: 0px; line-height: 18px !important;\"><span style=\"font-weight: 600;\">- Please note :-&nbsp; Bucket and Tubs will not be available in hotels</span></p><p style=\"margin-bottom: 0px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); padding: 0px; line-height: 18px !important;\"><span style=\"font-weight: 600;\">- No Fans are not available in Rooms Only AC</span></p><p style=\"margin-bottom: 0px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); padding: 0px; line-height: 18px !important;\"><span style=\"font-weight: 600;\">- Indian Toilets are not available only English Toilets</span></p><p style=\"margin-bottom: 0px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); padding: 0px; line-height: 18px !important;\"><span style=\"font-weight: 600;\">- Water is available only on Buffet Not in Rooms.</span></p>', '<p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">Umrah Tour Itinerary &amp; Program<br>DAY 1 : Assemble at International Airport and board Flight to Jeddah, After arrival at Jeddah Airport &amp; immigration clearance meet our local representative who will assist and transfer you to Makkah Mukarramah (1½ - 2 hrs Journey), arrive at the Holiest City and transfer to Hotel, check in and relax to reassemble yourself for the main objective of your journey The Umrah as per instructions from our Hotel Manager. Perform Umrah (1st Umrah) with our Representative and remember us also in your dua... (Meals will be arranged as per your arrival timing)</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY 2 : AT YOUR DISPOSAL - For Relaxation or Just Do your Ibaadats &amp; Duaas in Haram.</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY 3 : Optional program of Local Ziarat with Professional Tour Guide such as Mina, Arafat, Muzdalifa, Jabal e Noor, Jabal E Soor and Jannat ul Mala with Live Commentaries &amp; Duaas from Islamic Scholars. Also Optional Visit to &nbsp;Masjid e Juraana. (2nd Umrah from Jurana)</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY 4, 5 : AT YOUR DISPOSAL - For doing Nafil Tawafs Relax or Just Do your Ibaadats in Haram.</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY 6&nbsp; : Optional program of TAIF with Professional Tour Guide (3nd Umrah on return from Taif is a Must)</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY 7 : AT YOUR DISPOSAL - For doing optional Second and Third Umrah, or Just Do your Ibaadats in Haram</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY 8 or 9 : Today get ready to checkout from your hotel as we will be moving to Madinah Munawwarah (4½ - 5hrs Journey) the 2nd Holiest City (time will be given after your arrival to Makkah, you are kindly requested to follow the timing), arrive Madinah and transfer to your hotel, check in to your hotel and relax, fresh up as you will be visiting the most awaited Masjid e Nabwi (S.A.W), enter with respect and lower your voice as our Prophet (S.A.W) is relaxing here, present your Salam to him and also give our Salam too<br>(Meals will be arranged as per your arrival timing).&nbsp;</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY 10 : Optional program of Local Ziarats with Professional Tour Guide visiting all the Historical places in Madina i.e. Masjid E Quba, Masjid E Qiblatain, Saba-Masajid, and Jabal e Ohud with Live Commentaries &amp; Duaas from Islamic Scholars. You will be given time to offer two Rakaat Namaaz in Masjid e Quba and Masjid e Qiblatain.</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY 11 : Optional program of Ziarat Badar with Professional Tour Guide. It is situated approximately 80 miles southwest of Medina, Saudi Arabia. The pilgrimage to Ziarat Badar provides an opportunity for Muslims to step back in time and reflect upon the courage and faith of the early Muslims who participated in the Battle of Badr.</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY 12,13,14, 15 : Spend your Time in Masjid E Nabvi or Visit Quba on Foot and spend most of the time in Ibadats and Astagfaar.</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY 16 or 17 : Today is the last day of our Holy Journey, pack your baggage and get ready until your pickup from Hotel and drop to Jeddah Airport (5 – 6 Hrs Journey) with all the happy memories of your Journey.</p>', '<p>Tickets are included&nbsp;<br>transport on SIC basis</p>', '<p>All meals in buffet</p>', '<p>Visa and insurance included&nbsp;<br>Taxes are excluded</p>', NULL, 'TEST', 1, '2024-09-27 16:05:45', '2024-09-27 16:05:45', NULL);
INSERT INTO `aihut_packages` (`id`, `name`, `type_ids`, `service_id`, `umrah_type`, `payment_policy`, `important_notes`, `cancellation_policy`, `inclusion`, `exclusion`, `itinerary`, `flight_transport`, `meals`, `visa_taxes`, `image`, `description`, `is_active`, `created_at`, `updated_at`, `deleted_at`) VALUES
(29, '10 Nights Baghdad Package ', '8', 21, NULL, '<ul style=\"padding: 0px 18px 0px 14px; color: rgb(37, 37, 37); font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">&nbsp;1st Payment RS. 40,000/- per person On Booking</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Final Payment : Balance Amount 21 Days before departure</li></ul>', '<ul style=\"padding: 0px 18px 0px 14px; color: rgb(37, 37, 37); font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\"><p style=\"margin-bottom: 0px; line-height: 20px; padding: 0px 0px 10px;\">In case client wishes to prepone /postpone his or her travel dates, we request you to kindly reach us 15 days prior to journey date via e-mail/SMS.</p></li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\"><p style=\"margin-bottom: 0px; line-height: 20px; padding: 0px 0px 10px;\">The customers can prepone /postpone their tour once without any additional charges (if intimated before 15 days of travel date in written). However postponing &amp; preponing second time will attract additional charges.</p></li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\"><p style=\"margin-bottom: 0px; line-height: 20px; padding: 0px 0px 10px;\">Also note that few service providers (Hoteliers, Transporter etc.) may apply postpone/prepone charges even after meeting above requirement. In such cases postpone/prepone charges will deducted from the advance amount deposited.</p></li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\"><p style=\"margin-bottom: 0px; line-height: 20px; padding: 0px 0px 10px;\">In all prepone or postpone scenarios, the services and the costing will be subject to availability of Hotel/Volvo and season/off season time.</p></li></ul><ul style=\"padding: 0px 18px 0px 14px; color: rgb(37, 37, 37); font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\"><p style=\"margin-bottom: 0px; line-height: 20px; padding: 0px 0px 10px;\">We do not accept any changes in plan within 15 days of travel date. However in rare cases like adverse climatic conditions or strikes, package can be postponed which will be intimated to you beforehand.</p></li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\"><p style=\"margin-bottom: 0px; line-height: 20px; padding: 0px 0px 10px;\">The validity to utilize your Advance payment in prepone/postpone scenarios is 1 Year from the date of advance payment.</p></li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\"><p style=\"margin-bottom: 0px; line-height: 20px; padding: 0px 0px 10px;\">The avance payment and the invoice Number allotted to you, are transferable i.e. you can pass on your booking to any of your friends/ relatives. (Please Note: In order to transfer your booking you must meet the above terms and conditions first)</p></li></ul>', '<ul style=\"padding: 0px 18px 0px 14px; color: rgb(37, 37, 37); font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">After Booking &amp; Before Visa Appointment (Administrative Charges) :: Rs. 10,000/</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">After Visa Approval - 25000/-</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Less than 60 days of tour departure - 50%</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Less than 45 days of tour departure - 75%</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Less than 30 days of tour departure - 100%</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Flight &amp; Visa Cost is 100% Non Refundable once Booked.</li></ul>', '<ul style=\"margin-bottom: 4px; color: rgb(102, 102, 102); padding: 0px 18px 0px 14px; line-height: 12px; font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Return Air Tickets.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Visa&nbsp;</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Hotel Stay&nbsp;</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Food 3 Meals.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Ziarats&nbsp;</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Round Trip Transfers.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Internal Transportation by bus in Groups.</li></ul>', '<ul style=\"margin-bottom: 4px; color: rgb(102, 102, 102); padding: 0px 18px 0px 14px; line-height: 12px; font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">GST &amp; TCS.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Private &amp; Personal Transfers.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Room Service.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Anything not Mentioned in Inclusions.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Bucket and Tubs will not be available in hotels</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">No Fans are not available in Rooms Only AC</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Indian Toilets are not available only English Toilets</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Water is available only on Buffet Not in Rooms</li></ul>', '<p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">(Baghdad, Karabala, Kufa, Najaf, Kazmain, Azmain, Hilla, Musayyab, Babil)</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY 1 - Baghdad Upon arrival to NAJAF / Baghdad International airport, our representative will help with the procedures. From Baghdad airport will Transfer to Hotel in Baghdad / Kazmain, Rooms will be allotted, Food will be served within hotel at Restaurant Timing will be informed at the time of checkin itself stay at hotel and take rest. Overnight stay in Kazmain Hotel.</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY 2 - Baghdad After breakfast will for Ziarat of Hazrat Imam Musa Kazim (R. A.) , Hazrat Imam Mohammad Bin Al Jawad seventh and Ninth Imam of Islam, Hazrat Sayedna Shaikh Mufid (R.A.), Hazrat Imam Abu Yusuf (R.A.) then back to Hotel. After having Lunch will go for Ziayart of Gaus E Azam Dastagir (R. A.), Shaikh Abdul Jabbar Jilani, Shaikh Saleh Jilani, aftter praying Isha namaz will return back to Hotel. Overnight stay in Kazmain hotel.</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY 3 - Baghdad After breakfast will go for Local Ziarats in Baghdad :- Shaikh Maroof Karki, Chilla Gause E Azam in Maroof Karki Mazaar,Shaikh Esa Karki, Well of Maroof Karki,Bibi Zubaida,Shaikh Masroor Hallaj,Shaikh Sirri Sakhti, Shaikh Junaid Baghdadi, Nabi Alla Yusua Bin Noon,Hazrat Behlool Daana, Shaikh Ibrahim Khawwas,Junnoon Misri then back to hotelOvernight stay in hotel.</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY 4 - Baghdad After breakfast will go to Madaaen Ziyarat:- Hazrat Salman Farsi (R.A.) Hazrat Hazaifa bin Yaman (R.A.),Hazrat Abdullah bin Jabir (R.A.) Hazrat Tahir bin Imam, Qaisar o Kisra ke Khandarat then back to Baghdad Ziayarats :- Imam E Azam Abu Hanifa, Imam Ahmad Bin Hambal, Sayyed Abdullah ibn Zainab, Sayyed Abu Ahmed, Shaikh Bishar Al Haafi, Shaikh Abubakar Shibli, Khwaja Abul Hasan Noori, Imam Mohammad Ghazali,Shaikh Sahabuddin Umar Suharwadi then back to Hotel Overnight stay in Hotel</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY 5 - Baghdad After Breakfast visit to Sayyed Abu Khumra Rifaai Al Hindi, on the way Dajjla Nadi (Tigris River), Langarkhaana of Gaus E Azam, Also Afternoon Lunch we will have in Langar Of Gaus E Azam Dastagir followed with Ziarat and stay in Asthana after Isha will go back to Hotel. Overnight Stay in kazmain Hotel</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY 6 - Baghdad After Lunch visit once again to Asthana Gaus E Azam Dastagir spend day in Asthana, After Isha back to Hotel, Overnight stay in Kazmain hote</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY 7 – Musayyab - Karbala After breakfast will checkout form Kazmain Hotel and Proceed to Karbala on the way will visit to Musayyab for Ziarat of Aulad E Muslim. On reaching Karbala Hotel Checkin will be done and after Magrib visit to Hazrat Imam Hussain ( R. A.) , Hazrat Abbas Alamdar then back to Hotel Overnight stay in Karbala.</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY 8 – Karbala After breakfast will move for Karbala Local Ziarats :- Hazrat Imam Hussain (R.A.), Hazrat Abbas Alamdar ( R.A.), Hazrat Sayedna Ali Akbar ( R. A.), Hazrat Sayedna Ali Asgar (R. A.), Ganj e Shohda e Karbala , Maqam e Shahadat e Imam Hussain (R.A.), Maqam Kaff al – abbas 1, maqam Kaff al – abbas 2, Hazrat Kasim ibne Hasan ( R.A.), Hazrat Habib Ibn e Mazaheer, Hazrat Hur ( R.A.), Hazrat Aun ( R.A.), Hazrat Muhammad ( R. A.), Nehar E Furrat then back to Hotel overnight stay Karbala.</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY 9 – Karbala-Kufa-Najaf-Hilla-Karbala After breakfast proceed to Kufa Ziarats :- Jama Masjid of Kufa, HAzrat Muslim Bin Aqeel ( R. A.), Hazrat Haani Bin Urwaa ( R. A.), Maqaame Toofan e Nooh (A. S.), Bibi Khadija ( R. A.), House of Moaula Ali (R. A.), Well of Imam Ali (R.A.), Hazrat Misam Tammar, Yazeeds place once existed, Maqam E Shahadat e Imam Ali (R. A.), Musallah Hazrat Imam Ali (R.A.), Hajar E Shamsi, Musallah RasoolAllah (S.A.W.), Then will Proceed to Hilla Ziarats :- Hazrat Nabi Ayyub Allaihe Salam, Hazrat Bibi Rahima, Well of Nabi Ayyub (Beer E Ayyub), Hosue of Nabi Ayyub ( R.A.), Birth Place of Prophet Ibrahim (R.A.), Ruins of Palace of Namrood, Shrine of Imran bin Ali (A.S.), Then will Proceed to Najaf Ziarats :- Nabi Saaleh Allaihe Salaam ,Nabi Hud Allaihe Salaam, Graveyard (Kabrastan) of Najaf, Holy Shrine of Hazrat Moula Ali (R. A.),</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY 10 - NAJAF IN Najaf we will visit Mazaar of Damad e Rasool Hazrat Moula Ali (R. A.). Also we have mazarats of two Prophets Hud and Saleh. Also Worlds Biggest Kabrastaan is in Najaf WadissSalam. DAY 11 – NAJAF We will visit House of Imam Jafar Sadiq in Wadias Salam</p>', '<ul><li>Flight rates are included</li><li>All transport on SIC basis</li></ul>', '3 time meals in Buffet', '<ul><li>Baghdad visa&nbsp; Included</li><li>Taxes are not included</li></ul><p><br></p>', NULL, 'It seems you might be referring to \"Baghdad Sharif\" as a term. However, \"Baghdad Sharif\" doesn\'t seem to refer to any specific location or concept that is widely recognized. Baghdad itself is the capital city of Iraq, as I mentioned earlier.\n\nIf you could provide more context or clarify what you mean by \"Baghdad Sharif,\" I would be happy to provide more information or assistance.', 1, '2024-09-27 16:14:31', '2024-09-27 16:14:31', NULL),
