 &quot;Noto Sans&quot;, sans-serif; scroll-behavior: smooth; padding: 0px 0px 10px; border: 0px; vertical-align: baseline; list-style: disc; line-height: 20px; color: rgb(102, 102, 102); text-align: justify;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); scroll-behavior: smooth; padding: 0px 0px 10px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; line-height: 20px;\">Also note that few service providers (Hoteliers, Transporter etc.) may apply postpone/prepone charges even after meeting above requirement. In such cases postpone/prepone charges will deducted from the advance amount deposited.</p></li><li style=\"margin: 0px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); font-family: Gotham, ZaridSans-Regular, ui-sans-serif, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif; scroll-behavior: smooth; padding: 0px 0px 10px; border: 0px; vertical-align: baseline; list-style: disc; line-height: 20px; color: rgb(102, 102, 102); text-align: justify;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); scroll-behavior: smooth; padding: 0px 0px 10px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; line-height: 20px;\">In all prepone or postpone scenarios, the services and the costing will be subject to availability of Hotel/Volvo and season/off season time.</p></li></ul><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); font-family: Rubik, sans-serif; scroll-behavior: smooth; padding: 0px 0px 10px; border: 0px; font-size: 15px; vertical-align: baseline; overflow-wrap: break-word; line-height: 20px; color: rgb(102, 102, 102); 