ine-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY-4,5 AT YOUR DISPOSAL - For Relaxation or Just Do your Ibaadats &amp; Duaas in Haram<br><br>DAY-6&nbsp; Today get ready to checkout from your hotel as we will be moving to Madinah Munawwarah (4½ - 5hrs Journey) the 2nd Holiest City (time will be given after your arrival to Makkah, you are kindly requested to follow the timing), arrive Madinah and transfer to your hotel, check in to your hotel and relax, fresh up as you will be visiting the most awaited Masjid e Nabwi (S.A.W), enter with respect and lower your voice as our Prophet (S.A.W) is relaxing here, present your Salam to him and also give our Salam too (Meals will be arranged as per your arrival timing). We do Ziyarats of Badar also on the way from Makka to Madina&nbsp;<br><br>DAY-7 Optional program of Visit to Masjid e Quba on Foot with our Guide to follow this SUNNAH of our Beloved Prophet and Earn Rewards of One Maqbool Umrah.Optional program of Ziarat with Professional Tour Guide visiting all the Historical places in Madina i.e. Masjid E Quba, Masjid E Qiblatain, Saba-Masajid, and Jabal e Ohud with Live Commentaries &amp; Duaas from Islamic Scholars. You will be given time to offer two Rakaat Namaaz in Masjid e Quba</p><p style=\"margin-bottom: 5px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102);\">DAY-8,9&nbsp; AT YOUR DISPOSAL - For Relaxation or Just Do your Ibaadats &amp; Duaas in Haram<br><br>DAY-10 Today is the last day of our Holy Journey, pack your baggage and get ready until your pickup from Hotel and drop to Jeddah Airport (5 – 6 Hrs Journey) with all the happy memories of your Journey.&nbsp;</p>', '<ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 20px; scrollbar-width: auto; scrollbar-color: rgb(125, 125, 125) rgb(230, 230, 230); font-family: Gotham, ZaridSans-Regular, ui-sans-serif, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvet