ehavior: smooth; padding: 5px 0px; border: 0px; vertical-align: baseline; list-style: disc; line-height: 24px; text-align: left;\">No taxes are included</li></ul>', NULL, 'Umrah is an Islamic pilgrimage to Mecca, Saudi Arabia, performed by Muslims at any time of the year, unlike Hajj, which has specific dates according to the Islamic lunar calendar. While Hajj is obligatory for Muslims who can afford it and are physically able to ', 1, '2024-09-28 19:00:28', '2024-09-28 19:00:28', NULL),
(36, '14-Night Regular Umrah Package with Visa', '29,6,8,27,38,39', 2, NULL, '', '', '', '', '', '', '', '', '', NULL, 'Umrah is an Islamic pilgrimage to Mecca, Saudi Arabia, performed by Muslims at any time of the year, unlike the Hajj, which has specific dates according to the Islamic lunar calendar. While the Hajj is one of the Five Pillars of Islam and is mandatory for all Muslims who are physically and financially able to perform it at least once in their lifetime, Umrah is not compulsory but is highly recommended.', 1, '2024-09-28 19:07:23', '2024-09-28 19:34:55', NULL),
(37, '20-Night Regular Umrah Package with Visa', '29,6,8,27,38,39', 2, NULL, '', '', '', '', '', '', '', '', '', NULL, 'Umrah is an Islamic pilgrimage to Mecca, Saudi Arabia, performed by Muslims at any time of the year, unlike the Hajj, which has specific dates in the Islamic lunar calendar. While it\'s not obligatory like the Hajj, it is highly recommended in Islam and holds great spiritual significance for Muslims.', 1, '2024-09-28 19:17:53', '2024-09-28 19:33:56', NULL),
(38, '16 days Umrah package SV Lucknow', '29,6,8,9,24,12,27,38,39', 2, 1, '', '', '', '', '', '', '', '', '', NULL, 'Umrah is an Islamic pilgrimage to Mecca, Saudi Arabia, performed by Muslims at any time of the year, unlike Hajj, which has specific dates according to the Islamic lunar calendar. While Hajj is obligatory for Muslims who can afford it and are physically able to undertake the journey, Umrah is a non-mandatory act of worship, but it is highly recommended in Islam.', 1, '2024-09-28 19:29:57', '2024-09-28 19:34:42', NULL),
(39, '24-Night Regular Umrah Package with Visa', '29,6,8,27,38,39', 2, 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Umrah is an Islamic pilgrimage to Mecca, Saudi Arabia, performed by Muslims at any time of the year, unlike the Hajj, which has specific dates in the Islamic lunar calendar. While it\'s not obligatory like the Hajj, it is highly recommended in Islam and holds great spiritual significance for Muslims.', 1, '2024-09-28 19:40:47', '2024-09-28 19:40:47', NULL),
(40, 'Umrah Package 2024', '6,8', 2, 1, '<p style=\"margin-bottom: 0px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px;\">Payment Policy (Umrah and Holidays)</p><ul style=\"margin-bottom: 5px; padding: 0px 18px; color: rgb(37, 37, 37); font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">&nbsp;1st Payment RS. 40,000/- per person On Booking</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Final Payment : Balance Amount 21 Days before departure</li></ul><p style=\"margin-bottom: 0px; line-height: 20px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px;\">Payment Policy (Hajj &amp; Ramzaan)</p><ul style=\"margin-bottom: 5px; padding: 0px 18px; color: rgb(37, 37, 37); font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">1st Payment RS. 100,000/- per person On Booking.</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Final Payment : 100% Before Hajj Visa Issuancne.</li></ul>', '<p><span style=\"color: rgb(108, 117, 125);\">Important Notes</span><br></p>', '<ul style=\"margin-bottom: 5px; padding: 0px 18px; color: rgb(37, 37, 37); font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">After Booking &amp; Before Visa Appointment (Administrative Charges) :: Rs. 10,000/</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">After Visa Approval - 25000/-</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Less than 60 days of tour departure - 50%</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Less than 45 days of tour departure - 75%</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Less than 30 days of tour departure - 100%</li><li style=\"list-style-type: disc; color: rgb(102, 102, 102); text-align: justify; padding: 0px 0px 10px; line-height: 20px; margin-bottom: 0px;\">Flight &amp; Visa Cost is 100% Non Refundable once Booked.</li></ul>', '<ul style=\"margin-bottom: 5px; line-height: 12px; color: rgb(102, 102, 102); padding: 0px 0px 0px 14px; font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Return Air Tickets.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Umrah Visa with Insurance.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Hotel Stay in Makka Madina</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Food :: Indian Set Menu 3 Meals.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Ziarats in Makka &amp; Madina.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Round Trip Transfers.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Complimentary items provided by the Tour operator (Not for booked without bed)</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Saudi Simcard.*</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Laundry *</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Zamzam *</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Internal Transportation by bus in Groups.</li></ul>', '<ul style=\"margin-bottom: 5px; line-height: 12px; color: rgb(102, 102, 102); padding: 0px 0px 0px 14px; font-family: Rubik, sans-serif;\"><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">GST &amp; TCS.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Private &amp; Personal Transfers.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Room Service.</li><li style=\"list-style-type: disc; padding: 0px 0px 10px; line-height: 20px;\">Anything not Mentioned in Inclusions.</li></ul><p style=\"margin-bottom: 0px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); padding: 0px; line-height: 18px !important;\"><span style=\"font-weight: 600;\">- Please note :-&nbsp; Bucket and Tubs will not be available in hotels</span></p><p style=\"margin-bottom: 0px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); padding: 0px; line-height: 18px !important;\"><span style=\"font-weight: 600;\">- No Fans are not available in Rooms Only AC</span></p><p style=\"margin-bottom: 0px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); padding: 0px; line-height: 18px !important;\"><span style=\"font-weight: 600;\">- Indian Toilets are not available only English Toilets</span></p><p style=\"margin-bottom: 0px; font-family: Rubik, sans-serif; color: rgb(102, 102, 102); padding: 0px; line-height: 18px !important;\"><span style=\"font-weight: 600;\">- Water is available only on Buffet Not in Rooms.</span></p>', '<p>DAY 1 : Assemble at International Airport and board Flight to Jeddah, After arrival at Jeddah Airport &amp; immigration clearance meet our local representative who will assist and transfer you to Makkah Mukarramah (1½ - 2 hrs Journey), arrive at the Holiest City and transfer to Hotel, check in and relax to reassemble yourself for the main objective of your journey The Umrah as per instructions from our Hotel Manager. Perform Umrah (1st Umrah) with our Representative and remember us also in your dua... (Meals will be arranged as per your arrival timing)<br>&nbsp;DAY 2 : AT YOUR DISPOSAL - For Relaxation or Just Do your Ibaadats &amp; Duaas in Haram.<br>&nbsp;DAY 3 : Optional program of Local Ziarat with Professional Tour Guide such as Mina, Arafat, Muzdalifa, Jabal e Noor, Jabal E Soor and Jannat ul Mala with Live Commentaries &amp; Duaas from Islamic Scholars. Also Optional Visit to Masjid e Juraana. (2nd Umrah from Jurana)<br>&nbsp;DAY 4: AT YOUR DISPOSAL - For doing Nafil Tawafs Relax or Just Do your Ibaadats in Haram.<br>&nbsp;DAY 5 : : Optional program of TAIF with Professional Tour Guide (3nd Umrah on return from Taif is a Must)<br>&nbsp;DAY 6 : AT YOUR DISPOSAL - For doing optional Second and Third Umrah, or Just Do your Ibaadats in Haram<br>&nbsp;DAY 7 or 8 : Today get ready to checkout from your hotel as we will be moving to Madinah Munawwarah (4½ - 5hrs Journey) the 2nd Holiest City (time will be given after your arrival to Makkah, you are kindly requested to follow the timing), arrive Madinah and transfer to your hotel, check in to your hotel and relax, fresh up as you will be visiting the most awaited Masjid e Nabwi (S.A.W), enter with respect and lower your voice as our Prophet (S.A.W) is relaxing here, present your Salam to him and also give our Salam too (Meals will be arranged as per your arrival timing).<br>&nbsp;DAY 09 : Optional program of Local Ziarats with Professional Tour Guide visiting all the Historical places in Madina i.e. Masjid E Quba, Masjid E Qiblatain, Saba-Masajid, and Jabal e Ohud with Live Commentaries &amp; Duaas from Islamic Scholars. You will be given time to offer two Rakaat Namaaz in Masjid e Quba and Masjid e Qiblatain. DAY 10 : Optional program of Ziarat Badar with Professional Tour Guide. It is situated approximately 80 miles southwest of Medina, Saudi Arabia. The pilgrimage to Ziarat Badar provides an opportunity for Muslims to step back in time and reflect upon the courage and faith of the early Muslims who participated in the Battle of Badr.<br>DAY 11,12,13 : Spend your Time in Masjid E Nabvi or Visit Quba on Foot and spend most of the time in Ibadats and Astagfaar.<br>&nbsp;DAY 14 or 15 : Today is the last day of our Holy Journey, pack your baggage and get ready until your pickup from Hotel and drop to Jeddah Airport (5 – 6 Hrs Journey) with all the happy memories of your Journey.&nbsp;<br></p>', '<p>Ticket cost is included&nbsp;<br>all transports are in SIC basis<br></p>', '<p>3 Time meals in buffettttt<br></p>', '<p>Visa and Insurance are included&nbsp;<br>Taxes are excluded<br></p>', NULL, 'test', 1, '2024-10-01 18:07:02', '2024-10-07 16:07:38', NULL);
