(1, 'COMPLAIN FORMAT MAKKA AND MADINA', '7', '<p><strong>COMPLAINS AND FEEDBACK</strong></p>\n\n<p>Dear Trade Partners,<br />\nif your Guests calls you and Complains about any of <strong>RAHAT SERVICES</strong> in <strong>MAKKA </strong>or <strong>MADINA</strong>,</p>\n\n<p>Please take from him his.</p>\n\n<p><span style=\"font-size:14px\"><strong>1. City ::&nbsp;<br />\n2. Hotel name ::&nbsp;&nbsp;<br />\n3. Room ::&nbsp;<br />\n4. Guest name ::&nbsp;&nbsp;<br />\n5. Mobile number ::&nbsp;<br />\n6. Problem ::&nbsp;<br />\n7. Booking id ::<br />\n8. Departure date from india ::<br />\n9. Agency name ::</strong></span></p>\n\n<p>We assure you that if the complain is <strong>GENUINE </strong>within <strong>12-24 hrs</strong> it will be solved <strong>In SHA ALLAH.</strong></p>\n\n<p>also if your Guests Returns <strong>Satisfied </strong>do take their <strong>Interviews </strong>and Feedback and post it in our Whatsupp Group....</p>\n\n<p>Regards</p>\n\n<p>Imran R Shaikh<br />\n<strong>Managing Director</strong><br />\nRAHAT GROUP</p>\n', 1, '2019-10-07', 1, '2019-10-07 00:00:00', '2019-10-07 00:00:00', NULL),
(2, 'No Cash Deposits Over 49 Thousand- Income Tax Notice', '6', '<div class=\"col-sm-9 col-md-9\">\n<h2>Dear Trade Partners,</h2>\n\n<p>Notice is hereby given to all our Trade Partners on 31st Mar 2017 that as per the provisions of <strong><span style=\"color:red\">FINANCE BILL 2017,</span></strong> the new section 269ST in the INCOME TAX ACT restricts receiving any payments in CASH <strong><span style=\"color:red\">exceeding an amount of Rs 2,00,000/- (Two Lakh Only)</span></strong> From Any Person in a Single Day or for a SINGLE TRANSACTION over multiple days, <strong>Penalty for NON COMPLIANCE of the said section is an amount equal to CASH RECEIVE.</strong></p>\n\n<p>AS SUCH, <strong>RAHAT TRAVELS of INDIA &amp; Its GROUP Companies</strong> shall <strong><span style=\"color:red\">NOT ACCEPT CASH PAYMENTS</span></strong> against bookings <strong><span style=\"color:#7030a0\">with effect from 1st APRIL 2017</span></strong> as per the above provisions. Further we shall not accept direct CASH DEPOSITS to any of our BANK Accounts. <strong>All Payments must be made through CHEQUE and/or DRAFT and/or RTGS/or NEFT/IMPS transaction only.</strong></p>\n\n<p><strong>Anyone doing a DIRECT CASH DEPSOIT to our ACCOUNTS in any branch after this NOTICE will be solely &amp; completely Responsible for any PENALTY or NON COMPLIANCE.</strong></p>\n\n<p>&nbsp;</p>\n\n<p><u><strong><span style=\"background-color:#2ecc71\">Kindly make note of the following changes in IT law that come into effect from 1-4-2017 -</span></strong></u></p>\n\n<p>(1) Limit for payment of expenses by cash&nbsp; (both, capital and revenue expenditure) reduced from Rs.20000 to Rs.10000 per day in aggregate per person.&nbsp; Capital expenses paid in cash beyond the said limit will not be taken into account for depreciation purposes.&nbsp; However, the cash payment limit for lorry fright etc. remains the same at Rs.35000.</p>\n\n<p>(2) No person shall receive an amount of two lakh rupees or more, by cash (Sec. 269ST) &mdash;<br />\n(a) in aggregate from a person in a day; or<br />\n(b) in respect of a single transaction; or<br />\n(c) in respect of transactions relating to one event or occasion.<br />\nThe penalty for violation of above is to be a sum equal to the amount of such receipt.</p>\n\n<p>Examples for above -</p>\n\n<p>???? i) If one sells goods worth Rs. 300000 through three different bills of Rs.100000 each to one person and accepts cash in single day at different times then section 269ST(a) will get violated.</p>\n\n<p>???? ii) If one sells goods worth Rs. 300000 through single bill to another person and receives cash of Rs.150000 on day 1 and another Rs.150000 on day 2 then section 269ST(b) will get violated, since it pertains to single transaction.</p>\n\n<p>???? iii) If one accepts cash of Rs.180000 for sales and Rs.20000 for freight charges,&nbsp; then section 269ST(c) will get violated even if cash is accepted on different dates, since they pertain to a single sales event.</p>\n\n<p>???? iv) If one sells his car for Rs.300000&nbsp; and receives the amount in cash, then penalty levied on him will be Rs.300000.</p>\n\n<p>(2A)&nbsp; In view of the newly introduced above said penal provisions relating to cash sales, the existing provisions (in vogue from 1.6.2016) relating to collection of TCS @ 1% on cash sales exceeding Rs.2 lakhs (Rs.5 lakhs, in the case of jewellery) are deleted.&nbsp; Consequently, there is no need to collect TCS on cash sales exceeding Rs.2 lakhs.&nbsp; Straight away it will attract equal amount penalty now.<br />\n&nbsp;<br />\n(3) For below Rs.2 crores turnover cases -<br />\n???? For Non Cash Sales (through Digital, Online, cheque, Bank etc.)&nbsp; : Net Profit will be taken as 6% of Turnover/Gross Receipt.<br />\n???? For Cash Sales : Net Profit will be taken as 8% of Turnover/Gross Receipt.</p>\n\n<p>(4) Tax Exemption limit is Rs.2,50,000/- (same as earlier) -<br />\n???? After that, upto Rs.5 lakh, Tax Rate is 5% (earlier it was 10%).&nbsp; Tax rebate of maximum Rs.2500 will be allowed, for total income upto Rs.3.50 lakhs.<br />\n???? Individuals having total income exceeding Rs.50 lakhs but below Rs.1 crore, are to pay surcharge @ 10% of the tax.&nbsp; Those having total income exceeding Rs. 1 crore shall continue to pay surcharge @ 15%.</p>\n\n<p>(5) Payment of Rent - Rs.50,000 per month by any Individual or HUF (not subject to Tax Audit requirements) - deduct TDS @ 5%.</p>\n\n<p>(6) Capital Gain in respect of Land &amp; Buildings -<br />\n&ndash; Periodicity for long term Capital Gain is reduced from 3 years to 2 years.<br />\n&ndash; Base year shifted from 01.04.1981 to 01.04.2001 for all assets including Immovable property.</p>\n\n<p>(7) Corporate tax rate for the account year 2017-18 for companies with annual turnover upto Rs. 50 crores (in the account year 2015-16) is reduced to 25%.&nbsp; No change in firm tax rate of 30%.</p>\n\n<p>(8) Donations made exceeding Rs.2000 will be not be eligible for deduction under section 80G, unless these are made using modes other than cash.&nbsp; Consequently, trusts accepting 80G donations may advise their donors to give donations exceeding Rs.2000 vide cheque / RTGS / digital modes.</p>\n\n<p>(9) Sale of unquoted shares to be taxed at (deemed) fair value.</p>\n\n<p>(10) In absence of PAN of the buyer of specified goods, the rate of TCS will be twice of the extent rate or 5%, whichever is higher.</p>\n\n<p>(11)&nbsp; From financial year 2017-18, if Return is not filed within due date, late fee of Rs.5000 for delay up to 31st December, and Rs. 10000 thereafter.</p>\n\n<p>(12) Every person who is eligible to obtain AADHAR number, should quote such number, on or after 1 July 2017, in the Return of income. Furthermore, every person who has been allotted PAN as on 1st July 2017 must intimate the AADHAR number to the Tax Authority, failing which, PAN allotted to such person shall be deemed to be invalid.&nbsp; Kindly note that linking of AADHAR with PAN is not possible, unless name as per AADHAR and PAN match perfectly.&nbsp; Hence, please take steps to rectify your name as per AADHAR to match as per PAN.</p>\n\n<p>(13) Where Sec.12AA registered trusts modify their objects clause, they need to apply within 30 days to CIT for approval of the modified clauses.</p>\n\n<p>-----------------</p>\n\n<p><strong>RAHAT TRAVELS OF INDIA GROUP</strong><br />\n305. SVP ROAD. SHOP NO 10, DONGRI. MUMBAI-3.</p>\n</div>\n', 0, '2019-12-07', 1, '2019-10-07 00:00:00', '2022-06-09 00:00:00', NULL),
(3, 'Mumbai Head Office - Staff Contact Details', '7', '<p><span style=\"font-size:18px\"><strong>Rahat Contact Details</strong></span></p>\r\n\r\n<p>We are glad to inform you that all all our<strong> <span style=\"font-size:16px\">Landline and Epbax</span> </strong>systems are working now.&nbsp;</p>\r\n\r\n<p>OFFICE CONTACT DETAILS<br />\r\nReception :: 022 23407700</p>\r\n\r\n<p><strong>Aamir</strong> :: +91 998 786 4449 ::&nbsp;<br />\r\nLandline :: 022 23407766<br />\r\nExtension :: 707</p>\r\n\r\n<p><strong>Salman</strong> :: +91750619 555 1&nbsp;<br />\r\nExtension :: 706</p>\r\n\r\n<p><strong>Sumaiya Naik</strong> :: +91 937254 5559<br />\r\nLandline :: 022 23407700<br />\r\nExtension :: 786</p>\r\n\r\n<p><strong>Saif</strong> :: +91 9967 786 446 ::&nbsp;<br />\r\nLandline :: 022 23407755<br />\r\nExtension :: 725</p>\r\n\r\n<p><strong>Umair</strong> :: +91 8879 453 555 ::&nbsp;<br />\r\nExtension :: 711</p>\r\n\r\n<p><strong>Mehreen</strong> :: +91 892 8515 439 ::<br />\r\nExtension :: 713</p>\r\n\r\n<p><strong>Fahad</strong> :: +91 7666 00 4958<br />\r\nLandline :: 022 23407744<br />\r\nExtension :: 708/709</p>\r\n\r\n<p><strong>Sumaiya Qureshi</strong>:: +91 7 5060 28252 ,&nbsp;<br />\r\nExtension :: 704</p>\r\n\r\n<p><strong>Saima</strong> :: +91 70458 55 371,<br />\r\nLandline :: 022 23407733<br />\r\nExtension :: 703</p>\r\n\r\n<p><strong>Imran</strong> :: +91 816 959 5583.<br />\r\nLandline :: 022 23407722<br />\r\nExtension :: 701/702/730</p>\r\n\r\n<p>Website :: https://www.rahat.in<br />\r\nEmail :: info@rahat.in</p>\r\n', 0, '2022-06-06', 1, '2019-10-07 00:00:00', '2022-06-11 00:00:00', NULL),
(4, 'VERY IMPORTANT - Rules for Passport Scan', '7', '<p>Dear Sir,</p>\r\n\r\n<p>Please send all Passport SCAN COPIES FOR UMRAH VISA PROCESSING on this email id only</p>\r\n\r\n<p><span style=\"color:#0000CD\"><strong>visadepartment500@gmail.com</strong></span></p>\r\n\r\n<p><strong>SUBJECT of Email should be</strong>&nbsp; :: DELHI :: 205654 :: 13th SEPT :: 04 Pax<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (Departure City :: Booking id :: Travel Date :: Total Pax)</p>\r\n\r\n<p><br />\r\n<strong>NOTE ::&nbsp;</strong><br />\r\n1. Passport scan should be in PDF or JPG format only.<br />\r\n2. One Passport SIZE Latest Photo on white Background.<br />\r\n&nbsp; &nbsp; Size :: 4kb Dimensions :: (148 Width * 174) Height pixels.<br />\r\n3. Attach a Excel Sheet mentioning with Name list, Passport Number and Relation.<br />\r\n4. Pancard copies of the Clients.</p>\r\n\r\n<p><br />\r\nFor PASSPORT SCAN COPIES - For UMRAH VISA</p>\r\n\r\n<p>ONCE YOU HAVE EMAILED THE SCAN COPIES...</p>\r\n\r\n<p>Please&nbsp; take confirmation on following Mobile What-supp ::+91 93 725 4555 9</p>\r\n\r\n<p>or Call Direct Landline :: 022 - 23407722 :: Visa Department&nbsp;<br />\r\n(Hanzala, Umair, Farhan, Sumaiya)</p>\r\n\r\n<p>Please Note SCAN COPIES SHOULD BE Very CLEAR and READABLE</p>\r\n\r\n<p>Only if above conditions are met we will process passports on SOFT COPIES.</p>\r\n\r\n<p><br />\r\nRegards</p>\r\n\r\n<p><br />\r\nImran R Shaikh</p>\r\n', 0, '2019-10-07', 1, '2019-10-07 00:00:00', '2019-10-07 00:00:00', NULL),
(5, 'HOTELS FOR OUR GROUPS', '7', '<div>Dear Friends,</div>\r\n\r\n<div>Please Note that we have above <span style=\"color:#FF0000\"><strong>Hotels for our GROUPS</strong></span> but in some situations we may give SIMILAR hotels to our GROUP HOTELS that is why we have written <strong>OR SIMILAR</strong> in our VOUCHERS,</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Like if we dont get <span style=\"color:#0000CD\"><strong>ANWAR DEAFA</strong> </span>we can give <strong>TALA AL BADAR or SIMILAR </strong>hotel.</div>\r\n\r\n<div>Like if we dont get <span style=\"color:#0000CD\"><strong>MIRA AJYAAD</strong></span> we can give <strong>ANWAR DEAFA or SIMILAR</strong> hotel.</div>\r\n\r\n<div>Like if we dont get<span style=\"color:#0000CD\"> <strong>RIYAD DEAFA </strong></span>we can give <strong>SAFEER DEAFA or SIMILAR </strong>hotel.</div>\r\n\r\n<div>You have to mention and make your haji understand the meaning of or similar</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Regards</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Imran Rahat Shaikh</div>\r\n', 0, '2019-10-16', 1, '2019-10-16 00:00:00', '2019-10-16 00:00:00', NULL),
(6, 'Spelling Mistakes on E-VISA', '6', '<p><span style=\"color:#FF0000\"><strong>Spelling Mistakes on E-VISA</strong></span></p>\r\n\r\n<p>Dear Friends,<br />\r\nAll our<span style=\"color:#0000CD\"> <strong>Visas are processed at least 5 days before Departure</strong></span><br />\r\nYou are <strong>REQUESTED</strong> to please make <span style=\"color:#FF0000\"><strong>Full payment before 5 days </strong></span>and collect your <span style=\"color:#0000CD\"><strong>VISAS &amp; CHECK THEM</strong></span> for any MISTAKES - Mehram Mistakes, Spelling Mistakes, Photo Mistakes.</p>\r\n\r\n<p>We will <span style=\"color:#FF0000\"><strong>NOT BE RESPONSIBLE</strong> </span>for any Guest Missing the flights if you did not check the VISAS.</p>\r\n\r\n<p>If their are <strong><span style=\"color:#0000CD\">ANY MISTAKE</span></strong> we need a MESSAGE in your Whatsupp GROUP only that will hold good.</p>\r\n\r\n<p>Regards</p>\r\n\r\n<p>Imran Rahat Shaikh</p>\r\n', 0, '2019-10-16', 1, '2019-10-16 00:00:00', '2019-10-16 00:00:00', NULL),
(7, 'ANNOUNCED UMRAH PACKAGE', '7', '<p><span style=\"color:#000000\">Alhamdulillah<br />\r\nPlease note that we <strong>ANNOUNCED UMRAH PACKAGE</strong> now for FULL SEASON<br />\r\n- We have BLUE AND RED FLIERS Till <strong>31st MARCH 2020</strong><br />\r\n- THEN WE HAVE <strong>SHABAAN + RAMZAAN</strong> on YELLOW FLIERS.<br />\r\n- THEN WE HAVE <strong>FULL RAMZAAN&nbsp; FLIERS</strong> on same YELLOW FLIERS.<br />\r\n- THEN WE HAVE <strong>RAMZAAN&nbsp; + SHAWWAL</strong> on same YELLOW FLIERS.<br />\r\n- THEN WE HAVE <strong>SHORT HAJJ + LONG HAJJ</strong> Separate FLIERS.&nbsp;<br />\r\n-- Also we keep sending SPECIAL OFFERS as and when we get cheap fares..</span></p>\r\n\r\n<p><span style=\"color:#000000\">Do Remember RAHAT se RAHAT HAI...</span></p>\r\n\r\n<p><span style=\"color:#000000\">Please Note if you need any <strong>HOTEL PICS or VIDEOS</strong> do send me Whatsspp on my <strong>personal number +91 8879453555</strong></span></p>\r\n\r\n<p><span style=\"color:#000000\"><strong>Daily HOTEL And Pics and VIDEO Updates can be checked on our Facebook page :</strong>:&nbsp;</span></p>\r\n\r\n<p><span style=\"color:#000000\"><a href=\"https://www.facebook.com/rahattravelsofindia\"><strong>https://www.facebook.com/rahattravelsofindia/</strong></a></span></p>\r\n', 0, '2019-11-07', 1, '2019-11-07 00:00:00', '2019-11-07 00:00:00', NULL),
(8, 'VERY IMPORTANT NOTE', '7', '<p><span style=\"color:#000000\"><strong>VERY IMPORTANT NOTE</strong><br />\r\n<strong>- UNUSED Services in UMRAH PACKAGE will not be REFUNDED</strong><br />\r\nWe cannot have anyone saying that we have not used your laundry services&nbsp;<br />\r\nor we dont like your food we need refund for that service</span></p>\r\n\r\n<p><span style=\"color:#000000\"><strong>- PACKAGE Change in between ongoing Tour is Not possible</strong><br />\r\nPackage change is possible only 7 days before Travel<br />\r\nIf you have booked in BUDGET you cannot go to saudi and tell me i need to Change to&nbsp;<br />\r\nDeluxe and i am ready to pay the difference. That cannot be done.</span></p>\r\n\r\n<p><span style=\"color:#000000\"><strong>- All Special Offers are with 100% Non Refundable payment</strong><br />\r\nYou cannot deposit 5000 or 10000 and ask me to hold seats for you<br />\r\nBecoz special offers are from LCC Carriers &amp; AIRLINES that do not hold seats.</span></p>\r\n', 0, '2019-11-07', 1, '2019-11-07 00:00:00', '2019-11-07 00:00:00', NULL);
