INSERT INTO `aihut_services` (`id`, `name`, `slug`, `description`, `price`, `service_img`, `is_active`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Book A Laundry', 'book-a-laundry', '<p>Now You can book Laundry Service for your Umrah Groups or Family in \nMakka or Madina. Laundry Services Will be Provided for One Pair Of Cloth\n Daily with Free Pickup and Drop at your Hotel in MAKKA and MADINA and \nWith Washing You will Get IRONING Complimentary and Your Clothes will be\n delivered to your Hotel within 24 Hrs in Plastic Wrapping. Just fill \nthis Small Form and our Representative will get in touch with you \nImmediately.</p><p></p>', 6.00, '157d748e-d710-4052-95d3-575477f45052.png', 1, '2024-09-14 19:41:16', '2024-09-14 19:52:26', NULL),
(2, 'Book a Forex', 'book-a-forex', '<p>Your <i>car</i> is your automobile, your wheels, your vehicle. A <i>car</i> can also be another kind of moving compartment — such as a railroad <i>car</i>, a cable <i>car</i>, or a trolley <i>car</i>.</p>', 800.00, 'e3474772-f6c9-4288-9dc8-077721a56bed.png', 1, '2024-09-17 17:50:21', '2024-09-17 17:51:01', NULL);
