INSERT INTO `aihut_shopping` (`id`, `shp_name`, `description`, `price`, `image`, `is_active`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Nabi booty', '<p><span style=\"font-weight: bolder; color: rgb(51, 51, 51); font-family: Montserrat, sans-serif;\">Nabi booty&nbsp;</span><span style=\"color: rgb(51, 51, 51); font-family: Montserrat, sans-serif;\">is an herb which is found in Madinah. If someone is finding it hard to have a baby, do buy Nabi Booti during/after performing Umrah for them. It is reported that once a&nbsp;</span><a href=\"file:///C:/Users/USER/Desktop/New%20folder%20(4)/hajjumrahonline/shopping.html#tid10\" title=\"More\" class=\"fancybox\" style=\"color: rgb(45, 111, 118); background-color: rgb(255, 255, 255); transition-duration: 0.4s; transition-property: all; font-family: Montserrat, sans-serif;\">More</a><br></p>', 999.00, 'e9bba353-aec4-4344-9520-7a40718c3e8d.jpg', 1, '2024-09-23 12:06:14', '2024-09-24 17:45:12', NULL),
(2, 'Maryam Booti.', '<p><span style=\"font-weight: bolder; color: rgb(51, 51, 51); font-family: Montserrat, sans-serif;\">Top 10 benefits of Zamzam water</span><br style=\"color: rgb(51, 51, 51); font-family: Montserrat, sans-serif;\"><span style=\"color: rgb(51, 51, 51); font-family: Montserrat, sans-serif;\">Zamzam is a blessed water body, which quenches thirsting people across the globe, especially the Haji who travel to Mecca and Madina for Haj.</span><a href=\"file:///C:/Users/USER/Desktop/New%20folder%20(4)/hajjumrahonline/shopping.html#\" title=\"More\" style=\"color: rgb(45, 111, 118); background-color: rgb(255, 255, 255); transition-duration: 0.4s; transition-property: all; font-family: Montserrat, sans-serif;\">More</a><br></p>', 2999.00, '0bedd406-6036-4e79-9288-af74a16af53c.jpg', 1, '2024-09-23 12:31:01', '2024-09-24 17:45:00', NULL);
